INSERT INTO `characteristics` VALUES (1,1,NULL,'你的性格重视逻辑、分析和决断，只要具备足够的外倾性，你很可能成为优秀的管理者。同时，你也很可能成为尽职尽责的律师，因为你从来不会心存侥幸，总能够抓住\r\n对方的漏洞和错误。','优势',1),(2,1,NULL,'你是一个认真而严谨的人，勤奋而负有责任感，认准的事情很少会改变或气馁，做事深思熟虑，信守承诺并值得信赖。','优势',2),(5,1,NULL,'你依靠理智的思考来做决定，总是采取客观、合乎逻辑的步骤，不会感情用事，甚至在遇到危机时都能够表现得平静。','优势',3),(6,1,NULL,'你喜欢先充分收集各种信息，然后根据信息去综合考虑实际的解决方法，而不是运用理论去解决。你对细节非常敏感，有很实际的判断力，决定时能够运用精确的证据和过去的经验来支持自己的观点，并且非常系统有条不紊，对那些不这样做的人没有耐心。','优势',4),(7,1,NULL,'你非常固执，一旦决定的事情，会对其他的观点置之不理，并经常沉浸于具体的细节和日常的操作中。','盲点',1),(8,1,NULL,'你看问题有很强的批判性，通常持怀疑态度，你需要时常的换位思考，更广泛的收集信息，并理智的评估自己的行为带来的可能后果。','盲点',2),(9,1,NULL,'你非常独立，我行我素，不能理解不合逻辑的事情，忽视他人的情感，并对与你风格不同的人不能理解，非常挑剔；你要学会欣赏他人的优点并及时表达出来。','盲点',3),(10,1,NULL,'你非常有主见，时常会将自己的观点和标准强加给别人，而且无视那些不自信的人的建议。在处理问题时，强求别人按照自己的想法来做，对于未经检验或非常规的方法\r\n不加考虑。若能在以后多尝试和接受新颖的、有创造性的方法，你就能做出更有效的决策。','盲点',4),(11,2,NULL,'你具有友善、负责、认真、忠于职守的特点，只要你认为应该做的事，不管有多少麻烦都要去做，但却厌烦去做你认为毫无意义的事情。','优势',1),(12,2,NULL,'你务实、实事求是，追求具体和明确的事情，喜欢做实际的考虑。善于单独思考、收集和考察丰富的外在信息。不喜欢逻辑的思考和理论的应用，拥有对细节很强的记忆力。','优势',2),(13,2,NULL,'你与人交往时较为敏感，谦逊而少言、善良、有同情心，喜欢关心他人并提供实际的帮助，你对朋友忠实友好，有奉献精神。虽然在很多情况下你有很强烈的反应，但通常不愿意将个人情感表现出来。','优势',3),(14,2,NULL,'你做事有很强的原则性，尊重约定，严谨而有条理，愿意承担责任，具有客观的判断和敏锐的洞察力。','优势',4),(15,2,NULL,'你有高度的责任心，会陷入日常事务的细节中去，这总是让你过度劳累，压力很大时，你会过度紧张，甚至产生消极情绪。','盲点',1),(16,2,NULL,'由于你的现实、细致，有时容易忽略事情的全局和发展变化趋势，难以预见存在的可能性。建议你周到考虑解决问题的不同方法和可能性，需要增强对远景的关注。','盲点',2),(17,2,NULL,'你总是替别人着想，以至于让人感觉“关心过度”，你需要学会给别人空间。有时候你可能过多承受和忍耐，不太习惯表达，却将情绪在家庭和朋友中发泄出来。','盲点',3),(18,2,NULL,'你不停地制订计划并保证完成，以致于经常花费更多的时间和投入更多的精力来完成工作，建议你给自己安排必要的娱乐和放松的活动，不要总是“低头拉车”，需要考虑“抬头看路”。','盲点',4),(19,3,NULL,'你有计划、有条理，喜欢遵照固有的模式处理问题，乐于探求独特的方式以获得有意义的成长和发展。你通过认同和赞扬与别人进行沟通，具有很强的说服力，你可以成为伟大的领导者。','优势',1),(20,3,NULL,'你喜欢独处，性格复杂，是独立的思考者。你忠诚、有责任心，喜欢解决问题，通常在认真思考之后行动。你在同一时间内只专注一件事情。','优势',2),(21,3,NULL,'你有敏锐的洞察力，相信灵感，努力寻求生活的意义和事件的内在联系。你有坚定的原则，就算被别人怀疑，也相信自己的想法和决定，依靠坚韧不拔取得成功。','优势',3),(22,3,NULL,'他人能随时体会到你的善良和体贴，但不太了解你，因为你总是做的含蓄和复杂。事实上你是非常重感情，忠于自我价值观，有强烈的愿望为大家做贡献，有时候你也很紧张和敏感，但表现的深藏不露。','优势',4),(23,3,NULL,'你的完美和固执，使你易走极端。一旦决定后，拒绝改变，并抵制那些与你的价值相冲突的想法，以至于变的没有远见。你专注的追求一个理想，不会听取别人的客观意见，因为自己的地位是不容置疑的。','盲点',1),(24,3,NULL,'你总是探寻事情的意义和价值，过于专注各种想法，会显得不切实际，而且经常会忽视一些常规的细节。你需要留意周围的情况，并学会运用已被证实的信息，这样可以帮助你更好的在现实世界中发挥你的创造性思维。','盲点',2),(25,3,NULL,'你会敏感，非常关注个人的感受和他人的反应，对任何批评都很介意，甚至会视为人身攻击。对你来讲，你需要客观的认识自己和周围的人际关系，更好的促进事情向正面转化。','盲点',3),(26,4,NULL,'考虑问题理智、清晰、简洁，不受他人影响，客观地批判一切，运用高度理性的思维做出判断，不以情感为依据。用批判的眼光审视一切，如果形势需要，会非常坚强和果断。','优势',1),(27,4,NULL,'你不屈从于权威，有判断力，对自己要求严格，近乎完美，甚至也这样去要求别人，尤其讨厌那些不知所措、混乱和低效率的人。','优势',2),(28,4,NULL,'你有很强的自制力，以自己的方式做事，不会被别人的冷遇和批评干扰，是所有性格中最独立的。','优势',3),(29,4,NULL,'你是优秀的策略家和富有远见的规划者，高度重视知识，能够很快将获取的信息进行系统整合，把情况的有利与不利方面看的很清楚。具有独特的、创造性的观点，喜欢来自多方面的挑战。在你感兴趣的领域里，会投入令人难以置信的精力、专心和动力。','优势',4),(30,4,NULL,'你只注重自己，很少去理解他人，自以为是，对他人没有耐心，总是想当然的把自己的观点强加给别人，制定不切实际的高标准。你需要学会去了解别人的感受和想法，以避免你冒犯他人。','盲点',1),(31,4,NULL,'你过于注重远见卓识，很容易忽略和错过与自己理论模式不符的细节和现象；爱玩弄\r\n智力游戏，说些对他人没有意义、似是而非的话语。你需要简化你既理论又复杂的想\r\n法，更好的与别人交流。','盲点',2),(32,4,NULL,'你有时会过于固执和死板，沉迷于一些出色的但不重要的想法中，并且事事要求完美；如果你想成功，你需要判断事情的重要性，学习接受生活并与他相处，学会放弃。','盲点',3),(33,5,NULL,'你关注周围发生的事情，常常充当解决困难的人。一旦需要，会快速反应，抓住问题的核心以最有实效的方式予以解决。你好奇心强，对事实敏感，能很好的利用手头的资源。','优势',1),(34,5,NULL,'你善于思考和分析，关注事情是什么，及可以解决什么具体问题，不关注理论。你喜欢客观独立地作决定，并把一切都清楚直接地安排妥当。你对技术工作很有天赋，是使用工具和双手工作的专家。','优势',2),(35,5,NULL,'你非常独立，不愿受规则约束，以独有的好奇心和富有创意的幽默观察和分析生活。具备很好的迎接挑战和处理问题的能力，天性喜欢兴奋和行动，通常很喜欢户外活动和运动。','优势',3),(36,5,NULL,'你通常是安静或沉默的，喜欢行动而非言语，看上去比较“酷”，时常被认为不太愿意接近人。','优势',4),(37,5,NULL,'你非常实际，总能找到简捷的解决办法，这使你有时会偷工减料，不能完成所有的步骤和细节。你过分的关注眼下的结果，以至忽略了自己的决策和行动的长远影响。建议你学会做计划并坚持完成，以克服自己主动性弱的特点。','盲点',1),(38,5,NULL,'你总是独立分析，独自判断，不喜欢与别人分享自己的反应、情感和担忧，也不愿意把具体的情况甚至是最重要的部分与他人进行交流，使得周围的人行动或配合起来比较被动。','盲点',2),(39,5,NULL,'你非常喜欢多样化和新奇刺激，对所有的选择都持开放态度，所以你不善于做决定。你需要认真给自己一些约束，避免总是变动和无规律所带来的危害。','盲点',3),(40,5,NULL,'你通常无视自己的情感和需要，忽视他的人感受，对于自己的决定对他人产生的影响不够重视。','盲点',4),(41,6,NULL,'你和蔼、友善、敏感，谦虚地看待自己的能力。你能平静愉悦地享受目前的生活，喜欢体验。珍视自由自在地安排自己的活动，有自己的空间，支配自己的时间。','优势',1),(42,6,NULL,'你善于观察、务实、讲求实际，了解现实和周围的人，并且能够灵活地对他们的情况和需要做出反应，但很少寻求其动机和含义。你是优秀的短期规划者，能够全身心地投到此时此刻的工作中，喜欢享受现今的经验而不是迅速冲往下一个挑战。','优势',2),(43,6,NULL,'你有耐心，易通融，很好相处。你没有领导别人的愿望，往往是忠实的跟随者和很好的合作伙伴。你很客观，而且能以一种实事求是的态度接受他人的行为，但你需要基本的信任和理解，需要和睦的人际关系，而且对矛盾和异议很敏感。','优势',3),(44,6,NULL,'你对自然的美丽情有独钟，对直接从经验中和感觉中得到的信息非常感兴趣，喜欢为自己创造一种幽雅而个性化的环境，你希望为社会的福利和人类的幸福做些贡献。你内心深沉，其实很热情，却不太喜欢表现。','优势',4),(45,6,NULL,'你完全着眼于现在，从不喜欢寻找和发现那些你认为不存在的可能性,这使你无法发现更广阔的前景,也不能为将来做打算,不能很好地安排时间和精力。','盲点',1),(46,6,NULL,'你天生对他人具有高度的敏感,总是难以拒绝别人，有时为了满足他人的需求而拼命地工作，以至于在此过程中忽视了自己。','盲点',2),(47,6,NULL,'你过分忽视事物之间的内在联系和逻辑思考,难以理解复杂的事情。','盲点',3),(48,6,NULL,'你对他人的批评会感到生气或气馁，有时容易过分自责。你容易相信别人，很少对别人的动机有所怀疑，也不会发现别人行为背后的隐含意义。你们需要更注重自己的需求，而且要对别人的行为加以分析。在分析中加入一些客观和怀疑的态度会让你们更准确地判断人的性格。','盲点',4),(49,7,NULL,'你非常崇尚内心的平和，看重个人的价值，忠诚，并且理想化，一旦做出选择，就会约束自己完成。','优势',1),(50,7,NULL,'你看起来沉默而冷静，但内心对他人的情感十分在意。你非常善良，有同情心，善解人意。你重视与他人有深度、真实、共同进步的关系，希望参与有助于自己及他人的进步和内在发展的工作，欣赏那些能够理解你价值的人。','优势',2),(51,7,NULL,'你有独创性、有个性，好奇心强，思路开阔，有容忍力。乐于探索事物的可能性，致力于自己的梦想和远见。','优势',3),(52,7,NULL,'你一旦全身心地投入一项工作时，你往往发挥出冲刺式的干劲，全神贯注，全力以赴。你对人、事和思想信仰负责，一般能够忠实履行自己的义务。但是，对于意义不大的日常工作，你做起来可能有些困难。','优势',4),(53,7,NULL,'你追求完美，会花很长时间酝酿自己的想法，难以用适当的方式来表达自己。你需要更加注重行动。','盲点',1),(54,7,NULL,'你经常忽略逻辑思考和具体现实，沉浸于梦想。当意识到自己的理想与现实之间的差距，你就容易灰心丧气。你需要听取他人更实际的建议，考虑方法的现实性和可行性。','盲点',2),(55,7,NULL,'你非常固执，经常局限在自己的想法里，对外界的客观具体事物没有兴趣，甚至忙的不知道周围发生了什么事情。','盲点',3),(56,7,NULL,'你总是用高标准来要求自己，投入太多的感情，导致你对批评相当敏感。压力很大的时候，你可能会非常怀疑自己或他人的能力，而变得吹毛求疵，又爱瞎判断，对一切都有抵触情绪。','盲点',4),(57,8,NULL,'你极其聪慧，有逻辑性，善于处理概念性的问题，且有很强的创造灵感，对发现可能性更感兴趣。','优势',1),(58,8,NULL,'你非常独立，有批判性和怀疑精神，内心通常在投入地思考问题，总是试图找运用理论分析各种问题；对一个观点或形势能做出超乎超于常人的、独立准确的分析，会提出尖锐的问题，也会向自己挑战以发现新的合乎逻辑的方法。','优势',2),(59,8,NULL,'你更善于处理概念和想法，而不是与人打交道。喜欢有逻辑性的和目的性的交谈，但有时想法过于复杂以至于难与别人交流和让别人理解，也会只是为了高兴而就一点儿小事儿争论不休。','优势',3),(60,8,NULL,'你能宽容很多不同的行为，只是在自己认为应该的时候才争论和提出问题，但是如果你的基本原则受到挑战，你就不再保持灵活性而以原则办事。','优势',4),(61,8,NULL,'如果你没有机会运用自己的才能，或得不到赏识，会感到沮丧，爱打嘴仗，好争论，冷嘲热讽，消极的批判一切。','盲点',1),(62,8,NULL,'你会过分理智，忽视情感和现实，察觉不到他人的需要，也不考虑自己的观点对他人的影响，以“不符合”逻辑为由，主观断定某些自己或他人看重的东西的是不重要的，不够实际。','盲点',2),(63,8,NULL,'当你把自己批判的思维用在人的身上时，你的直率会变成无心的伤害。你需要找到自己真正在乎的事，这将帮助你们更真实地对待自己的情感。','盲点',3),(64,8,NULL,'你对解决问题非常着迷，极善于发现想法中的缺陷，却很难把它们表达出来，你对常规的细节没有耐心，如果事情需要太多的琐碎细节，你会失去兴趣，也会因计划中很小的缺陷而陷入困境，你绝不容忍任何一点不合逻辑。','盲点',4),(65,9,NULL,'你是敏锐的发现者，善