不愉快，因此尽力避免发生这样的事情。','优势',2),(105,14,NULL,'你很实际、有条理，做事彻底，有一致性，对细节和事实有出色的记忆力。着眼于目前，能将事情安排妥当，喜欢自己成为活跃而有用的人物。喜爱自己的全部，对自己爱护有加。','优势',3),(106,14,NULL,'喜欢组织大家活动，喜欢安全和稳定的环境，注重并很好地遵守社会规范。忠于自己的职责，并愿意超出自己的责任范围而做一些对别人有帮助或有益处的事情，在遇到困难和取得成功时，都很积极活跃，希望付出能得到回报或赞扬。','优势',4),(107,14,NULL,'你有时过分在意别人的情感和想法，以至于总是给予别人额外的关心和帮助，有时态度强硬，容易侵占别人的空间，你需要考虑一下自己提供的帮助是不是他人的需要。当遇到冲突时，为了保护和睦的人际关系，通常采取回避或是妥协的方式，而非积极的、正面的处理。','盲点',1),(108,14,NULL,'你是不是会很敏感，做事总是希望得到别人的鼓励和赞赏，担心被忽视，不愿接受批评，很可能变得沮丧和郁闷。','盲点',2),(109,14,NULL,'你总是容易陷入情感和细节中，很难从问题中跳出来更宏观、更客观的对待；取悦或帮助他人的内心很忽视自己的需求，难以说出“不”，怕让别人失望。','盲点',3),(110,14,NULL,'你通常比较难变通，不愿意尝试新方法，习惯根据经验做出决定，以至于信息不足造成决策的草率。建议尽量开放的接受外部变化，放慢决定的速度。','盲点',4),(111,15,NULL,'你善于社交、精力旺盛、热情洋溢，能很快理解他人情感的需要、动机和所忧虑的事情，因此能做到与他人高度协调。你是催化剂，能引发出他人的最佳状态。既可以做有号召力的领袖，也可以做忠实的追随者。','优势',1),(112,15,NULL,'你性情平和，心胸宽阔，很会促进周边关系的和睦。你容易看出他人的发展潜力，是体贴的助人为乐者。你愿意组织大家参与活动，使大家和睦又感到愉快。','优势',2),(113,15,NULL,'你是理想主义者，非常看重自己的价值，有责任感、谨慎、坚持不协，同时对新观点很好奇。若能为人类的利益有所贡献，会感到深受鼓舞。','优势',3),(114,15,NULL,'你对现实以外的可能性，以及对他人的影响非常感兴趣，常常会发现别人看不到的意义和联系，并感到自己与万物息息相关，可以井然有序地安排生活和工作。','优势',4),(115,15,NULL,'你非常理想化，认为世界是自己想象中的那样，不愿意接受与此相抵触的事情，经常忽略理想所需要的现实和细节问题。','盲点',1),(116,15,NULL,'你依照情感行事，却缺少逻辑思维，常常根据个人的价值观进行判断，无视行为所带来的后果，有时会过度陷入别人的情感和问题中。试着更多地去关注事情，而不只是人，更有利于你合理地做出决定。','盲点',2),(117,15,NULL,'你有很高的热情，急于迎接新的挑战，有时会做出错误的假设或过于草率的决定。建议你对计划中的细节多加注意，等获取足够多的信息之后再做决策。','盲点',3),(118,15,NULL,'你对于批评比较脆弱，容易忧虑，感到内疚，失去自信。当压力很大时，会变得暴燥，慌乱、吹毛求疵。','盲点',4),(119,16,NULL,'你善于社交、精力旺盛、能很快理解他人动机，因你直率、果断，能够妥善解决同学之间的问题，是天生的领导者和组织者。你擅长发现一切事物的可能性并很愿意指导他人实现梦想。','优势',1),(120,16,NULL,'你逻辑性强，善于分析，能很快地在头脑里形成概念和理论，并能把可能性变成计划。你看重智力和能力，讨厌低效率，如果形势需要，可以非常强硬。你习惯用批判的眼光看待事物，随时可以发现不合逻辑和效率低的程序并强烈渴望修正它们。','优势',2),(121,16,NULL,'你善于系统、全局地分析和解决各种错综复杂的问题，为了达到目的，你会采取积极行动，你喜欢研究复杂的理论问题，通过分析事情的各种可能性，事先考虑周到，预见问题，并采取行动解决难题。','优势',3),(122,16,NULL,'愿意接受挑战，并希望其他人能够象自己一样投入，对常规活动不感兴趣。','优势',4),(123,16,NULL,'你经常在没有了解细节和形势之前就草率地做决定。','盲点',1),(124,16,NULL,'你总是很客观、带有批判性地对待生活，容易对别人的情况和需要表现得较直率、无耐心。建议你注意倾听周围人的心声，并对别人的贡献表示赞赏。你需要学会在实施自己的计划之前听取别人的建议，以免独断专横。','盲点',2),(125,16,NULL,'你考虑问题非常理智，很少受无关因素影响。你没有时间和兴趣去体会情感，容易忽略他人的感受，显得不尽人情。但当你的感情被忽视或没有表达出来的时候，你会非常敏感。','盲点',3),(126,16,NULL,'你容易夸大自己的经验、能力。 你需要接受他人实际而有价值的协助，才能更好的提高能力并获得成功。','盲点',4);
