INSERT INTO `child_program` VALUES (1,'审计学','审计学是一门专门研究审计理论和方法，探索审计发展规律，对经济活动进行有效监督的社会学科。 审计学是在审计实践的基础上产生的，经过实践检验和证明了的，是客观事物本质及其规律的正确反映。 审计理论必须用来指导审计实践，否则就成为脱离实际的理论。',1,'open',1),(2,'商业会计学','商业会计学是研究商业会计工作规律性的一门商业经济管理科学。它从理论上总结商业会计工作的实践经验，阐明商业会计工作的理论和方法，探索商业会计改革的途径，以充分发挥商业会计在改善经营管理、提高经济效益、维护财经纪律、保护社会主义财产等方面的作用。按照商业业务分工和管理体制的不同，商业会计学可分为国营商业会计学、供销合作社会计学、粮食商业会计学、物资会计学、饮食服务业会计学、书刊发行业会计学、旅游业会计学、储运业会计学、商品加工业会计学等。内容主要包括商业会计的产生和发展，商业会计的职能，商业会计的对象和任务，商业会计的方法及其运用等。',2,'open',1),(3,'会计与金融','金融会计专业是高等院校开设的专业之一，旨在培养金融会计人才。该专业的培养目标为：掌握企业会计信息系统与设计的基本原理、电算化会计软件初始化的设置、总帐系统、报表系统以及工资核算、固定资产核算等业务核算子系统的操作方法。理解会计信息系统的数据流程、模块构建，会计电算化对传统手工会计方式的影响；了解企业实行会计电算化的管理要求与制度规范、购销存业务核算子系统、基于商品化会计软件的数据整理与加工。',3,'open',1),(4,'Test Child Program 01','Child program brief',12,'close',1),(5,'Test Child Program 012','content',1,'close',3),(6,'分子和细胞生物学','本专业研究活动涉及细胞的分子结构及其对生物体功能、繁殖和发展中起到的作用。专业课程包括生物化学、生物物理学、分子生物学、结构生物学、遗传学、基因组学、生物信息学、细胞生物学、发育生物学、肿瘤生物学、微生物学、免疫学、发病机制和神经生物学等等。',1,'open',2),(7,'分子环境生物学','分子方法有望在不久的将来在解决环境问题中发挥越来越重要的作用，其成功将取决于对从分子到生态水平的生物学原理的深刻理解。本专业是生物学研究生学习，生物技术，环境咨询和保护资源管理的基础。',2,'open',2),(8,'营养科学','营养科学专业将打下生物学和化学的坚实基础，为饮食模式提供了建议，帮助人类实现最佳的健康状况，探索疾病的治疗或预防以及食品生产和安全方法。学习课程包括生理学与新陈代谢，分子毒理学或饮食学方面等等。',3,'open',2),(9,'微生物学','微生物学是至关重要的研究领域，因为微生物，病毒和真菌等小生命形式构成了行星生物质的大部分，并构成了生命之树的关键分支。微生物在维持生物圈健康方面发挥着根本作用：它们降解环境污染物；它们直接向多细胞生物体提供必需的营养和化学物质，并且与高等生物体发生许多有益的共生关系。传染病控制着动植物的种群，并且在全球范围内，人类社会都在爆发疾病。该专业是为对工业、医学预科和兽医感兴趣的学生而设计的。',4,'open',2),(10,'生物化学','生物化学专业除了学习数学和物理入门课程以及与化学课程外，还将修读细胞生物学，生物大分子合成学以及生物无机化学等。 这部分课程的重点是生物分子结构，酶动力学，能量和信息流以及新陈代谢。 本专业十分重视有机化学，定量热力学和动力学，以了解生物化学的逻辑。',5,'open',2),(11,'公司金融','公司财务是一个涉及资金来源，公司的资本结构，经理为增加公司对股东的价值而采取的行动以及用于分配财务资源的工具和分析的财务领域。公司融资的主要目标是最大化或增加股东价值。相应地，公司融资包括两个主要的子学科：资本预算涉及确定哪些增值项目应获得投资资金的标准以及是否以股权或债务资本为该投资提供资金。营运资金管理是对公司货币资金的管理，用于处理流动资产和流动负债的短期运营余额；这里的重点是管理现金，存货以及短期借贷（例如，扩展给客户的信贷条款）。',1,'open',3),(12,'投资银行','本专业的课程帮助学生学习金融分析技能，并加深了对金融工具和机构的机构理解。 有了这些知识，学生就可以帮助公司管理层在探索投资建议，融资方案，考虑其他方式管理现金和股息以及考虑收购和资产剥离时创造价值。 具体主题包括发行和承销新债务和股票证券以支持战略和金融买家的过程。 你还将学习有关公司活动的主要法律和法规限制，并加深你对财务报表的理解。',2,'open',3),(13,'商业银行','现代银行业代表着令人兴奋且不断增长的职业机会。 银行业的角色千差万别，包括运营，技术，贷款和信用风险分析。\r\n\r\n商业银行专业计划提供各种课程，包括银行入门课程，银行环境主要领导职能概述以及侧重于银行从事的风险管理和风险评估过程的课程。',3,'open',3),(14,'资产管理','资产管理的知识可确保以最有效的方式使用公司的资产，从而提高其盈利能力。 尽管大型企业，大学和政府机构广泛采用了小型企业，但小型企业也可以从资产管理计划中受益。 这样的计划可以帮助公司以最低的成本获得最大的收益，同时最大程度地延长资产的使用寿命。资产管理是一种以经济有效的方式开发，运营，维护和出售资产的过程。 在金融中最常使用，该术语用于指代代表个人或其他实体管理资产的个人或公司。',4,'open',3),(15,'房地产投资','该专业系统掌握房地产经营管理学科理论和技能，通晓相关学科主要理论和方法，有经、管、法和一定工程技术相互交融的良好知识结构，创新意识强，综合素质高，能在政府机关等行政事业单位、银行等各类金融机构、房地产开发经营和房地产咨询、估价、物业管理等各类企业中胜任与土地和房地产行政管理、住房保障、房地产金融、房地产投资、房地产资产经营管理、房地产价格评估等相关的实务工作。',5,'open',3),(16,'个人理财规划','个人理财业务又称财富管理业务是商业银行为个人客户提供的财务分析、财务规划、投资顾问、资产管理等专业化服务的活动。  目前是发达国家商业银行利润的重要来源。',6,'open',3),(17,'风险管理','风险管理专业的学生通过学习可以全面系统的了解风险管理学知识，并通过对当前行业中案例的解读更好的将理论与实践结合起来，以便在将来的工作中更有效的应对各种问题。',7,'open',3),(18,'流体动力学','流体力学是 \"应用科学的一个分支，涉及液体和气体的运动\"。流体动力学是流体力学的两个分支之一，即研究流体和力如何影响它们。另一个分支是流体静力学，研究静止状态下的流体。\r\n多个领域的科学家都在研究流体力学。流体动力学提供了研究恒星演化、洋流、天气模式、板块构造甚至血液循环的方法。流体动力学的一些重要技术应用包括火箭发动机、风力涡轮机、石油管道和空调系统。',1,'open',32),(19,'材料科学','要制造任何工程设备、结构或产品，你需要正确的材料。材料科学告诉我们事物是由什么构成的，以及它们为什么会有这样的行为。材料工程向我们展示了如何应用知识来制造更好的东西，并使事情变得更好。',2,'open',32),(20,'制造工艺','制造的过程是一个复杂的活动，这里面涉及的人需要有广泛的学科和专业知识，以及广泛的机械，工具和设备，如计算机，机器人和其他设备的自动化水平等等。制造工艺学习的就是如何将你的设计实际的生产出来。',3,'open',32),(21,'热力学','热力学是物理学的一个分支，处理热和其他形式的能量之间的关系。特别是，它描述了热能如何转化为其他形式的能量以及它如何影响物质。',4,'open',32),(22,'医学人类学','医学人类学作为人类学的一个分支，专注于研究健康，疾病和文化之间的关系。 不同文化背景对于健康的理念和做法大不相同，同时也会受到社会，宗教，政治，历史和经济因素的影响。 医学人类学家使用人类学理论和方法来了解世界各地不同文化群体如何回应疾病和健康问题。医学人类学是人类学领域发展最快的一门学科，对公共卫生领域有着重要影响，是社会科学和医学之间重要的桥梁。',1,'open',13),(23,'社会文化人类学','文化人类学家使用人类学理论和方法来研究各种文化主题，包括人群身份，宗教，血缘关系，艺术，种族，性别，阶级，移民，性，全球化，社会运动等等。\r\n',2,'open',13),(24,'影视人类学','视觉人类学是在民族志研究中以通过使用摄影，电影和视频来加强人类学观察和观点的交流。探索的话题例如：人类作为一个物种在多大程度上依赖所看到的事物，他们如何将其融入生活？视觉人类学的产出通常是叙事（电影，视频，写真集），从而传达文化场景中的事件。',3,'open',13),(25,'经济社会学','经济社会学通常会结合更多经济学的理论，研究更多关于社会中生产，分配，交换和消费等经济行为，也一定程度上需要用到数学分析，从定量的角度看待社会问题。',1,'open',14),(26,'文化社会学','文化社会学会更偏向研究文化的诞生，展现，变化和传播在社会中产生的影响，此外，还会研究民族文化的发展趋势、世界文化的趋向等问题。',2,'open',14),(27,'政治社会学','政治社会学是政治学和社会学的跨学科产物。研究社会与政治之间的互动关系，政治权威的产生及其对社会的影响。研究范围包括：政治的社会根源社会结构与政治 社会与政治变革 政治精英和政治体系对社会的反作用。',3,'open',14),(28,'房地产管理','房地产管理主要学习如何开发、估价、购买、销售土地和房屋。课程通常会有资产管理、建筑开发管理、城市经济、地产法、地产投资等内容。',1,'open',18),(29,'活动管理','活动管理专业侧重于学习如何办好一场活动，比如婚礼、音乐节、体育比赛、展览、庆典等等，课程通常包含项目管理、金融管理、人力资源管理、物流管理、设计、公共关系、传媒等内容。',2,'open',18),(30,'儿科','该临床细分专业课程旨在为学生提供儿科基础知识。 通过各种临床经验，学生将参加小儿患者的护理。 学生将发展和完善针对患者问题的临床技能（例如，面试，体格检查，鉴别诊断以及制定治疗计划）。',1,'open',11),(31,'急诊医学','该临床细分专业课程旨在为学生提供急诊医学的基础知识。 通过各种临床经验，学生将参加急诊医学患者的护理。 学生将发展和完善针对患者问题的临床技能（例如，面试，体格检查，鉴别诊断以及制定治疗计划）。',2,'open',11),(32,'神经科','该临床细分专业课程旨在为学生提供神经医学的基础知识。 通过各种临床经验，学生将参加患者的护理。 学生将发展和完善针对患者问题的临床技能（例如，面试，体格检查，鉴别诊断以及制定治疗计划）。',3,'open',11),(33,'内科','该临床细分专业课程旨在为学生提供内科医学的基础知识。 通过各种临床经验，学生将参加患者的护理。 学生将发展和完善针对患者问题的临床技能（例如，面试，体格检查，鉴别诊断以及制定治疗计划）。',4,'open',11),(34,'外科','该临床细分专业课程旨在为学生提供外科医学的基础知识。 通过各种临床经验，学生将参加患者的护理。 学生将发展和完善针对患者问题的临床技能（例如，面试，体格检查，鉴别诊断以及制定治疗计划）。',5,'open',11),(35,'妇产科','该临床细分专业课程旨在为学生提供妇产科医学的基础知识。 通过各种临床经验，学生将参加患者的护理。 学生将发展和完善针对患者问题的临床技能（例如，面试，体格检查，鉴别诊断以及制定治疗计划）。',6,'open',11),(36,'城市规划','城市规划的目的，不仅仅在于安排好城市形体??城市中的建筑、街道、公园、公用事业及其它的各种要求，而且更重要的在于实现社会与经济目标。由于城市是一个很具社会特征的对象，除了工程类的知识外，还需要具备许多社会知识，甚至包括一些文学、美学知识。',1,'open',25),(37,'建筑工程','建筑工程学侧重研究如何搭建好一个建筑，知识范围包括工程力学、测量和结构工程。课程会有更多使用建模软件和诸如3D打印设备来设计和测试建筑原型。',2,'open',25),(38,'商业策略','本专业适合那些对于想了解市场竞争和政府监管如何影响商业行为的学生。',1,'open',34),(39,'国际经济学','本专业适合那些有兴趣了解国际市场运作方式，企业如何处理国际业务，以及各国如何制定贸易和发展政策的学生。',2,'open',34),(40,'数据分析','适合有兴趣提高基本统计要求之外的数据分析技能的学生。这个子专业是对其他方向的一个很好的补充，因为数据分析在许多类型的职业中都有应用。',3,'open',34),(41,'经济政策和市场分析','本专业适合那些对政府政策及其对经济的影响感兴趣的学生。',4,'open',34),(42,'认知心理学','认知科学专业方向是对心智和大脑的工作原理，以及人工智能，物体、环境、界面和信息的设计，人机交互，语言等感兴趣的学生的理想选择。该方向包括心理学系的感知、语言、认知和神经科学等课程，同时包含计算机科学系、哲学系和语言学系的课程。',2,'open',12),(43,'健康和发展心理学','健康与发展专业方向是对医学（特别是精神病学或儿科）、临床心理学、教育（各级）或健康心理学感兴趣的学生的理想选择。学习内容包括发展心理学和变态心理学的课程以及研究，同时推荐学习生物学、文化和社会人类学、教育学系的课程。',3,'open',12),(44,'社会心理学','社会心理学专业方向是对社会与文化、教育、媒体、商业或法律感兴趣的学生的理想选择。课程关注心灵、文化和社会的相互构成，旨在让学生全面了解人们生活中不同社会文化背景是如何塑造人们不同性格的，此外还会讨论关于群体现象、群体决策、顺从等相关概念。',4,'open',12),(45,'神经科学','神经科学专业方向是对心理和行为的物理过程感兴趣的学生的理想选择。该课程为对医学、神经科学、行为医学和视觉科学（包括眼科和验光）感兴趣的学生提供了良好的学习机会。在这个细分专业内的课程作业和研究训练强调用神经影像学方法探索大脑、感知和行为之间的关系。',5,'open',12),(46,'服装设计','服装设计专业为学生提供了创造性，战略性和实践性技能，为从事时装产品设计师的职业做好准备。 课程教授研究方法以及设计和制造过程。 ',1,'open',22),(47,'室内设计','室内设计是根据建筑物的使用性质、所处环境和相应标准，运用物质技术手段和建筑设计原理，创造功能合理、舒适优美、满足人们物质和精神生活需要的室内环境。',2,'open',22),(48,'交互设计','交互设计是定义、设计人造系统的行为的设计领域，交互设计努力去创造和建立的是人与产品及服务之间有意义的关系，以“在充满社会复杂性的物质世界中嵌入信息技术”为中心。交互系统设计的目标可以从“可用性”和”用户体验“两个层面上进行分析，关注以人为本的用户需求。',3,'open',22),(49,'工业设计','本专业学生主要学习工业设计的基础理论与知识，具有应用造型设计原理和法则处理各种产品的造型与色彩、形式与外观、结构与功能、结构与材料、外形与工艺、产品与人、产品与环境、市场的关系，并将这些关系统一表现在产品的造型设计的基本能力。',4,'open',22),(50,'平面设计','平面设计也称为视觉传达设计，是以“视觉”作为沟通和表现的方式，透过多种方式来创造和结合符号、图片和文字，借此作出用来传达想法或讯息的视觉表现。',5,'open',22),(51,'娱乐设计','娱乐设计专业通常会有娱乐产业概念设计、动画设计和游戏设计三个方向，每个方向都对学生有着不同能力的要求。',6,'open',22),(52,'珠宝设计','本专业学生主要学习首饰设计方面的基本理论和基础知识，学习期间学生将通过艺术设计思维能力的培养、艺术设计方法和首饰加工技能的基本训练，具备本专业基本素质。',7,'open',22),(53,'植物病理学','植物病理学专业结合了植物学，微生物学，真菌学和昆虫学，为植物学专业的学生提供了细分领域的研究机会。\r\n',1,'open',51),(54,'农作物科学','农作物科学专业是作物植物管理和作物改良的应用专业，涉及科学，商业和教育领域。 学生在植物营养，环境科学，作物生理学和生态学，生物技术和植物遗传学以及植物育种方面会进行深度学习。',2,'open',51),(55,'土壤学','土壤学专业涉及农业用水，粮食安全，土壤和水质以及安全水供应等内容。 主题包括水文学，水资源，土壤化学，土壤物理学，土壤微生物学，环境科学，土壤矿物学以及生态学的等等',3,'open',51),(56,'教育学原理','研究教育学中的基本理论问题，探求教育的一般原理和规律。 它为教育理论的发展和教育改革提供综合性的研究成果。?教育学原理是教育学中的基础学科，为其他二级学科提供理论观点和思想方法，为研究各级各类教育提供理论基础。',1,'open',16),(57,'教育心理学','教育心理学是研究在教育情境下人类的学习、教育干预的效果、教学心理，以及学校组织的社会心理学。?教育心理学的重点是把心理学的理论或研究所得应用在教育上。?教育心理学可应用于设计课程、改良教学方法、推动学习动机以及帮助学生面对成长过程中所遇上的各项困难和挑战。',2,'open',16),(58,'教育统计学','教育统计学是运用数理统计的原理与方法研究教育问题的一门应用学科。其主要任务是研究如何搜集、整理、分析由教育调查和教育实验等途径所获得的数字资料，并在此基础上进行科学推断，从而揭示蕴涵在教育现象中的客观规律。',3,'open',16),(59,'对外英语教学','如果您对跨文化交流充满热情，并希望获得在世界任何地方教授英语的资格证书，TESOL学位是适合你的。',5,'open',16),(60,'学前教育','学前教育学是研究学前年龄阶段儿童教育规律的科学，是教育学的一个分支学科。',6,'open',16),(61,'市场分析','市场分析常常被分为定性分析（Qualitative Research）和定量分析（Quantitative Research），前者更偏向从社科的角度研究市场现象，后者更偏向从统计学角度对消费者行为加以分析。',1,'open',20),(62,'国际市场营销','该细分专业主要帮助学生了解如何在全球市场上进出口商品和服务的企业中进行营销活动。 课程包括有关国际贸易制裁，对外贸易运营，市场定位，谈判实践，货币问题和国际公共关系等等。',2,'open',20),(63,'城市设计','城市设计更偏重从空间的角度进行优化，对具体的场景进行更加细节的设计。相对于偏理论的城市规划专业，课程方面会有更多设计与绘图相关内容取代人文和政策相关内容。',1,'open',21),(64,'区域发展与规划','区域发展与规划会把视角从城市延伸到更广阔的乡村地区，从更宏观的角度分析问题， 例如城镇一体化、城乡统筹、乡村土地规划、政策与发展战略等',2,'open',21),(65,'时尚管理','时尚管理(Fashion Management)是时尚产业和商业管理的结合，几乎囊括了一个时尚品牌想要成功的所有要素：市场营销、公共关系、时尚买手和商品管理、视觉营销和品牌创造、时尚零售等。',1,'open',53),(66,'娱乐产业管理','娱乐产业管理包括了电视、电影、游戏等可视娱乐内容从开发到制作，从产品分配到销售等多方面的管理和组织工作。',2,'open',53),(67,'计算理论与算法','理论主要包括算法、算法学、计算复杂性理论等，算法指用系统的方法描述解决问题的策略机制。',1,'open',30),(68,'程序设计语言与编译','研究把高级语言转换成计算机可识别的二进制，从而通过计算达到我们想要的结果作为输出，这个转变的过程即编译过程。',2,'open',30),(69,'数据库与信息','数据库是按照数据结构来组织、存储和管理数据的仓库。常涉及信息检索，数据分析，数据测试，数据提取等，如图书馆管理系统，薪资发放管理系统和自动求职系统。',3,'open',30),(70,'软件工程','一门研究用工程化方法构建和维护有效的、高质量的软件的学科，内容涉及程序语言，编程、需求分析、界面设计、功能设计和测试，如网上购物系统的总设计，校园图书馆辅助系统，通讯录管理系统开发等。',4,'open',30),(71,'人工智能','研究、开发用于模拟、延伸和扩展人的智能的理论、方法、技术及应用系统的一门新的技术科学，它试图了解智能的实质，并生产出一种新的能以人类智能相似的方式作出反应的智能机器，常涉及机器人，语音识别，图像识别，自然语言处理等。',5,'open',30),(72,'计算机安全','保护计算机硬件、软件、数据等不遭到破坏、更改和显露。常涉及计算机网络安全，计算机系统安全，信息安全和密码学等。',6,'open',30),(73,'计算生物学','开发和应用数据分析及理论的方法、数学建模和计算机仿真技术，用于生物学、行为学和社会群体系统，主要是依靠大规模计算模拟技术，从海量信息中提取最有用的数据。',7,'open',30),(74,'化学工程','本专业是为学生做好化学产品工艺开发，设计和操作方面的准备。以便未来可以进入石油，电化学，半导体，核能，航空航天，塑料，食品加工或环境控制等行业。',1,'open',28),(75,'化学生物学','本专业除了数学和物理以及一系列化学专业课程之外，学生还将学习细胞生物学，生物化学，生物高分子合成和生物无机化学。化学生物学毕业方向有生物医学，生物技术和制药行业等等。',2,'open',28),(76,'会计学','简单来说，会计是对财务信息的记录、分析和交流。\r\n\r\n它首先强调的是对企业在日常经营过程中所产生的各类财务信息的客观记录，然后再借助专业的财务分析工具来对上述的财务信息进行整理和计算以便得出本期企业的经营成果，最后将财务数据进行解释来支持企业高管的经营决策、制定未来的经营计划。\r\n\r\n可以说它是社会学科的组成部分，也是一门重要的管理学科。会计学的研究对象是资金的运动。',1,'open',52),(77,'金融学','金融学是一门非常综合的专业。它涉及到的知识包括财务计划，投资决策和分析，等各个方面。学习金融专业的你将要研究不同行业的不同公司过去的表现来预测他们将来的发展情况，并做出合理的投资和运营，管理建议。这个专业的核心课程包括会计、经济学、数学、统计心理学、投资管理等等。这个专业是社会科学类的专业，所以这个专业非常注重现实与学术的结合。\r\n',2,'open',52),(78,'市场营销','简单来说，市场营销是把一个产品或服务从生产者手中传递到消费者手中的过程，是企业或其他组织以满足消费者需要为中心进行的一系列活动，市场营销学是系统地研究市场营销活动规律性的一门科学。包含研究消费者行为、市场研究原理、需求分析、定价理论、市场宣传方法、策略规划、广告手段、销售运营和管理、客户关系、零售等等一系列课题。\r\n',3,'open',52),(79,'人力资源管理','人力资源简单来就是培养未来从事企业人员管理人才的一门专业。人力资源管理专业是管理学、经济学、心理学、教育学、社会学等多学科相互渗透一门综合性管理类专业。属于管理学门类-工商管理类-人力资源管理专业，授予的学位为管理学学士/硕士。 人力资源可以定义为通过对与人有关的活动的管理来有效地利用组织中的人力资源。日益复杂和重要的中心和战略组织活动。尤其是在当今的企业下，人力是每一个公司最大的资产和生产力来源，人力资源管理专业在当下的社会发展中就显得尤为重要。',4,'open',52),(80,'广告学','如果你喜欢弄清楚是什么让人们在会心一笑的同时展现你的创造力和分析能力，那么广告专业可能是你的最佳选择。最简单地说，广告就是弄清楚如何向特定人群销售产品和服务。你需要了解你的受众是谁，他们喜欢什么，不喜欢什么，以及什么会让他们在众多的广告中脱颖而出。正因为如此，广告需要创意和量化技能的有趣结合。',1,'open',40),(81,'新闻学','新闻专业是一门快节奏的课程，你将很快学会如何在许多不同的主题下写出各种不同类型的故事。你经常会被派去实地工作，自己动手，然后你必须带着关于快速、艰难的截止日期的精心打磨的文章回来。',2,'open',40),(82,'传播学','传播专业是一个旨在教你如何有效沟通，以及如何将其应用到媒体、法律和商业等领域的专业。这个专业的课程与广告和新闻的课程非常相似。作为一名传播专业的学生，你要学习的课程范围很广，包括市场营销、社会学和商业以及更多的传统传播课程，如媒体研究和新闻。',3,'open',40),(83,'历史、哲学和艺术','历史、哲学和艺术方向是为那些希望通过学习文学和哲学，特别是外语来补充历史学的学生设计的。在此课程中，艺术的定义很宽泛，包括美术和艺术史、戏剧、电影、回忆录和自传、诗歌和小说，以及哲学、政治学和政治思想史的经典作品。它吸引了那些有兴趣在历史背景下研究人文科学及其概念和语言世界的学生，或者希望在学习该地区语言的同时，同时关注特定地域的文学和历史的学生。',1,'open',15),(84,'科学与医学史','科学与医学史是历史、科学与哲学专业融合。该专业是为对科学和人文科学以及两者之间的关系感兴趣的学生设计的。它也特别适用于考虑进入医学院的学生，因为它包括了在完成医学前科学要求，以及医学、生物学和科学的历史。',2,'open',15),(85,'历史与法律','历史与法律方向是为那些想要探索历史和法律之间的关系的学生准备的。课程的重点是法律制度、政策和结构在不同社会中的作用。',2,'open',15),(86,'公共历史与服务','公共历史与服务是方向为那些希望在他们的研究课程中加入历史研究在公共环境中的应用，如博物馆和文化遗产地、国家和州立公园、公共机构和私人基金会，以及非营利组织、公共机构和教育机构的公共服务环境中的应用的学生设计的。',4,'open',15),(87,'人文哲学','人文哲学方向强调实践哲学及其历史；学生需要将哲学课程与一门或多门人文学科的课程进行组合。',1,'open',55),(88,'科学哲学','哲学和科学方向强调理论哲学和科学哲学；学生需要将哲学课程与一个或多个科学学科的课程进行组合。',2,'open',55),(89,'政治和道德哲学','政治与道德哲学方向强调规范问题的哲学处理方法。其课程重点是关于伦理、道德、政治和法律的问题。',3,'open',55),(90,'刑法','这是大多数人想到律师时所想象的法律领域，因为它是电视和电影最关注的。被指控犯罪的人需要律师代理，就像政府需要律师来起诉他们一样。辩护律师一般从事私人执业或公设辩护律师，公设辩护律师是由政府支付费用，为无力支付律师费的人辩护。',1,'open',9),(91,'环境法','环境律师可以为那些保护自然资源的组织工作，也可以为那些可能被指控滥用自然资源的公司工作，以制定保护他们的法律。在环境问题上，两方都需要对各种法规有专业知识的律师。',2,'open',9),(92,'国际法','从事这一专业的律师必须具备国际关系、贸易和商业、和政府相关的知识和技能。从事国际法工作的律师必须对其他国家的法律有足够的了解。这些律师中的许多人受雇于与其他国家有业务关系的跨国公司。.',3,'open',9),(93,'专利法','专利法的律师试图阻止一些人从他人开发的想法和产品中获利。这是一个复杂的专业，需要一些自然科学、数学、或者工程学的教育背景。大公司可以聘请专利律师来保护他们在新产品上的投资。不断的技术创新和知识产权的问题正在推动这一领域迅速扩大。',4,'open',9),(94,'公司/劳动法','公司有各种各样的问题，需要在员工中配备一名律师或一组律师。这些律师可能专长于劳资谈判、税法、投资或其他领域。当公司决定做出重大业务决策时，例如与另一家公司合并，公司在进行之前会让其律师团队审查所有的法律问题。',5,'open',9),(95,'税法','这个专业往往需要更高的学位，如税法硕士。税法的日益复杂意味着公司需要的不仅仅是会计人员处理财务数字。税务律师在做出税务决定之前，必须确定公司的经营是合法的。许多税务律师拥有私人事务所，为各种各样的客户服务。',6,'open',9),(96,'精算','精算领域是一个生机勃勃的领域，也是很好地利用数学和统计学知识的好方法。精算就是依据经济学的基本原理，运用现代数学、统计学、金融学及法学等的各种科学有效的方法，对各种经济活动中未来的风险进行分析，评估和管理，是现代保险、金融、投资实现稳健经营的基础。',1,'open',29),(97,'应用数学专业','应用数学专业为学生在工业或政府中的应用数学职位做准备。',2,'open',29),(98,'纯数学','纯数学集中课程使学生可以接触数学的核心科目，并为学生进行数学研究生学习做好准备。',3,'open',29),(99,'动物工业','动物工业专业是为希望在农场或农业企业工作的学生开设的细分类。该课程包括科学核心课程、动物管理课程和其他选修课。',1,'open',8),(100,'动物生物学和兽医预科','动物生物学和兽医预科专攻包括动物科学的核心课程。完成该专业的学生可以申请兽医学院或研究生院。此外，这些学生可能会从事动物营养学，遗传学，生理学或制药行业的职业。',2,'open',8),(101,'伴侣动物和野生动物生物学','伴侣动物和野生动物生物学专攻是为有志于与伴侣动物或为人类提供审美价值的动物一起工作的学生开设的课程。该课程包括动物科学的核心课程、动物管理，以及动物学或野生动物等不同领域的选修课程。',3,'open',8),(102,'数理统计','数理统计是以概率论为基础，研究社会和自然界中大量随机现象数量变化基本规律的一种方法。 其主要内容有参数估计、假设检验、相关分析、试验设计、非参数统计、过程统计等。',1,'open',31),(103,'金融统计','培养学生金融学、经济学综合的知识素养，也系统培养学生统计学、投资学兼备的专业技能；既扎实训练学生的逻辑分析、数据处理的实用能力，也注重训练学生的统计思想、统计方法的研究能力',2,'open',31),(104,'应用统计','应用统计信息是数据分析的基础，而应用统计信息的实践涉及分析数据以帮助定义和确定业务需求。随着当今对大数据的访问越来越多，公司正在寻找统计学家，数据分析师，数据科学家和其他具有应用统计知识的专业人员，他们可以可视化和分析数据，充分理解数据并使用它来解决实际问题。',3,'open',31),(105,'生物统计','生物统计学是将统计原理应用于医学，公共卫生或生物学中的问题。',4,'open',31),(106,'电能系统','电能系统主要关注以安全、可靠、具有成本效益和环境友好的方式满足对电能的需求。电能系统包含多种技术，包括：电力系统保护、控制和自动化、分布式发电和客户发电、智能电网和电力市场、光伏发电、电力电子、能量收集、电源微芯片、高压工程、能源系统网络安全和硅基于微芯片和微系统。',1,'open',35),(107,'医疗健康技术','这条路径将电气工程基础知识应用于生物医学，生物电子学和生物传感领域中引人注目的问题。包括神经感觉接口（人工耳蜗），医疗可穿戴设备（苹果手表），脑机接口（深部大脑刺激），生物医学电路和系统（起搏器）以及医疗超声。',2,'open',35),(108,'成像与显示','包括医学（例如MRT），制造（例如质量控制）和安全性（例如面部识别）以及显示技术（例如用于手机，车辆，3D全息显示器）的成像，并且涉及光学，模拟和数字处理。',3,'open',35),(109,'信息处理与学习','将电气工程基础知识应用于从生物医学到制造以及从消费电子产品到能量收集的所有领域的提供了选择。该路径的核心是对离散信号的理解，以及对此类信号进行处理以提取适合应用程序的信息的过程。该路径内有几个子路径或风格：理论基础，算法和系统，以及硬件。',4,'open',35),(110,'纳米技术','纳米技术在制造，操作理论，光电和电子设备的运用。',5,'open',35),(111,'通信与计算光学','未来的宽带信息服务将在数据中心和无线接入网络中通过集成的光纤链路，集成的光子元件和灵活的系统功能来支持超可靠，低延迟的人机交互和机器类型通信，这将成为集成的光纤无线网络基础架构。可提供各种应用程序，包括高清媒体分发，智能城市，物联网以及虚拟现实和增强现实。',6,'open',35),(112,'光学与光子学','用于健康和消费品的光子学：此路旨在培训学生研究光学和光子学设备以及在医疗和消费品中的应用。这包括光学材料；镜头，发光二极管（LED），激光器和光学检测器（光电二极管等）等组件；以及复合设备，例如照相机，生物传感器，室内照明，显示器（显示器和电视），太阳能电池和外科手术器械。',7,'open',35),(113,'机器人与自动化','机器人技术结合了物理，传感，计算和控制功能，可在诸如自动驾驶汽车之类的复杂运动系统中实现自主行为。太空，空中，水上和地面车辆；腿式和类人机器人以及假肢。',8,'open',35),(114,'地球化学','地球化学是对形成和塑造地球的化学过程的研究。',1,'open',4),(115,'海洋学','海洋科学是研究海洋的自然现象、性质及其变化规律，以及与开发利用海洋有关的知识体系。',2,'open',4),(116,'古生物学','古生物学家是专精于古代生物研究的科学家，他们查化石中的植物、动物残余物。化石中有机生物的残余物，透露了结构、环境、演化和分布的细节。',3,'open',4),(117,'沉积学','沉积学是对海洋和其他沉积物中沉积物颗粒的研究，重点是物理性质和形成沉积物的过程。',4,'open',4),(118,'地球物理学','与各种技术有关的信息，包括：机载电磁，重力，磁性，大地电磁，辐射测量，岩??石特性和地震。',5,'open',4),(119,'核物理','核物理学涉及对原子核的组成，结构和行为的研究。它在开发核能，考古测年，烟雾探测器和核医学方面有许多实际应用。核诊断技术通过发现无需手术即可“看到”体内的方法，彻底改变了医学。',1,'open',44),(120,'地球物理学','地球物理学家运用物理理论和测量方法来发现地球的特性。地球物理学包括地震学，地热法（地球加热），水文学（地表水和地表水）以及重力和大地测量学（地球重力场）的分支。它的一些应用程序用于修建公路和桥梁，研究地震，城市规划和考古学。',2,'open',44),(121,'原子，分子和光学物理学','在这个领域，物理学家研究原子水平上的物质和光的相互作用。由于它们之间的相互关系，所用方法的相似性以及相关的能量规模，通常将这三个组放在一起。原子物理学比原子核研究中的力更关注原子的研究。分子物理学关注于多原子结构及其与物质和光的内部和外部相互作用。光学物理学操纵光来洞察光的基本属性。',2,'open',44),(122,'天文学','天文学被认为是物理学的一个子领域。天文学家观察并收集用于解释恒星与行星之间关系以及宇宙中其他现象的数据。可能需要天文学家与其他类型的物理学家一起解决与太空飞行导航和卫星通信有关的问题。',4,'open',44),(123,'天体物理学','天体物理学是天文学的一部分，涉及恒星，恒星系统和星际物质的物理学。天体物理学家运用物理学定律来了解天体如何形成，如何相互作用以及如何死亡。天体物理学可以用来弄清楚如何到达其他星球，如何以新的和更安全的方式建造事物，或者研究人体如何适应新的情况。',6,'open',44),(124,'太空物理学','空间物理学是对从地球大气最上层到深空的空间环境的研究。鉴于卫星正被用于通信，广播，天气监测，遥感，位置信息等，卫星轨道特别受到关注。',7,'open',44),(125,'物理教育','具有学士学位的物理专业毕业生可以担任小学或高中教师，向下一代传授物理知识。',8,'open',44),(126,'工程物理','工程是物理学专业的另一个出路。它是最苛刻的职业之一，因为它经常处理影响个人安全的决策。建造桥梁，摩天大楼，飞机和电气系统需要坚实的物理学基础。一些学生可以获得物理学学位，然后继续进入研究生院攻读工程硕士学位。其他的则是物理学和工程学双学位。其他一些需要扎实的物理背景的行业是建筑，化学，食品，航空航天，农业，能源，燃料，冶金，纺织和服装，计算机和运输。',9,'open',44);
