INSERT INTO `dimension_combination` VALUES (1,'ISTJ','物流师','实际且注重事实，真正靠谱的人。','ISTJ物流师人格类型的人数在十六种类型中排名第三，大约占人口总数的 11.6%。 你有很多明显的特征，例如正直，务实，恪尽职守，使你深受家庭以及拥护传统，规则，标准的组织的青睐，比如律所，监管部门和军队。 你愿意为自己的行为负责，为努力完成目标所做的一切感到骄傲。你会毫不吝啬时间和精力，耐心准确地完成每个任务。','Characters_物流师.png'),(2,'ISFJ','守卫者','专注而温暖，真正的利他主义者。','ISFJ守卫者是所有人格类型中占人口总数比例最大的一个类型，接近 13.8%。 你既能坚守最好的传统也乐善好施。守卫者人格类型是一个很独特的类型， 虽然非常照顾他人的感受，一旦到了需要保护其家人或朋友的时候，你会变得非常强悍；虽然安静内向，你却有很好的社交技巧和强大的社会关系；虽然追求安全和稳定，但只要你得到了理解和尊重，就愿意接受改变。 你经常一丝不苟到完美主义的程度，虽然有拖延的习惯，但总能可靠地按时完成学习任务。','Characters_守卫者.png'),(3,'INFJ','倡导者','基于博爱的理想，把帮助他人作为生活的意义，并希望从根本上解决问题。','INFJ倡导者的你很特别，是所有人格类型中占人口总数比例最少的一个类型，只有1.5%，但对世界的贡献不容忽视。他人能随时体会到你的善良和体贴，但不太了解你，因为你总是做的含蓄和复杂。事实上你是非常重感情，忠于自我价值观，有强烈的愿望为大家做贡献，有时候你也很紧张和敏感，但表现的深藏不露；你倾向于拥有小范围的而深长久远的友谊。你有与生俱来的理想主义和道德感，但真正让你与其他理想主义人格类型区分开来的是的果断。你不是懒散的空想家，而是能脚踏实地完成目标，留下深远的积极影响的人。','Characters_倡导者.png'),(4,'INTJ','架构师','追求能力与独立，正确的态度可以达到任何目标。','INTJ架构师作为人数最少且战略能力最强的人格类型之一，仅占人口的 2%，女性则更为稀少，只有 0.8%。这让你很难找到志同道合能够与其过人的智慧和审慎的思考方式比肩的同类。 你的想象力丰富却很果断，雄心壮志但注重隐私，充满好奇心但从不浪费精力。你非常独立，生来对知识充满渴望，喜欢分享知识，对自己擅长的领域很有信心。','Characters_架构师.png'),(5,'ISTP','科学家','用冷静的理性主义和精神饱满的好奇心来感知和体验这个世界。','ISTP科学家占总人口的5.4%，数量上在十六个人格类型中排第八。你喜欢用双手和眼睛去探索事物，是天生的制造者。你在不同的项目中穿梭，从创造有用、充足的产物中获得乐趣，并在创造的过程中从外界学习。 因此，你的动手能力很强，具有将理论应用于实际的天赋。同时，你善于根据基本原则从庞杂的数据中理出头绪来，从凌乱的信息中发现意义，这使得你具有创造力天赋。另一方面，你非常在意做事的效率，不会将时间浪费在没有结果的事情上面。','Characters_科学家.png'),(6,'ISFP','探险家','用选择和行动来打破社会常规。','ISFP探险家占总人口的8.8%，数量上在十六个人格类型中排第四。你喜欢用美感和行为方面的实验来颠覆传统的期望，很有可能已经说过不止一次“不要控制我！”你非常清楚现实状况，能够发现需求并会努力地满足这些需求。你从来不会甘心被他人安排，而更愿意自己尝试改变这一切。同时，你也非常重视品味、差异和审美。你的实践能力很强，热爱大自然，喜欢探索未知的事物，或许你并是能言善辩的人，你却能够用实际行动来让别人了解和认识自己。你处事是低调的，常常因此低估了自己。','Characters_探险家.png'),(7,'INFP','调停者','真正的理想主义者，总是从最坏的人和事中寻找最好的一面。','INFP调停者仅占总人口的4.4%，数量上在十六个人格类型中排第九。你有着极强的语言天赋，能够用语言来说服别人，使他人认同你的观点，并因此达成合作。这也是你在生活中所扮演的重要角色--调解员，毫无疑问你是古道热肠的，总是喜欢调停一些矛盾和冲突，因此很受大家的信任。而情感的思维模式让你渴望沟通和分享，这一点影响了很多人。你虽然可能看起来冷静，内向甚至害羞，但你内心的火焰和热情可以光芒四射。 当你找到志同道合的人时，你们之间的和谐就像是快乐和灵感的源泉。','Characters_调停者.png'),(8,'INTP','逻辑学家','积极主动地创造，异于常人的视角以及永不枯竭的智慧','只有3.3%人口的INTP逻辑学家数量上在十六人格类型中排第十一。你最擅长的就是抽象思维，在所有的类型中最有智慧的。与单纯地思考不同，直觉能够让你更深刻地理解事物。你对知识怀有无比的好奇，拥有敏锐的理解力，在解决问题的时候总能想出各种机智的点子。有时候，你只需要扫一眼就能判断其中的可能性，这都是基于你严谨的逻辑性和思维的条理性。人们常常将逻辑学家称为哲学家、思考者，或是爱空想的教授，在历史的长河中，许多科学发现就是他们的智慧之花结出的丰硕果实。','Characters_逻辑学家.png'),(9,'ESTP','挑战者','活在当下，说做就做','ESTP挑战者仅占总人口的4.3%，数量上在十六个人格类型中排第十。你是最有感知力和洞察力的类型，善于捕捉微小的变化。 你激情满怀，能量爆棚，还有一个理性的，偶尔分神的大脑，却非常具有启发性，令人信服。你生活丰富多彩，常常会带领大家走上一条少有人走的道路，为所到之处带来生机与乐趣。 你偏好根据思维而非情感进行判断，因此你十分清楚某种行为或者某个决定的逻辑后果，不会将问题复杂化。这并不是说你总是喜欢斤斤计较，而是你总能够考虑到现实的问题，更容易接受现实，而不是刻意美化所经历的一切。','Characters_挑战者.png'),(10,'ESFP','表演者','“哪里有我，哪里就有笑声”','ESFP表演者占总人口的8.5%，数量上在十六个人格类型中排第六。你习惯根据情感进行判断，在情感思维的驱使下，你的兴趣和精力主要集中在人的身上。因此，在与他人相处时，你会非常的亲切而友善、周到而得体，非常善于跟人打交道。同时，你看人也很准，总能够做出准确到位的评价。你不仅仅擅长交谈，也是所有人格类型中拥有最强美感的一类。 无论是装饰打扮还是着装，你都会展现出异于常人的审美。','Characters_表演者.png'),(11,'ENFP','竞选者','非常独立，不会满足于稳定和安全，渴求创造和自由。','ENFP竞选者占总人口的8.1%，数量上在十六个人格类型中排第七。你是真正富有自由精神的人，也常常是聚会上的焦点，但是与眼前的兴奋和快乐相比，你更享受与人们建立的社会和情感联系。 你富有魅力，独立，精力充沛且有同情心，你在社交中更加的热情和更关心他人，也比较善于与他人打交道。你对于各种可能性都非常的敏感，有着开脱创新的能力，但是很难善始善终。你很容易受到冲动和激情的驱使，而不是意志力。你认为灵感高于一起，处理任何事情都追随自己的灵感。','Characters_竞选者.png'),(12,'ENTP','辩论家','追求智力的独立和想象的自由，总能蹦出新点子','ENTP辩论家仅占总人口的3.2%，数量上在十六个人格类型中排第十二。你极具探险精神、创新意识以及克服困难的勇气，急切地“想知道盒子外边的世界”、能不断想出新的可能性。你有“走自己的路、让别人去说吧”的乐观主义激情，兴趣爱好广泛、易于接受新事物，学习新知识的信心和动力都很强大。你个性独立自主、善于分析，能够客观而公正的对待身边的每一个人，这使得你有良好的人际基础，也很容易走向管理的岗位。','Characters_辩论家.png'),(13,'ESTJ','总经理','传统和秩序的代表，带领大家努力前行','ESTJ总经理占总人口的8.7%，数量上在十六个人格类型中排第五。你不喜欢抽象理论，喜爱学习实用的知识。你习惯就事论事，注重实际效率，善于感知并记住各种具体的细节。你很能够忍受各种规矩或者规范要求，这体现了你务实的一面。你的思维缜密，考虑的都是实际而具体的事情。你能够脚踏实地学习，笔记通常十分工整，作业一丝不苟。','Characters_总经理.png'),(14,'ESFJ','执政官','享受做有意义的事情，尽一切可能让每个人开心','最适合形容ESFJ执政官的词就是“受欢迎”了 -- 这也符合常理，因为你们大约占人口的 12%，数量上在十六个人格类型中排第二，是非常常见的类型。在学校里，你通常会是班委或学生会成员，总能带领着队伍走向胜利和荣誉。你能言善辩，热衷于追求帮助他人，喜欢关注各种各样的亲身经历，包括自己的、朋友的和熟人的，你甚至会被陌生人的生活经历所打动。你常常会把有机会为他人服务作为理想工作的一项重要特征。你有着极强的同情心与共情力，不愿意看到他人受苦，所以总是希望能够尽自己的力量来帮助他人们摆脱困境。','Characters_执政官.png'),(15,'ENFJ','演说家','浑身散发着天然的自信，潜移默化地影响着周围的人','ENFJ演说家是天生的领导者，充满激情，魅力四射，仅占人口的 2.5%，数量排十六型人格中第十三。你会潜移默化地影响着周围的人，也能够指导大家团结协作，共同提升，而你也能从中获得自豪感与快乐。你对于各种新鲜的观点都充满了好奇，喜欢阅读，具有广泛的学术兴趣，能够包容各种理论、视角和见解，对于超越现实的各种可能性充满想象。你的表达能力很强，往往更愿意说话而非写作。为人亲切随和，善于变通，富有同情心，能够恰当地表达自己的情感。为了做决定并处理好事情，会直接表明自己的观点和判断。','Characters_演说家.png'),(16,'ENTJ','指挥官','用强大的动力、坚定的决心和锋芒毕露的思想实现为自己制定的一切目标。','ENTJ指挥官人数非常少，仅占总人口的1.8%，数量上在十六个人格类型中排倒数第二。你天生具有魅力和信心，散发的权威性能召集大家为着一个共同目标努力。你更关注未来发展的可能性而非眼前可见或已知的事实。在直觉的驱使下，你对知识充满兴趣，对新的想法充满好奇，总是能够耐着性子去钻研高深却不一定很有用的理论。热爱挑战的你会坚定地相信，只要有足够的时间和资源，就没有无法达成的目标。','Characters_指挥官.png');
