CREATE TABLE `dimension_junction` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `dimension_id` int(11) NOT NULL,
  `dimension_combination_id` int(11) NOT NULL,
  PRIMARY KEY (`id`),
