INSERT INTO `dimensions` VALUES (1,'E','外向','关注自己如何影响外部环境：将心理能量和注意力聚集于外部世界和与他人的交往上。例如：聚会、讨论、聊天',1,'open'),(2,'I','内向','关注外部环境的变化对自己的影响：将心理能量和注意力聚集于内部世界，注重自己的内心体验。例如：独立思考，看书，避免成为注意的中心，听的比说的多。',1,'open'),(3,'S','感觉','关注由感觉器官获取的具体信息：看到的、听到的、闻到的、尝到的、触摸到的事物。例如：关注细节、喜欢描述、喜欢使用和琢磨已知的技能。',2,'open'),(4,'N','直觉','关注事物的整体和发展变化趋势：灵感、预测、暗示，重视推理。例如：重视想象力和独创力，喜欢学习新技能，但容易厌倦、喜欢使用比喻，跳跃性地展现事实。',2,'open'),(5,'T','思考','重视事物之间的逻辑关系，喜欢通过客观分析作决定评价。例如：理智、客观、公正、认为圆通比坦率更重要。',3,'open'),(6,'F','情感','以自己和他人的感受为重，将价值观作为判定标准。例如：有同情心、善良、和睦、善解人意，考虑行为对他人情感的影响，认为圆通和坦率同样重要。',3,'open'),(7,'J','判断','喜欢做计划和决定，愿意进行管理和控制，希望生活井然有序。例如：重视结果(重点在于完成任务)、按部就班、有条理、尊重时间期限、喜欢做决定。',4,'open'),(8,'P','知觉','可以灵活地适应环境，倾向于留有余地，喜欢宽松自由的生活方式。 例如：重视过程、随信息的变化不断调整目标，喜欢有多种选择。',4,'open');
/*!40000 ALTER TABLE `dimensions` ENABLE KEYS */;
UNLOCK TABLES;

