INSERT INTO `holland_test_code` VALUES (5,'R','实际型Realistic','共同特点：愿意使用工具从事操作性工作，动手能力强，做事手脚灵活，动作协调。偏好于具体任务，相对 不善言辞，做事保守，较为谦虚。有时候会缺乏社交能力，通常喜欢独立做事。','open',0,'实际型 - R'),(6,'I','调研型Investigative','共同特点：思想家而非实干家，抽象思维能力强，求知欲强，肯动脑，善思考。喜欢独立的和富有创造性的 工作。知识渊博，有学识才能，不善于领导他人。考虑问题理性，做事喜欢精确，喜欢逻辑分析和推理，不 断探讨未知的领域。','open',1,'调研型 - I'),(7,'A','艺术型Artistic','共同特点：有创造力，乐于创造新颖、与众不同的成果，渴望表现自己的个性，实现自身的价值。做事理想 化，追求完美，不重实际。具有 定的艺术才能和个性。善于表达、怀旧、心态较为复杂。','open',2,'艺术型 - A'),(8,'S','社会型Social','共同特点：喜欢与人交往、愿意结交新的朋友、善言谈、愿意教导别人。关心社会问题、渴望发挥自己的社会作用。寻求广泛的人际关系，比较看重社会义务和社会道德。 ','open',3,'社会型 - S'),(9,'E','企业型Enterprising','共同特征：追求权力、权威和物质财富，具有领导才能。喜欢竞争、敢冒风险、有野心、抱负。为人务实，习惯以利益得失的理性思维来衡量做事的价值，做事有较强的目的性。 ','open',4,'企业型 - E'),(10,'C','常规型Conventional','共同特点：尊重权威和规章制度，喜欢按计划办事，细心、有条理，习惯接受他人的指挥和领导。喜欢关注实际和细节情况，通常较为谨慎和保守，缺乏创造性，不喜欢冒险和竞争，富有牺牲精神。','open',5,'常规型 - C');
/*!40000 ALTER TABLE `holland_test_code` ENABLE KEYS */;
UNLOCK TABLES;

