INSERT INTO `inquiry` VALUES (1,'wes yao','wyao@alcanada.com','2264486850','','london','fanshawe','国际舆论场如此信息纷纭，很多信息又难辨真伪。基于历史的教训，世界卫生组织从一开始就非常重视向各国民众传递准确信息的重要性，指出打击与疫情相关的谣言或虚假信息十分关键。世卫组织提出从4个方面着手抑制疫情相关虚假信息传播，包括追踪多语种疫情相关错误信息，“谣言传染病”管理团队与世卫组织媒体部门密切合作，向更广泛的受众传递疫情信息，与搜索引擎和社交媒体等合作，过滤虚假信息，推广正确信息。应当看到，疫情使全球媒体面对一场大考，这是以大实践检验媒体作为、甄别媒体本色的重要时刻。',NULL,NULL),(2,'wes yao','wyao@alcanada.com','2264486850','','london','fanshawe','国际舆论场如此信息纷纭，很多信息又难辨真伪。基于历史的教训，世界卫生组织从一开始就非常重视向各国民众传递准确信息的重要性，指出打击与疫情相关的谣言或虚假信息十分关键。世卫组织提出从4个方面着手抑制疫情相关虚假信息传播，包括追踪多语种疫情相关错误信息，“谣言传染病”管理团队与世卫组织媒体部门密切合作，向更广泛的受众传递疫情信息，与搜索引擎和社交媒体等合作，过滤虚假信息，推广正确信息。应当看到，疫情使全球媒体面对一场大考，这是以大实践检验媒体作为、甄别媒体本色的重要时刻。',NULL,NULL),(3,'wes yao','wyao@alcanada.com','2264486850','','london','fanshawe','国际舆论场如此信息纷纭，很多信息又难辨真伪。基于历史的教训，世界卫生组织从一开始就非常重视向各国民众传递准确信息的重要性，指出打击与疫情相关的谣言或虚假信息十分关键。世卫组织提出从4个方面着手抑制疫情相关虚假信息传播，包括追踪多语种疫情相关错误信息，“谣言传染病”管理团队与世卫组织媒体部门密切合作，向更广泛的受众传递疫情信息，与搜索引擎和社交媒体等合作，过滤虚假信息，推广正确信息。应当看到，疫情使全球媒体面对一场大考，这是以大实践检验媒体作为、甄别媒体本色的重要时刻。',NULL,NULL),(4,'wes yao','wyao@alcanada.com','2264486850','','london','fanshawe','国际舆论场如此信息纷纭，很多信息又难辨真伪。基于历史的教训，世界卫生组织从一开始就非常重视向各国民众传递准确信息的重要性，指出打击与疫情相关的谣言或虚假信息十分关键。世卫组织提出从4个方面着手抑制疫情相关虚假信息传播，包括追踪多语种疫情相关错误信息，“谣言传染病”管理团队与世卫组织媒体部门密切合作，向更广泛的受众传递疫情信息，与搜索引擎和社交媒体等合作，过滤虚假信息，推广正确信息。应当看到，疫情使全球媒体面对一场大考，这是以大实践检验媒体作为、甄别媒体本色的重要时刻。',NULL,NULL),(5,'wes yao','wyao@alcanada.com','2264486850','','london','fanshawe','testeer',NULL,NULL),(6,'Tim Zhao','tim.zhaotianqi@gmail.com','','','West Lafayette','','test',NULL,NULL),(7,'Tim Zhao','','13661667030','','West Lafayette','','test',NULL,NULL),(8,'99000','tim.zhaotianqi@gmail.com','098790765','','West Lafayette','','FFFFF',NULL,NULL),(9,'99000','2412113382@qq.com','098790765','','West Lafayette','','FFFFF',NULL,NULL),(10,'余晓燕','','13071500890','yu2780396576','广东省','中山大学新华学院','调到了生物医学工程，想知道自己适不适合这个，还是选择转专业？',NULL,NULL),(11,'Alex','','18936936883','','','','学长你好，我是会计本科生，快要毕业了，但是通过学习和校外的一些实习感觉自己不是很喜欢会计专业，也不大感兴趣，而且我高中是理科生，数理化比较好，所以后面想报考研究生，也希望能找一个适合自己的好工作，因此想通过咨询来帮助判断适合自己的研究生专业。',NULL,NULL),(12,'杜先生','','18519193434','','','','留学咨询',NULL,NULL),(13,'邱馨仪','1303692319@qq.com','15996277813','qyy1588','南京','南京财经大学红山学院','         本科专业是审计学，不厌恶，也不是很喜欢。在做了测试后，觉得自己可以选择社会学或者教育学，但不知道是不是最适合自己的，希望能获得你们的帮助。\n        现在大四，准备考研，希望未来的工作在国企、公务员、事业单位，工作上希望不要太繁忙，有一定的个人时间可支配，不频繁出差。也希望未来的工作能助我在南京定居下来。\n',0,''),(14,'冯薪羽','','15188808066','15188808066','济南','山东大学','姐姐你好呀 现在我所在的专业是调剂过的材料 想要转专业 想的是金融 但是一直听说对于家庭背景很看重并且人才太多了 而且我们学校的数学专业才是唯一的a+但数学我觉得我真的不够那么聪明 所以蛮纠结的 姐姐你有什么经验嘛',0,''),(15,'JustTes2020','justTest2020@qq.com','13000000000','test','test','test','test',0,''),(16,'JustTes2020','justTest2020@qq.com','13000000000','test','test','test','test',0,''),(17,'JustTes2020','justTest2020@qq.com','13000000000','test','test','test','test',0,''),(18,'JustTes2020','justTest2020@qq.com','13000000000','test','test','test','test',0,''),(19,'JustTes2020','justTest2020@qq.com','13000000000','test','test','test','test',0,''),(20,'JustTes2020','justTest2020@qq.com','13000000000','test','test','test','test',0,''),(21,'JustTes2020','justTest2020@qq.com','13000000000','test','test','test','test',0,''),(22,'JustTes2020','justTest2020@qq.com','13000000000','test','test','test','test',0,''),(23,'JustTes2020','justTest2020@qq.com','13000000000','test','test','test','test',0,''),(24,'JustTes2020','justTest2020@qq.com','13000000000','test','test','test','test',0,''),(25,'JustTes2020','justTest2020@qq.com','13000000000','test','test','test','test',0,''),(26,'JustTes2020','justTest2020@qq.com','13000000000','test','test','test','test',0,''),(27,'JustTes2020','justTest2020@qq.com','13000000000','test','test','test','test',0,''),(28,'JustTes2020','justTest2020@qq.com','13000000000','test','test','test','test',0,''),(29,'JustTes2020','justTest2020@qq.com','13000000000','test','test','test','test',0,''),(30,'董琛','1667647177@qq.com','19802106207','','上海','华东理工大学','我现在大三准备申请研究生，但对专业的选择特别迷茫，不喜欢现在的专业又不知道自己喜欢什么，想问问学姐当时是怎么找到自己的兴趣点的呢？',0,''),(31,'姜一','975418350@qq.com','18217019364','jiangyilinlinlin','北京','杜伦大学','本科就读社会学专业，对硕士选择的专业和未来从事的行业以及职位有困惑',0,''),(32,'姜一','975418350@qq.com','18217019364','jiangyilinlinlin','北京','杜伦大学','本科就读社会学专业，对硕士选择的专业和未来从事的行业以及职位有困惑',0,''),(33,'李昂','1669067292@qq.com','13399202806','eaueau292','咸阳市','咸阳师范学院','为什么我用不了这个测试？每次我输入电话号码 验证后 又返回原页面',0,''),(34,'琳','','15263119668','Zhyt9668','','悉尼大学','老师，你好。 本科澳洲留学，读四年bachelor of science and bachelor of advanced studies, 以后要是想去申英媒研究生，机会大不大呀。 想读数学相关专业，不知道学姐有没有听说过悉大的financial mathematics and Statistics呀， 这个专业属不属于冷门专业或者是悉尼大学比较水的专业呀。如果想要申请英美商科研究生，具体需要做哪些准备呀，难度大不大呀。悉大的金数专业在国际认可度怎么样呀。',18,'Sunny'),(35,'琳','3074142536@qq.com','15263119668','Zhyt9668','青岛市','悉尼大学','今年刚申大学，想读bachelor of science and bachelor of advanced studies，不知道如何选专业，想选数学方向的，尤其想了解悉大的financial mathematics and Statistics这个专业，国际认可度，属不属于冷门专业或者比较水的专业，以后想申英美研究生，这个专业好不好申商科相关研究生，认不认可。这个学位是读四年的，申英美研究生可不可以，还是说非要读一个honour。申英美研究生需要哪些条件，我听很多人说澳洲本科想申英美研究生很难，基本上不可能。',0,''),(36,'王玲','1993489908@qq.com','18973349080','jcxqjydl','武汉','武汉工程大学','想知道自己想学什么专业，打算学计算机的，但我也不知道自己喜不喜欢，对未来规划也没什么打算，求助啊，我就想找到自己想学的那个专业',0,''),(37,'黎康琪','cc15080279684@163.com','19859702217','lkq021212','苏州','西交利物浦','对于转专业和西交利物浦的学习条件等',0,''),(38,'王勤','','18935715820','','新疆石河子大学','新疆农业大学','生物医药、动物医学、食品科学与工程这三个专业哪个更好一些？哪个专业更具有发展前景？',0,''),(39,'点一万','1462428521@qq.com','13770644337','13770644337','上海','上海','',0,''),(40,'韩雨晴','','18756871472','','安徽合肥','安徽中医药大学','我想要开很多很多店，比如书店，药店……那我应该学习什么专业？',0,''),(41,'李','1614203864@qq.com','18856359891','','安徽','合工大','',0,''),(42,'朱子浩','13670234220@163.com','13670234220','','广州','广东技术师范大学','本人大二，专业机器人工程（师范），学的很吃力，专业课学不明白，大一也挂了两科，很痛苦。现在的想法就是毕业当老师，但不知道是在原专业好，还是转专业好。如果转专业，什么样的专业才是适合自己的？',0,''),(43,'陈沁漪','182240622662@163.com','18224062662','CQY18224062662','四川成都','淮阴工学院','我本科学习的是工业设计。但是显而易见的，我本科的学校这个专业的条件并没有那么优秀，同学们的水平也不太行。在这样的环境下我并没有觉得自己的设计思维和审美能力有什么进步，反而很害怕被同化。综上所述，目前我对自己本专业是没有什么兴趣的。我对设计本身感兴趣，但是我有询问过一些还在从事设计工作的哥哥姐姐，学工业设计专业的几乎都做别的设计去了。并且他们告诉我，要接受自己做的东西可能会很俗的现实。我很迷茫?设计方向到底是什么样子呢？除此之外，根据测试列出来的艺术管理我很感兴趣。还有人类学，新闻传播，教育学，心理学。',0,''),(44,'test','','13661667030','','','tim','test',29,'Joyce'),(45,'钟','zhyqiuu@163.com','18007871177','18007871177','广西桂林','大连海洋大学','专业选择',0,''),(46,'李杨洋','1242342974@qq.com','15802870284','','成都','绵阳南山中学','我很喜欢生物，觉得生物是个很神圣的学科，我以后想探索更多大自然的奥秘，可是生物方面的专业似乎都很冷门，我也并不想学医，有没有什么好的推荐？谢谢！',0,''),(47,'于淑均','3361442365@qq.com','18522732470','18522732470','天津','天津市第四十二中学','文科男，ENFP男生，计划留学。喜欢社交活动但略微有些社恐（？），不太敢主动去和新朋友认识但慢慢熟络起来话很多那种。平时喜欢看电影看书刷知乎，喜欢打辩论，对很多方面都很感兴趣。但是感觉自己目标还不够明确，不知道自己最适合哪些专业，想请教学长姐。',0,'');
