/*!40000 ALTER TABLE `jobs` DISABLE KEYS */;
INSERT INTO `jobs` VALUES (15,1,NULL,'大多数和你一样特点的人在传统的商业领域工作，你们讲求效率、促进稳定在管理一个体系和保持事务正常运转方面表现的非常突出。例如：审计师、会计、信息顾问、精算师、统计员、作家、代理商、保险调查员等。',1,'open'),(19,1,NULL,'文职类工作较为吸引你，这样的环境细致、有条理，你可以维护服务、保护人们的工作制度或机构。例如：警官/侦探、园艺人员、政府职员、飞行员等。',2,'open'),(20,1,NULL,'你对于数据和细节非常细心、有耐心，能够快速、有效、独立地工作，处理大量数据和信息。例如：证券/股票分析人员、预算分析家、成本/房地产评估者、图书管理员等。',3,'open'),(21,1,NULL,'你特别善于发现事务细节方面出现的问题，所以你对那些技术、设计、生产精确度要求非常高的工作很感兴趣。例如：法律研究者、地质/气象学家、技术人员、网络编辑、系统分析员、外科医生、牙医、兽医、护理人员等。',4,'open'),(22,2,NULL,'你喜欢通过具体的方法亲自、单独的与他人打交道，运用技术给他们带来直接的影响。例如：营养学者、外科医生、宠物医生、牙医、生物/植物学者、护士、矫形师等。',1,'open'),(23,2,NULL,'教育和研究类的工作特别受到和你特点相同的人的青睐，他们可以自主的工作，可以帮助别人，并能看到成果，可以为社会做出贡献。例如：幼儿/小学教师、社会工作者、健康保健人员、指导顾问、历史学者、运动培训师、园艺人员等。',2,'open'),(24,2,NULL,'还有一些直接的和他人单独打交道的工作，这些工作要求你具有较广的知识面、技能和交际才能来给别人支持。例如：秘书、行政/人事管理人员、信贷顾问、顾客服务等。',3,'open'),(25,2,NULL,'那些对工作细节非常关注，满足客户要求，与他们友好相处的实实在在的工作也是你需要考虑的。例如：艺术人员、室内设计师、商品规划师、营销、房地产代理或经纪人、酒店管理人员等。',4,'open'),(26,3,NULL,'你喜欢运用自己的观点和知识帮助别人。喜欢学习，在咨询或帮助别人的时候自己也得到提高是你所追求的。例如：社会工作者、文科类教师、职业治疗师 等。',1,'open'),(27,3,NULL,'有艺术感或有美感的工作对你较有吸引力，你可以运用你的才能创造出独特的作品，同时把自己的观点和想象力融入其中，并且可以独立完成。例如：作家、媒体策划、室内/商品设计师、编辑/影片制作等。',2,'open'),(28,3,NULL,'你对事情较有使命感，尽职尽责，因此愿意解决个体或社会问题，这类工作也是你需要考虑的。例如：人力资源人员、营销人员、策划人员、口译/笔译人员、项目经理。',3,'open'),(29,3,NULL,'在商业领域里，与人打交道解决以人为本的问题，营造有效的工作环境也是你所喜欢的。而从事营销方面的工作你可以发挥创造性解决问题的能力。记住：商界只有某些领域才能使你独特的天赋才能得以施展。例如：企业组织发展顾问、企业培训人员、职业顾问、技术顾问等。',4,'open'),(30,4,NULL,'商业和金融领域的职业都要求有高度发展的分析能力，这些正是你在工作中追求的。例如：电信顾问、管理顾问、经济学者、策划、金融分析者、预算分析家、资产鉴定人员等。',1,'open'),(31,4,NULL,'你喜欢运用创造力来开发奇特的方法体系，这些技术领域的逻辑体系，不断发展的高技术设备和产品打交道机会对你也非常合适。例如：科学家/研究员、电脑系统分析员/程序员/工程师、技术人员、设计工程师软件开发、网页设计、网络主管、生物医学人员、商业分析员等。',2,'open'),(32,4,NULL,'高等教育和医学领域的高度复杂体系，在的工作同时自己也得到提高和独立的环境是你在工作中要求的。例如：教师、行政管理人员、数学家、心理学者、外科医生、生物医学研究人员等。',3,'open'),(33,4,NULL,'能够独立的研究与策划，注重长远的计划的开发的职业也是你需要考虑的。例如：律师、法官、新闻分析家/撰稿人、建筑师、投资/商业分析家、飞行员、侦察/情报专家等。',4,'open'),(34,5,NULL,'你喜欢自然的环境，独自工作，能够综合自己的能力迅速找到策略，采取恰当的行动。例如：摄影师、体育教练、刑侦人员、警察、赛车手、飞行员等。',1,'open'),(35,5,NULL,'大多数你这种特点的人在机械技术领域表现的十分优秀，他们有超强的观察力和对细节、事实的记忆力，喜欢自己动手。 例如：电子/机械/土木工程师、软件开发、计算机工程师、系统分析师、地理学家、网络工程师、检测员、外科医师等。',2,'open'),(36,5,NULL,'你能够使混乱的数据和模糊的事实排列有序，能够轻而易举的看到经济环境中的实际情况，做这种独立自主的工作能让你非常快乐。例如：证券分析师、采购员、经济学者、管理顾问、保险理算员等。',3,'open'),(37,5,NULL,'贸易的独立和实践的实际性常吸引住你，你推崇真实具体而且具有机会用手的任务，对完全吸引住你兴趣的工作最为勤奋。例如：飞机机师、教练、园艺设计、摄像师/特效专家、军官、刑事侦察员、画家、模型设计/制造者等。',4,'open'),(38,6,NULL,'你非常喜欢那些可以通过双手创造出美丽、吸引人同时又有用的东西的职业并且这些职业可以给你提供灵活自由的空间。例如：室内／风景设计师、宝石设计师、画家、演员、服装设计师、乐器制造、漫画/卡通制作、厨师等。',1,'open'),(39,6,NULL,'医疗保健事业可以给许多像你这样特点的人带来成就感，在那里你可以直接接触到病人，做细致的观察，迅速及时的解决问题，给他们提供身体和精神上的帮助。例如：牙医、药剂师、外科医生、营养学者、康复专家、职业咨询师等。',2,'open'),(40,6,NULL,'你做事灵巧、细致，那些户外的，可以接触实事，变化丰富的工作也是你该考虑的。例如：植物/动物/生物学者、地质/考古学者、摄像师、系统分析师、检查员等。',3,'open'),(41,6,NULL,'在服务性行业中，通过具体的、切实的方式帮助他人、关心他人，是自己价值观的体现。例如：文科教师、策划、翻译人员、社会工作人员、客户销售代表、工程师、野外探险领导者、保险鉴定人等。',4,'open'),(42,7,NULL,'你喜欢以独创的、个人的形式表达自己和观点，并且有自由与灵活的空间也是你对工作的要求。例如：记者、娱乐业人士、建筑师、演员、编辑、室内设计师、制片人、艺术指导等。',1,'open'),(43,7,NULL,'教书与咨询这两个职业领域能使你有机会为别人工作，帮助他们成长，发挥他们的潜能。例如：市场咨询顾问、心理学专家、社会工作者、人文/艺术教授、口笔译人员、职业顾问、医学顾问等。',2,'open'),(44,7,NULL,'你愿意与客户（病人）接近亲密的工作，且保持工作上的自主。例如：营养学者、健康护理医师、整容医师等。',3,'open'),(45,7,NULL,'你喜欢与人合作，喜欢设计和创新，让人感觉到你的付出既重要又独特。例如：人力资源人员、人力资源顾问、企业培训师、项目经理等。',4,'open'),(46,8,NULL,'你喜欢以独创的、个人的形式表达自己和观点，并且有自由与灵活的空间也是你对工作的要求。例如：记者、娱乐业人士、建筑师、演员、编辑、室内设计师、制片人、艺术指导等。',1,'open'),(47,8,NULL,'教书与咨询这两个职业领域能使你有机会为别人工作，帮助他们成长，发挥他们的潜能。例如：市场咨询顾问、心理学专家、社会工作者、人文/艺术教授、口笔译人员、职业顾问、医学顾问等。',2,'open'),(48,8,NULL,'你愿意与客户（病人）接近亲密的工作，且保持工作上的自主。例如：营养学者、健康护理医师、整容医师等。',3,'open'),(49,8,NULL,'你喜欢与人合作，喜欢设计和创新，让人感觉到你的付出既重要又独特。例如：人力资源人员、人力资源顾问、企业培训师、项目经理等。',4,'open'),(50,9,NULL,'多样性的服务领域，要求你在迅速改变的环境中快速思考/反应的服务领域可以满足你的好奇心和观察力。例如：市场咨询顾问、房地产经纪人、情报人员、投资、保险经纪人、预算分析师等。',1,'open'),(51,9,NULL,'你喜欢冒险，喜欢有一定刺激，所以某些娱乐性的工作会带给你职业满足。例如：记者、旅游规划师、摄像、主持人、演员、拍卖行业等。',2,'open'),(52,9,NULL,'你善于进行手工操作，这种操作可以带给你经济、技术的提高，且可以不断实践。例如：厨师、电气工程师、电信网络专家、财务主管、运动生理学者、教师、园艺设计、野外探险领导人。',3,'open'),(53,9,NULL,'那些过多约束的环境不是你需要考虑的工作环境，通常自由、多样化，能够提供冒险机会的工作对你更有适应性。 例如：管理顾问、网络经销、汽车商人、特许经营、批发/零售商等。',4,'open'),(54,10,NULL,'你充满活力、热诚，教育和社会工作给你提供了直接与别人工作、利用技术帮助别人的机会。例如：幼儿/小学教师、体育教练、社会工作者、健康/福利顾问、生物学者、内科/儿科医生、药剂师等。',1,'open'),(55,10,NULL,'你喜欢和朋友在一起并娱乐他人，喜欢在不断变化的环境里，有审美感，所以一些演艺界、艺术领域的工作。例如：旅游专业人员、演员、制片人、摄影/摄像师、节目主持人、画家、野外探险领导人、漫画/卡通制作者等。',2,'open'),(56,10,NULL,'你也应该考虑那些与他人可以高度互动、自由不刻板，可以发挥你处理人际关系能力和收集信息能力的工作对你来说也非常合适。例如：营销策划、销售、公共关系、融资者、零售商、仲裁人员、保险代理/经纪房地产经纪人。',3,'open'),(57,10,NULL,'服务业吸引你的地方是可以发挥你热心、友好的特点，可以提供你与人交往和使用你的技能的机会。例如：秘书、园艺设计师、环境学者等。',4,'open'),(58,11,NULL,'这些工作的创造性是吸引你的一个很明显的原因，它们能够让你新颖独特的想法充分发挥，尤其当环境无拘无束，并能从帮助别人中获得鼓励时。例如：人力资源开发、培训主管、销售经理、市场部经理、活动策划等。',1,'open'),(59,11,NULL,'你的特点是可以轻易的看到某个方法、计划或服务可能给别人带来的后果，善于深谋远虑，还可以发明一些富有创造意义的解决问题的方法。例如：公共关系、营销、市场咨询、客户服务、艺术指导、广告人、战略规划师等。',2,'open'),(60,11,NULL,'你有活力、有感染力，喜欢能够对别人产生积极影响的工作，帮助他人找到新颖的解决方法。例如：文科/艺术类教师、社会工作者、职业顾问、社会学者、心理学者、职业治疗、城市规划、营养学者等。',3,'open'),(61,12,NULL,'你非常喜欢那些能够创新、灵活和富于变化的工作，可以与很多人打交道，有一定的冒险性。例如：市场咨询顾问、培训师、摄影师、记者、城市规划、证券分析、经销人/代理人、风险资本家、企业家、发明家等。',1,'open'),(62,12,NULL,'那些可以通过有趣和创新的途径来发展自己想法和观点的领域，那些快节奏变化丰富的领域会满足你极大的好奇心和启发你积极的想象力。例如：编辑、广告创意人、公关人员、营销、主持人、制片人、贸易行销人员、作家等。',2,'open'),(63,12,NULL,'你具有开放的眼光，对问题有自己独到的见解，善于预测事态的发展趋势，所以一些规划和开发的工作非常适合你。例如：项目开发者、房地产代理/开发、投资/财政计划人员等。',3,'open'),(64,12,NULL,'那些在高度紧张、激烈的重要场合能够充分发挥运用你的思想知识，快速发现事情的关键所在的工作也是你需要考虑的范围等。例如：刑侦人员、社会科学者、政治分析者、行政管理人员、教育心理学者等。',4,'open'),(65,13,NULL,'你喜欢在一个要求严格、遵循标准化的操作程序环境中工作，这些工作可以让你与现实的实物或切实的工程项目打交道。例如：营销（实物）、教师、健康/安全专家、保险代理、采购工程师、预算分析人员等。',1,'open'),(66,13,NULL,'你善于搜集、整理、分析和演绎推理具体的信息资料，所以那些能够充分发挥你技术分析方面和机械操作方面能力的工作也非常适合。例如：机械工程师、计算机分析人员、网络管理员、审计师、药剂师等。 ',2,'open'),(67,13,NULL,'管理类的工作你会很喜欢，你可以发号施令、作决定、并且监督他人。统计发现很多这种特点的人在中层管理职位上做的非常出色。例如：项目经理、行政人员、工厂主管、数据库管理、财务总监、银行官员、信息总监、业务运作顾问等。',3,'open'),(68,13,NULL,'专业工作领域对你的吸引力在于它使你在一个具体的、已建立好、有光辉历程的机构里具有较高的威望。例如：牙医、内科医生、法官、股票经纪人、教师、律师、校长等。',4,'open'),(69,14,NULL,'许多和你特点一样的人对卫生保健方面的工作很感兴趣，这样可以通过自己的技能、操作直接的帮助他人。 例如：牙医、宠物医生、护士、健康保健医师、运动生理医师、临床矫正医师等。',1,'open'),(70,14,NULL,'你非常喜欢做对社会有价值的事情，如传授他人知识、为他人排忧解难，自愿的为建立、维护组织奉献自己时间和精力。例如：小学/幼儿教师、社会工作者、法律顾问、野外探险领导员、法院职员等。',2,'open'),(71,14,NULL,'你有较为出色的人际交往能力，那些可以接触客户或顾客，并通过广泛的合作来维持友好关系、又关注细节的工作对你有较大的吸引力。例如：公关人员、销售、零售业/餐饮业、保险代理、人力资源/教育顾问、口笔译人员、房地产咨询顾问、客户关系经理等。',3,'open'),(72,14,NULL,'服务业可以发挥你关心照顾他人、主动处理问题、关注细节的特点，直接与他人打交道，提供服务使你感到轻松舒适。 例如：大客户经理、旅游专家、秘书、会议策划等。',4,'open'),(73,15,NULL,'你喜欢与人交往，愿意去理解别人、取悦别人。同样你也喜欢通过写作、广告等方式与外界交流。例如：人力资源开发、销售经理、广告行业从业者，企业市场部人员等。',1,'open'),(74,15,NULL,'在咨询业你可以帮助别人解决问题、了解自己、挖掘潜力，并且与他人分享自己的价值观，又能够独立的工作。例如：定性/定量市场分析员、公关人员、作家／记者、制片人、网页/杂志编辑等。',2,'open'),(75,15,NULL,'很多有你这种特点的人愿意进入教育界，可以帮助他人成长和发展，或进入服务机构，这样可以有机会为自己和他人提高生活水平。例如：艺术/营养/健康类教师、社会工作者、非营利机构负责人等。',3,'open'),(76,15,NULL,'有些即要求懂技术，又要有很强的交际、交流能力的复合型工作也是你需要考虑的。例如：就业指导顾问、职业咨询师、ERP咨询顾问、财务咨询顾问等。',4,'open'),(77,16,NULL,'商业和金融领域对你的适用范围比较广，你喜欢担任有权威、有控制力且能管理他人的工作。同样，在金融领域你喜欢赚钱，喜欢竞争。例如：管理顾问、经济学者、银行业、金融规划师、人力资源、项目经理、股票经纪人、风险投资、营销、采购人员等。',1,'open'),(78,16,NULL,'咨询业的多样性和独立性也非常吸引你，与不同商业背景的人打交道，付出获得回报，会满足你的企业家精神。例如：教育顾问、培训师、猎头顾问、商业分析、战略顾问等。',2,'open'),(79,16,NULL,'某些职业所提供的社会地位和影响力也是你所感兴趣的，这些职位上所面临的智力挑战给你极大的吸引力。例如：律师、法官、心理学者、飞行员、工程师等。',3,'open'),(80,16,NULL,'许多与电脑相关的职业所要求的能力对你来说几乎是天生具备：理解并处理复杂问题、较强的逻辑思维能力、优秀的组织技能等。例如：网络主管、系统主管、系统分析师、项目经理等。',4,'open');
/*!40000 ALTER TABLE `jobs` ENABLE KEYS */;
UNLOCK TABLES;

--
-- Table structure for table `office`
--

DROP TABLE IF EXISTS `office`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
