INSERT INTO `program_course` VALUES (1,'财务会计入门','本课程是为进入会计专业的学生设计的。它将在概念框架和会计准则的指导下介绍财务会计。重点是能够编制财务报表的会计程序、做法和政策。学生将结合所学的理论和技术知识，进行判断，探讨会计问题。',1,'open',1),(2,'微观经济学','经济学作为一个知识领域。商科学位中的经济学。了解经济政策； 对市场的分析：供求关系；消费者行为；公司行为；生产成本和利润最大化；公司在不同市场结构中的行为；对市场资本主义经济制度、经济效率、市场失灵、政府失灵的评价；当前的经济政策、竞争政策、私有化和教育经费。',2,'open',1),(3,'商业统计','学生将学习使用基本的统计技术，并将其应用于会计、金融、管理、市场营销和一般商业问题。学生还应该能够有效地交流他们的分析结果。本单元内容包括：揭示数据所含信息的描述性统计；作为处理不确定性工具的概率；用于模拟商业行为的概率分布；单一人群的置信区间估计和假设检验技术；使用简单线性回归分析变量之间的关系；以及预测时间序列数据的简单工具。',3,'open',1),(4,'中级财务会计','本课程研究的是与公司结构运作有关的财务会计问题。主题包括财务报告要求、公司经营融资、企业合并、企业集团的性质、合并财务报表的编制和财务报表分析。',4,'open',1),(5,'会计信息系统','会计信息系统的核心思想是：会计人员必须了解支撑企业业务活动的核心业务流程，并产生交易数据。因此，本课程的目标是向学生广泛介绍核心业务流程。\r\n\r\n此外，鉴于技术在会计中发挥的作用，许多会计系统正在计算机化，所涉及的其他专题包括：硬件、软件和人的程序如何将数据转化为决策所需的有用的财务和非财务信息，记录和分析业务程序的方法，有效的电子表格设计原则，系统开发和维护，以及需要了解内部控制，以确保(信息和其他)资源不因无意和恶意行为而遭受损失。',5,'open',1),(6,'高级财务会计','本课程在前面财务会计单元所学知识和技能的基础上，探讨高级财务会计问题。审查了用于评估会计决策、报告做法和监管的一系列理论。本单元侧重于一些当代会计问题，包括：计量、无形资产、金融工具、外币交易和综合报告。',6,'open',1),(8,'股票分析','通过基本面分析和技术面分析研究股票的走势规律并做出合理的股票投资策略。学习如何对不同的行业和公司进行估值。如果使用不同的估值模型。如何熟练整理和分析各类金融财务数据并合理提出自己的假设。',1,'open',3),(9,'管理会计','本课程主要研究管理会计信息的提供和使用，以促进组织的管理规划和控制。审议了与预算编制、差异分析、业绩衡量和价值链管理有关的技术和行为问题。\r\n',7,'open',1),(10,'基因学','在过去的二十年里，基因组测序和分析已经改变了生物学。基本课程提供了计算生物学和生物信息学世界的介绍，学生将掌握实用的生物信息学技能，然后开展自己的科研项目，使用专门为本课程收集的基因组数据。我们还将探索过去二十年来人类在基因组学领域的关键进展和突破。',1,'open',2),(11,'海洋生物','本课程的重点是海洋生物之间的相互作用以及它们与环境的关系。内容将包括海洋生物的概述、海洋生态系统的功能、人为影响和保护。讲在课程结束时，学生应该能够比较海洋生态系统，区分主要的海洋生物并解释它们在群落中的作用，解释海洋生态系统的主要特征。',2,'open',2),(12,'无脊椎动物学','本课程包含无脊椎动物生物学的入门研究，强调比较功能形态学、系统发育学、自然史以及生理学等各个方面。',3,'open',2),(13,'寄生虫学','本课程包括各种医学上重要的寄生虫感染病症，并从生物学、流行病学了解其发病机制、治疗和预防。内容包括了解寄生虫和原生动物的生命周期，宿主-寄生虫关系的生物学方面，感染的流行病学，以及导致疾病的社会、经济和生态因素之间的相互作用。',4,'open',2),(14,'微生物学','我们生活在一个微生物的世界里，微生物通过各种贡献-从互利到疾病-塑造了植物和动物的生理学结构并帮助其不断进化。本课程将探索宿主和微生物之间的相互作用，学习形成这些作用的原则，探究它们的技术以及它们背后的分子机制。',5,'open',2),(15,'生物学定量分析','本课程介绍生物学中使用的各种定量方法及其数学理论，包括微分方程，线性代数基本概念的回顾，概率论的介绍，马尔科夫链，最大似然和贝叶斯估计，统计置信度的测量，假设检验和模型选择，换元和模拟，以及统计学和机器学习的几个专题，包括回归分析，聚类和主成分分析。',6,'open',2),(16,'脊椎动物解剖学','本课程将解剖并比较鱼类、两栖类、爬行类、鸟类和哺乳类（包括人类）之间的特征，以了解结构是如何发展的，它们是如何进化的，以及它们在不同环境中是如何相互作用的。我们将研究骨骼、肌肉、神经、血管、呼吸、消化、内分泌和泌尿生殖系统的整合，探索脊椎动物的历史和当今的多样性。',7,'open',2),(17,'人类生殖学','该课程侧重研究受孕、胚胎学、怀孕、分娩、哺乳、婴儿/儿童发育、青春期和生殖衰老。这包括研究如何降低和提高生育力、生殖和母婴健康的因素，我们还会探索生育率、生殖率、婴儿存活率和人口增长，以及生态、环境、文化、人种生物学和营养学会产生什么样的决定性因素。',8,'open',2),(18,'生态学','本课程会讨论微生物、动物和植物种群的生态学原理，探索海洋、淡水和陆地生物构建自然群落中的作用。课程还将讨论种群和群落生态学的观察、实验和理论方法，包括依靠代数、图形分析和基本微积分的定量方法。',9,'open',2),(19,'生态遗传学','本课程综合了生态学、遗传学和进化生物学，介绍了研究自然种群进化的当代方法，包括分析生态学上重要的遗传性，使用分子技术分解基因型，记录和测量自然系统中的选择幅度，以及使用模型预测自然种群的进化，研究生物之间生态互动的进化效应，种群规模和结构的重要性等等。',10,'open',2),(20,'债券信用分析','研究宏观经济以及公司个体运营对于债券价格交易投资的分析。通过公司的财务信息评估公司各类债券的偿还能力和风险。如果利用各类投资策略进行风险控制和调整风险敞口。',2,'open',3),(21,'现金流管理','现金流量管理是指以现金流量作为管理的重心、兼顾收益，围绕企业经营活动、投资活动和筹资活动而构筑的管理体系，是对当前或未来一定时期内的现金流动在数量和时间安排方面所作的预测与计划、执行与控制、信息传递与报告以及分析与评价。如果说利润相当于企业的血液，那么现金流则相当于企业的空气。因为现金流管理出现问题而使企业处于困境的例子不胜枚举。很多公司一直把注意力放在利润表的数字上，却很少讨论现金周转的问题。这就好像开着一辆车，只晓得盯着仪表板上的时速表，却没注意到油箱已经没油了。',3,'open',3),(22,'行为经济学','行为经济学是作为实用的经济学，它将行为分析理论与经济运行规律、心理学与经济科学有机结合起来，以发现现今经济学模型中的错误或遗漏，进而修正主流经济学关于人的理性、自利、完全信息、效用最大化及偏好一致基本假设的不足。',4,'open',3),(23,'公司金融','公司金融学（Corporate Finance），又称公司财务管理，公司理财等。它是金融学的分支学科，用於考察公司如何有效地利用各种融资渠道，获得最低成本的资金来源，并形成合适的资本结构（Capital Structure）；还包括企业投资、利润分配、运营资金管理及财务分析等方面。它会涉及到现代公司制度中的一些诸如委托-代理结构的金融安排等深层次的问题。一般来说，公司金融学会利用各种分析工具来管理公司的财务，例如使用贴现法(DCF)来为投资计划总值作出评估，使用决策树分析来了解投资及营运的弹性。\r\n',5,'open',3),(24,'计量经济学','计量经济学是以一定的经济理论和统计资料为基础，运用数学、统计学方法与电脑技术，以建立经济计量模型为主要手段，定量分析研究具有随机性特性的经济变量关系。主要内容包括理论计量经济学和应用经济计量学。理论经济计量学主要研究如何运用、改造和发展数理统计的方法，使之成为随机经济关系测定的特殊方法。应用计量经济学是在一定的经济理论的指导下，以反映事实的统计数据为依据，用经济计量方法研究经济数学模型的实用化或探索实证经济规律。广泛采用计算机组织教学，着重培养学生定量分析问题.解决问题的能力。',6,'open',3),(25,'宏观经济学','宏观经济学又称总体经济学、大经济学。是微观经济学的对称。宏观经济学是现代经济学的一个分支。宏观经济学以整个国民经济为考察对象，研究经济中各有关总量的决定及其变动，以解决失业、通货膨胀、经济波动、国际收支等问题，实现长期稳定的发展。',7,'open',3),(26,'微观经济学','微观经济学又称个体经济学，小经济学，是宏观经济学的对称。微观经济学主要以单个经济单位(单个的生产者、单个的消费者、单个市场的经济活动)作为研究对象，分析单个生产者如何将有限的资源分配在各种商品的生产上以取得最大的利润；单个消费者如何将有限的收入分配在各种商品的消费上以获得最大的满足。同时，微观经济学还分析单个生产者的产量、成本、使用的生产要素数量和利润如何确定；生产要素供应者的收入如何决定；单个商品的效用、供给量、需求量和价格如何确定等等。',8,'open',3),(27,'财报分析','财务分析是以会计核算和报表资料及其他相关资料为依据，采用一系列专门的分析技术和方法，对企业等经济组织过去和现在有关筹资活动、投资活动、经营活动的偿债能力、盈利能力和营运能力状况进行分析与评价，为企业的投资者、债权人、经营者及其他关心企业的组织或个人了解企业过去、评价企业现状、预测企业未来，做出正确决策提供准确的信息或依据的经济应用学科。',9,'open',3),(28,'投资管理','投资管理狭义上是一项针对证券及资产的金融服务，广义上还包括实体商业投资、加盟连锁、创新项目投资管理等，以投资者利益出发并达致投资目标。投资者可以是机构譬如保险公司、退休基金及公司或者是私人投资者。投资管理包含了几个元素，例如金融分析、资产筛选、股票筛选、计划实现及长远投资监控。投资管理在全球行业中有非常重要的责任看管上万亿元的资产。',10,'open',3),(29,'衍生品','金融衍生产品是指其价值依赖于标的资产（Underlying Asset）价值变动的合约。这种合约可以是标准化的，也可以是非标准化的。标准化合约是指其标的资产（基础资产）的交易价格、交易时间、资产特征、交易方式等都是事先标准化的，因此此类合约大多在交易所上市交易，如期货。非标准化合约是指以上各项由交易的双方自行约定，因此具有很强的灵活性，比如远期合约',11,'open',3),(30,'统计学','统计学是应用数学的一个分支，主要通过利用概率论建立数学模型，收集所观察系统的数据，进行量化的分析、总结，并进而进行推断和预测，为相关决策提供依据和参考。它被广泛的应用在各门学科之上，从物理和社会科学到人文科学，甚至被用来工商业及政府的情报决策之上。\r\n',12,'open',3),(31,'建筑绘图','本课程是土木工程和建筑相关专业的计算机图形学入门课程， 集中研究当前公认的行业图形标准及其技术应用。 本课程着重探索如何创建设计图并通过图像与他人沟通。',1,'open',5),(32,'测绘原理与实践','本课程包含的内容有施工图的测绘和基本测量方法；观测误差和误差传播理论；水平和垂直控制系统的基本概念；使用地形图和平面图；计算水平和垂直曲线以及土木工程中使用的计算机工具介绍。',2,'open',5),(33,'土木工程材料','本课程会研究三种工程材料（金属，陶瓷和聚合物）在纳米和微米级的力学行为，侧重点会在土木工程中使用的特定材料例如钢、岩石、粘土、硅酸盐水泥混凝土、沥青混凝土和木材。',3,'open',5),(34,'岩土工程','本课程会学习土壤分类，土壤勘探，钻孔和取样，土壤渗透性，一维沉降分析，土壤强度和地基等，',4,'open',5),(35,'水资源工程','本课程会针对地球环境中水的定量方法及其工程意义进行研究，包括与水的使用和控制相关系统的设计和分析； 以及介绍水文学，水利工程和水资源规划等主题。',5,'open',5),(36,'环境工程','本课程会探索空气和水污染物的来源，特征，传播和影响； 以及水源中发生的生物，化学和物理反应； 大气的结构和成分；固体废物管理；环境质量标准等话题。',6,'open',5),(37,'交通工程','本课程会讨论运输系统的设计，规划，运营，管理和维护。例如公路，航空，铁路等。学习内容包括针对高速公路，机场和铁路布局进行交通流模型，容量和安全性分析等。',7,'open',5),(38,'房屋机械和电力系统设计','本课程涵盖建筑物的机械和电气系统的设计。 学生将学习房屋供暖，通风和空调系统设计和原理，包括送风系统，机械冷却和供暖技术，管道设计和布局，风机和泵的选择以及水力系统等。',8,'open',5),(39,'生物分子的工程应用','本课程会主要研究构成生命有机体细胞的分子类别，例如糖，脂质，蛋白质和核酸。 探索这些重要的生物分子的结构和功能背后的化学作用，比如氢键，疏水力，静电相互作用以及其他弱相互作用，并且针对它们在工程环境中的重要性进行了讨论。',1,'open',6),(40,'生物力学','本课程涵盖了生物材料的力学原理，并探索如何应用于肌肉骨骼系统，神经，脊髓和血管组织，细胞等地方。 学习内容包括质心，惯性矩，对应力，应变和变形的基本理解，粘弹性和热应力等等。同时也会有案例研究的课程内容，以强调分析软组织和硬组织时必须考虑到的生物学标准。',2,'open',6),(41,'生理建模','生物学和医学是BME专业的基础知识，尤其是在医疗设备开发方面。 本课程将探讨在人类疾病中，工程技能和数学建模等方法是如何解决问题的。 学习内容主要包含了主要的生理系统例如心血管，肺和肾，以及其他常见病所在的生理系统。',3,'open',6),(42,'生物电学','本课程主要探索哺乳动物神经系统中关于生物电的基础知识。 内容包含组织和系统生物电中的电信号的被动和主动形式，包括Nernst方程，Goldman方程，Linear Cable理论以及Hodgkin-Huxley模型等在内的数学分析。',4,'open',6),(43,'生物医学传导基础','本课程探讨生物医学中的动量，热量和质量传输现象的基本概念和原理。 主题包括生理液（例如血液）的运输，物质运输（例如氧气和营养），强制对流（例如血液透析）和非稳态分子扩散（例如药物传递机制）等。',5,'open',6),(44,'生物系统中的热力学','本课程探索热力学原理在生物系统中的应用，内容包括热力学第二定律以及对能量和熵的解释，熵平衡和过程效率的概念， 分子运动和传输特性及其在生化分析方法中的应用。 学生会使用MathCad和MatLab软件来解决相关物理和化学问题。 ',6,'open',6),(45,'物理','介绍经典力学。空间和时间：直线运动学；平面运动；力和静平衡；粒子动力学，力和动量守恒；相对惯性框架和非惯性力功、势能和能量守恒；动力学理论和理想气体；刚体和旋转动力学；振动运动；角动量守恒；中心力运动；流体力学。',1,'open',32),(46,'微积分','本课程介绍变量函数的微分和积分，以及应用。极限和连续性的非正式处理。微分：定义、规则、作图、速率、近似和极限问题的应用。不定积分；可分离的一阶微分方程。定积分；微积分的基本定理。积分在几何学和科学中的应用. 基本函数。积分的技巧。极坐标。洛必达法则. 不恰当的积分. 无限级数：几何级数、p-谐波级数、简单比较测试、一些基本函数的幂级数。',2,'open',32),(47,'工程设计介绍','本课程基于项目的产品开发和工程设计介绍。强调设计过程的关键要素，包括定义设计问题、产生想法和建立解决方案。介绍一系列设计技术，帮助学生思考、评估和交流设计，从草图到物理原型，以及其他类型的建模。',3,'open',32),(48,'力学和材料学','介绍可变形固体的静力学和力学。强调平衡、几何兼容和材料行为三个基本原则。应力及其与力和力矩的关系；应变及其与位移的关系；线性弹性与热膨胀。失效模式。应用于杆、轴、梁、桁架等简单工程结构。应用于自然材料和结构的生物力学。',4,'open',32),(49,' 动态和控制','机械系统的块状参数模型的动力学和振动学介绍。运动学的学习。平面运动中粒子和刚体系统的力-动量公式。工作能的概念。虚拟位移和虚拟功。平面运动中粒子和刚体系统的拉格朗日方程。运动方程的线性化。机械系统的线性稳定性分析。机械系统线性多自由度模型的自由振动和强迫振动；矩阵特征值问题。',5,'open',32),(50,'电气工程','这个课程涵盖了电子和电气工程的基础知识。它将从模拟电路开始，描述电路分析的基本原理和模拟设备的设计。数字系统的基础将包括使用布尔代数和相关技术来分析数字电路，直到介绍倒装片。最后将介绍电力和机械系统。',6,'open',32),(51,'工程材料 ','这个课程的目的是介绍工程中使用的材料范围及其主要特性，以使他们能够为特定应用选择合适的材料。课程还介绍了决定材料电气或机械性能的基础科学，如原子/分子结构。你还学习各类软件，使你能够模拟工程材料的特性和行为，并分析实验结果。',7,'open',32),(52,'社会人类学','本课程介绍人类学家在世界各地研究和关注的一系列社会问题。 通过研究在不同社会体系里的政治，经济，家庭和宗教制度，探索了人类文化在社会中什么是可变的，什么是普遍的。',1,'open',13),(53,'人类学影视和文字','本课程通过对案例的深入分析，探讨人类学研究的本质，课程包含阅读和思考完整的人类学书本和民族志电影，对它们进行充分的比较，产生独立意见，提高学生的人类学分析能力。',2,'open',13),(54,'民族志写作','本课程向学生介绍过去和现在的人类学研究方法以及当今社会中的实用性。 人类学知识的基础是什么？ 人类学研究如何进行？ 什么是人类学上的“数据”？ 民族志研究与民族志写作之间有什么关系？ 学生将学习用批判的眼光阅读民族志内容，并探索人类学家们写民族志都经历了什么样的过程并用了哪些方法论。',3,'open',13),(55,'性别研究','本课程的目的是鼓励学生探索有关性别和性的文献； 然后将这些思想带入民族志的批判性解读中。 学生将就女性和男性的构造发展人类学观点进行分析。',4,'open',13),(56,'经济人类学','本课程会带领学生从人类学视角看待人们经济生活各个方面，比如农耕时代、工业时期，到当代消费主义。 学生将研究人类学对传统的经济学理论的影响，以及经济体系如何影响社会生活的各个方面。',5,'open',13),(57,'政治和法律人类学','本课程会从人类学角度对政治和法律制度进行分析。 内容包括政治和法律人类学的主要概念（包括权力形式）的发展； 知识和权力的形式； 政治竞争与冲突； 殖民地环境下当地人的转变； 民间正义观； 法律多元化理论等等。',6,'open',13),(58,'社会学入门','本课程让学生从社会学角度思考自己和更广阔的世界。从社会学角度出发学习当代世界及其文化，政治和经济制度。课程将先介绍社会学观点的理论和方法论基础，然后继续探讨社会分层的概念。在课程的后半部分，学生将更仔细地研究个体之间的相互关系，日常生活中社会不平等的形成，以及社会组织塑造个人和群体的方式，例如通过社交网络，居民区，学校，家庭和在线交流等等。',1,'open',14),(59,'经济社会学','经济社会学将社会学方法扩展到经济研究。 目的是了解社会结构与经济行为之间的关系。 学生讲探索人们如何找到工作，依靠社交网络共享知识和信息，获取和利用文化，社会和政治资本，建立信任，维持合作以及在全球经济体中创办企业。',2,'open',14),(60,'人口学','人口学课程重点研究的是人口统计过程（生育，死亡率和移民）与社会和经济问题之间的关系。 讨论涵盖与人口增长和空间分布有关的特殊主题，例如婚姻和家庭组合、人口老龄化、妇女角色和地位的变化、劳动力、移民、城市化与城市增长、资源分配和环境问题等。',3,'open',14),(61,'社会法','本课程从社会学观点来研究现代社会中法律制度。 法律在多大程度上建立和维持社会秩序？它在社会变革中的作用是什么？ 我们将回顾有关法律与社会之间相互关系的理论观点，并思考这种关系如何在当代法律问题中得到体现。 学生将研究社会互动如何影响法律机构，以及个人在日常生活中是如何运用法律的。',4,'open',14),(62,'社会学研究统计','本课程将向学生介绍数学统计分析的理论和方法。 每个人做出的许多决定都是基于统计数据的，但许多人对这些方法的优势和局限性知之甚少。 课程内容将为使用概率来进行逻辑推理提供坚实的基础。 尽管会有部分数学内容，但本课程并不是数学课，因为相当多的内容会注重于用于解释统计数据方法背后的含义。',5,'open',14),(63,'社会不平等','本课程研究了社会不平等的原因和结果，重点关注阶级，种族和性别方面的不平等。 学生将讨论不平等的程度和不同衡量标准，以及古典和现代的相关理论，以解释为什么自不平等现象一直在加剧。 此外，课堂中还会讨论什么程度的不平等是合理的，以及如何有效地重新分配资源。',6,'open',14),(64,'食品卫生和健康','本课程针对餐饮行业会产生的食品安全和健康问题进行探索。行业案例会包含餐厅、医院、高校、酒店、游轮、航空公司等话题。通常学生在结课前必须通过国家卫生认证考试（例如美国的ServSafe证书，这是任何餐饮行业的进入门槛）',1,'open',18),(65,'管理会计学','通过财务分析学会如何以管理者的角色做相关决定。研究如何通过数据控制成本，针对人力、食材以及其他供应链中的环节减少开支的管理策略。',2,'open',18),(66,'人力资源管理','研究什么是酒店和旅游行业最有效的人力资源管理策略，包括工作分析和设计，招聘，甄选人才，培训和发展，绩效管理，薪酬设计，员工关系和支持组织的策略等等。',3,'open',18),(67,'市场营销','本课程介绍什么是以客户为中心的市场营销方法，侧重研究组织在战略规划中市场推广起到的角色。针对餐饮、酒店和旅游行业产品的包装、广告、营销、品牌定位和推广都会有所讨论。',4,'open',18),(68,'食品采购管理','研究食品行业供应链各端，食物是如何从泥土或大海到餐桌上的过程。其中包括对产品质量的认证，有哪些检验标准，以及其中的分类。还会探讨食品采购中技术产生的作用。',5,'open',18),(69,'旅游地理','分析全球范围内的旅游目的地，包括探索其地理特征、风俗传统、人口分布、政治结构、宗教信仰、语言体系是如何影响其酒店和旅游行业的。课程的目的增强学生对世界地理的认知并对自身文化以外的文化价值观加以了解。',6,'open',18),(70,'酒店和旅游法','了解泛服务类行业的基本法律框架，通过案例分析从而帮助酒店餐饮和旅游行业的管理者在面对合同、法庭程序、道德规范和危机管理方面有更好的认识。',7,'open',18),(71,'解剖学','本课程主要涉及检查和解剖人体结构并了解其功能，包括活体解剖以及现代成像技术的使用。',1,'open',11),(72,'感染疾病和治疗','本课程涵盖许多特定疾病的基本机制，重点探索生物化学，遗传学，感染，疾病的免疫机制，炎症和瘤形成。 它还将讨论这些实体的治疗方法，并提供有关药代动力学和药效学的基本信息。',2,'open',11),(73,'血液和淋巴系统','本课程涵盖了造血和淋巴网状系统的正常结构，发展和功能； 血液和淋巴疾病和病症的病理生理学； 以及用于诊断和治疗的医学和药理学方法。',3,'open',11),(74,'神经科学','本课程是有关人类神经解剖学，神经生理学，神经病理学，神经药理学和一些微生物学以及与神经病学的入门相关主题介绍。 ',4,'open',11),(75,'肌肉骨骼和表皮系统','本课程涵盖了正常的生理学和组织学，讨论包含肌肉骨骼/外皮系统，这些系统的疾病和失调的病理生理以及诊断和治疗的医学和药理学方法。',5,'open',11),(76,'诊断科学','本课程是基础医学和临床医学之间的桥梁。 该课程侧重于以下技能：解释身体检查结果和了解病历，整合基本检测数据并鉴别诊断结果。',6,'open',11),(77,'现代医学','本课程的目标是使学生了解影响人类健康的问题并探索改善健康的方法，内容包括如何理解循证医学以及如何对公共卫生问题进行干预措施。',7,'open',11),(78,'内分泌和生殖系统','本课程涵盖内分泌和生殖系统的生理学和组织学，这些系统失调导致的的疾病，其中病理和生理学以及诊断方法和治疗的药理学原理。本课程还会探讨从胎儿（宫内）过渡到新生儿（宫外）的正常生理和发育过程。',8,'open',11),(79,'肾脏和泌尿系统','本课程涵盖了肾脏和泌尿系统的生理学和组织学，肾脏和泌尿系统疾病，相关病症的病理和生理学，以及诊断方法和药理学原理。',9,'open',11),(80,'心血管系统','本课程涵盖了心血管系统的生理学和组织学，心血管系统疾病，相关病症的病理和生理学，以及诊断方法和药理学原理。',10,'open',11),(81,'呼吸系统','本课程涵盖了呼吸系统的生理学和组织学，呼吸系统疾病，相关病症的病理和生理学，以及诊断方法和药理学原理。',11,'open',11),(82,'胃肠系统和营养','本课程涵盖了胃肠系统的生理学和组织学，胃肠系统疾病，相关病症的病理和生理学，以及诊断方法和药理学原理。该课程还包括有关营养原理的指导。',12,'open',11),(83,'多系统相互作用和关系',' 学生将在把各个人体系统上学习到的知识和概念综合运用起来，做整体的研究和分析。',13,'open',11),(84,'建筑构造','本课程通过对建筑材料和建造过程的介绍，把建筑从设计图变成现实。 课程涵盖了建筑搭建中常用的四个材料组：木材，混凝土，钢和玻璃。 学生将了解其中可用的选择以及常规环境下材料的使用方式。 学生还将通过观察建筑构造，研究不同的结构如何影响材料，连接以及其组装位置。 此外，除了对传统材料的认识，学生也会对新材料进行一定程度的探索。',1,'open',25),(85,'城市建筑史','本课程将向学生介绍从古典时期到今日的西方和东方城市建筑历史，同时也会分析建筑历史和理论中的文化研究层面，从而了解其中的方法论。',2,'open',25),(86,'能源与环境','本课程将研究如何最大限度地减少建筑的能源消耗，从而达到可持续的发展。 本课程将介绍定量和定性方法，用于在住宅和商业建筑的设计过程中评估其能源消化状况。 学生将通过使用最新的能源评估软件，以监测整座建筑的能耗。',3,'open',25),(87,'建筑学理论和历史','本课程会让学生对建筑历史和理论的关键时期以及当时的代表人物有更深入的了解。 课程将着重讨论20世纪的建筑师和他们设计建筑，以及一系列重要人物的哲学和他们的方法论，同时也会探讨建筑与艺术之间的关系以及建筑文学产生的影响。',4,'open',25),(88,'计算机2D/3D建模','该课程为学生提供使用专业建筑建模软件（例如3DStudioMax，Maya，Rhino等）的实践机会。 内容涵盖了通过计算机结构模型进行创建，操作和传递的全过程。',5,'open',25),(89,'建筑采光','采光是建筑设计中最基本的要素，本课程将侧重于自然光在设计中的运用方法，包括健康和舒适，节能以及如何达到最佳标准。 课程会将包括讲座和实验室两种形式，最终项目将使用物理模型或计算机模拟作为定性和定量方法来设计一个解决方案。',6,'open',25),(90,'宏观经济学导论','课程描述:基本经济思想和全国范围内的经济运作。商品和服务的生产、分配和消费，交换过程，政府的作用，国民收入及其分配，,国内生产总值，消费函数，储蓄功能，投资支出，乘数原理及其影响（收入和产出的政府支出。货币政策分析，包括银行系统和联邦储备系统）',1,'open',34),(91,'微观经济学导论','微观经济学主要以单个经济单位(单个的生产者、单个的消费者、单个市场的经济活动)作为研究对象，分析单个生产者如何将有限的资源分配在各种商品的生产上以取得最大的利润；单个消费者如何将有限的收入分配在各种商品的消费上以获得最大的满足。在这门课中会介绍生产可能性边界、机会成本、边际成本、边际效益、配置效率、比较优势和绝对优势、供需关系、产品价格、市场均衡、需求弹性、消费者剩余、边际效用、预算线、最优、无差异曲线、折旧、完全竞争、垄断、寡头垄断、囚徒困境、纳什均衡等微观经济学主题。',2,'open',34),(92,'统计学','统计学是利用数据对问题进行数值推测的艺术。主题包括:直方图，平均值，标准差，正常曲线，相关性。许多统计推理都依赖于概率理论，包括:机会模型，期望值，标准误差，概率直方图，收敛到正常曲线。',3,'open',34),(93,'发展经济学','许多国家的贫困和不发达是人类面临的主要当代挑战之一。本课程深入讨论了不发达的不同经济解释，以及促进发展的现代战略。我们将研究机构的作用，,体制变革，以及与经济发展有关的市场，并讨论相关的国内和国际经济政策问题。特别强调的是经济理论之间的相互作用和协同作用。(试图解释不发达）和经验数据（既提供激励事实，又为理论提供具体的检验依据）。在本课程结束时，学生们将能够设计创新的方法来评估所提议的发展干预措施是否有可能成功地改善其目标人群。',4,'open',34),(94,'计量经济学','这门课程的目标是让学生为经济学的基础实证工作做好准备。特别是，主题将包括基本数据分析，回归分析、测试和预测。学生将有机会使用实际经济数据来检验经济理论。',5,'open',34),(95,'行为经济学','在这门课上，我们将尝试重新整合大约一个世纪前开始分裂的心理学和经济学的学科，我们将考虑当几个简化经济模型的假设被心理现实的假设所取代时，对经济行为的预测是如何不同的。基于来自实验室和世界的经验观察。我们将特别关注这些修正的假设如何影响市场、管理和公共政策。',6,'open',34),(96,'微积分','微积分是高等数学中研究函数的微分(Differentiation)、积分(Integration)以及有关概念和应用的数学分支。它是数学的一个基础学科，内容主要包括极限、微分学、积分学及其应用。微分学包括求导数的运算，是一套关于变化率的理论。它使得函数、速度、加速度和曲线的斜率等均可用一套通用的符号进行讨论。积分学，包括求积分的运算，为定义和计算面积、体积等提供一套通用的方法。',7,'open',34),(97,'线性代数','本课程包括但不限于线性方程组、矩阵、行列式、向量与向量的学习。软件和图形计算器将用于加强学习和教学的主题和技术涵盖。',8,'open',34),(98,'神经科学','本课程会介绍神经系统的结构和功能； 首先考察神经科学的研究方法、生理学和人体解剖学。然后，我们研究产生感知和运动等基本功能的大脑系统，以及睡眠、记忆和情感等复杂过程。最后，我们在神经系统和精神疾病的病例中研究其中的原理。',1,'open',12),(99,'社会心理学','本课程会研究社会心理学的基础并结合其历史发展，聚焦于那些改变了我们对社会互动的理解，进而引发心理学领域重大转变的经典案例。这门课所涉及的一些主题将包括：个人与群体、顺从与服从、吸引力、群体间关系、判断与决策。',2,'open',12),(100,'发展心理学','本课将介绍发展心理学的基本原理。除了教授经典的理论外，我们还将着眼于业内当前的方法和发现。学生将学习发展心理学作为一门科学如何应用于对儿童的理解，以及长大成人的复杂过程。',3,'open',12),(101,'人格心理学','本课程将着重于当前关于人格的理论方法，主要将围绕以下人格研究的核心问题展开： 人与人之间为什么会产生差异？我们如何衡量个体差异？性格会随着时间的推移而改变吗？人格与社会文化因素如何相互影响行为？是什么让人快乐？不同的个性会对生理、心理和社会产生什么样的结果？\r\n',4,'open',12),(102,'感知学','本课程主要介绍对神经方面的感知，侧重于视觉和听觉研究。内容包括研究感知的科学方法、视觉和听觉系统的生理学结构解剖、色觉、深度知觉、运动知觉、立体视觉、视觉识别、音调和响度知觉、言语知觉、盲人视觉系统的重组等等。',5,'open',12),(103,'认知心理学','本课程针对大脑活动与认知过程和行为作为主题。内容包括了学习神经生理学和探索测量大脑活动的技术。此外，在研究与注意力、记忆力和认知控制相关的神经反应之前，课堂会讨论感知和神经运动过程。',6,'open',12),(104,'临床心理学','本课程将为学生提供临床心理学领域的概述，临床心理学家在研究和实践中扮演的角色，以及当前神经科学研究对临床心理学的影响。课程将讨论临床心理学作为一门专业的定义和历史，临床心理学中使用的研究方法，疾病的诊断和分类问题，智力和人格功能评估中使用的技术，干预治疗的各种方法，以及与临床心理学的道德、专业和培训有关的问题等。',7,'open',12),(105,'变态心理学','本课程将对非正常心理学进行介绍。该课程将有三个核心目标： 1）探索精神障碍的本质，包括各种形式的精神疾病的现象学、症状/体征和致病因素；2）探索各种精神障碍的常规和新型治疗方法；3）在精神障碍的理论和实证研究中培养批判性思维能力。该课程将探索广泛的精神障碍，包括抑郁症、焦虑症、精神分裂症、成瘾、饮食障碍和人格障碍等。',8,'open',12),(106,'可视化基础','本课程介绍基本的绘图和素描技术，包括图形背景，透视图构造和澄清图等等，学生将通过指导练习来完成个人项目。',1,'open',22),(107,'用户体验设计','设计触及人们的生活，并可能产生深远的影响。 本课程对设计的广义定义开始，学生可以了解设计的流程以及最终产品的关系，探索用户如何与设计交互，讨论设计人员如何需要思考实用之外的东西。 课程还会通过一系列的讲座，对其他设计师作品的探索，实地考察，观看，讨论什么是设计以及设计师要做哪些。',2,'open',22),(108,'色彩学','本课程将探讨色彩运用的基本原理，这些色彩是设计中的交流和表达。 虽然本课程本身并不涉及颜色理论，但我们将花时间研究颜色的相互作用，颜色对比和颜色使用的影响，以便在未来视觉设计工作中有效使用颜色。 ',3,'open',22),(109,'字体学','本课程简要介绍了西方字母的历史发展。学生还将接触到字母词汇，古文字和标点符号的经典页面设计，过去和现在的出版物设计以及当今字体在设计中的作用。',3,'open',22),(110,'3D建模','本课程会介绍一系列建模用的材料和工作坊技术，以及熟练使用一种或多种可视化方法：徒手素描，2D图形，运动图形和/或3D实体或曲面建模的计算机软件，从而唐学生可以通过这些方法进行设计。',5,'open',22),(111,'视觉记录','视觉记录就是用视觉的方式记录事物。本课程旨在制作视觉笔记，以使学生能够观察，记录整个过程，并通过记录中的条目，将其作为传达设计概念，实施项目开发和演示的工具。课程的大部分时间将在户外、博物馆，动物园和建筑工地等地进行。',6,'open',22),(112,'植物生物学','本课程介绍与植物生物学相关的基本概念，以更好地为学生准备更专业的学习。 课程会涵盖植物生态学，生理学和遗传学的机制和过程，重点将放在收集和解释科学数据的方法上，并将在实验室中进行关键实验说明此过程。 ',1,'open',51),(113,'微生物学','本课程提供了微生物学的综合知识，讨论微生物世界的所有分类单元。还会讨论了与微生物学有关主题，包括医学微生物学，但重点是植物学和环境科学。 与其他微生物学不一样的地方是对细菌学的关注减少，而对原生生物和病毒，尤其是真菌的讨论更加详细。',2,'open',51),(114,'植物生态学','本课程将介绍植物生态学的广泛应用。 通过讲座和实验室作业，学生将对植物种类和种群分布的生态有深入的了解。 学生还将了解如何将这些概念应用到植物物种和种群的保护和管理中。',3,'open',51),(115,'植物分类学','本课程介绍种子植物分类的原则，重点是实验室和田间鉴定方法，需要在野外进行课程。',4,'open',51),(116,'植物解剖学','本课程介绍种子植物的内部结构。 描述和识别细胞和组织类型，组织系统及其在营养和生殖结构中的相互关系。 植物体从胚到成熟植物以及从分生组织到成熟组织的发育变化。 ',5,'open',51),(117,'基因学','本课程探讨植物中遗传性状的传播；基因与环境相互作用；染色体畸变，多倍体，基因突变； 种群中的基因； 核酸的结构和功能；生化遗传学；分子遗传学等主题。',6,'open',51),(118,'植物生理学','本课程介绍高等植物的基本生理过程，特别是环境因素对生长，代谢和繁殖的影响。 实验涉及植物生理学各个方面的动手经验，包括与水的关系，光合作用，生长，休眠，激素和开花。 ',7,'open',51),(119,'教育学研究简介','该课程的开发旨在帮助你考虑与教育学院学位的跨学科性质有关的问题，以及如何有效地学习和培养良好的学术实践。你将学会如何提出论点并支持你的观点。',1,'open',16),(120,'多元化的学习情境','在这个课程中，你将探索学习是如何由社会，文化和经济背景形成的。你将考虑全球教育方法的一些哲学观点。您还将研究教育的社会学方面，以及不同环境受其社会经济环境影响的方式。你将反思自己以前作为学习者的经历，以及你的学习是如何受到环境影响的。',2,'open',16),(121,'教育的心理学方法','本课程是关于心理学知识在教育中的应用。你将了解广泛的理论和观点。你将关注教育领域的一些重大问题和争论事件，如有效教学的本质和实证研究的证据对实践的作用。你还将了解心理学技术在教育研究中的应用。如果你对心理学在整个生命周期中的教育应用感兴趣，和/或考虑在教学或相关专业的职业生涯，那么这个课程将与你的目标和兴趣相关。',3,'open',16),(122,' 学习方法理论','本课程的主题是学习：我们是如何学习的，影响学习过程的因素有哪些。你将考虑广泛的理论和观点，并将其应用到不同的学习环境中。你将使用各种教学方法进行教学，以提供独特的学习经验，并鼓励你不断反思这些。该课程对于那些想分析自己的学习过程的人，以及那些正在考虑从事涉及理解和支持他人学习的职业的人来说是非常有用和有意思的。',4,'open',16),(123,'当代教育问题和辩论','这个课程是关于当代教育的辩论，向你介绍教育研究和实践中的关键思想和问题。在该课程中，你将通过研究目前在更广泛的世界范围内讨论的问题，探索学校和教育系统面临的政治和教学挑战。你将了解让所有社区参与教育的更广泛的社会问题，并考虑这对学习者的影响。',5,'open',16),(124,'第二语言学习和学习','你有没有想过人们是如何学习一门新语言的？你可能自己尝试过，不管成功与否，可能会想知道这个过程是如何运作的。你可能会考虑做一些语言教学，不管是暂时的还是作为职业，觉得了解一下语言学习者所经历的过程会很有用。通过本课程的学习，你将对当前关于第二语言/外语使用和语言学习过程的观点有一个基本的了解。',6,'open',16),(125,'消费行为学','本课程提供了一个概念和实践框架，用于理解人们作为消费者这群市场营销的核心研究对象的想法和决定，并利用这些知识预测他们对企业推出新的产品或服务时候的反应。 学生将获得心理学和社会学方面的基本知识，这些知识点将解释消费者如何决定购买途径，并应用于战略性营销问题。',1,'open',20),(126,'消费洞察研究','客户是公司的核心。 没有客户，就没有生意。 本课程将帮助您深入了解消费者的需求，购买理由以及影响他们选择的因素。 了解消费者之间的差异可以帮助企业发现细分市场并有效地定位其产品和服务。 学生将了解传统和现代的数据收集方式，例如焦点小组，调查和实验。 您将学习分析定性和定量数据，并从分析中得出结论，以帮助做出重要的战略决策，例如市场选择，产品设计，数字和传统媒体选择，广告信息和定价。',2,'open',20),(127,'广告学','本课程为学生提供了一个全面的知识框架，以了解广告制作流程并欣赏广告中的管理和理论观点。 它涵盖了制定广告计划的所有阶段，从分析情况，定义明确的广告目标到执行。 学生将学习与广告中各种技能领域相关的工具，包括客户计划，媒体计划，以及文案/美术指导，同时对广告的整体流程和结构有了更广泛的了解。 课程会涉及一个综合的小组项目，模拟广告活动发展中的各个步骤。',3,'open',20),(128,'社交媒体策略','本课程介绍传统媒体（例如电视，印刷品）和在线社交媒体（例如在线社交网络，用户生成内容，博客，论坛）共存的新媒体环境中的营销，广告和传播策略。 希望学生了解传统广告方法和策略的基础知识。 有了这些背景知识，本课程的主要重点是了解社交媒体，制定社交媒体营销策略并跟踪其效果。 作为课程的一部分，学生将参加社交媒体网站的运营，与Facebook，LinkedIn，Instagram，Twitter，YouTube等网站进行公开合作。',4,'open',20),(129,'定价学','本课程为学生提供有关评估和制定价格策略的框架，技术和最新思路。 重点在于：a）对不同行业的定价惯例有深入的了解，b）学习用于分析定价的最新理论框架，以及c）掌握制定战略性和可盈利的定价决策的工具和技术。',5,'open',20),(130,'数据驱动策略','随着技术进步和发展，公司可以收集和分析大量高质量的数据，这使他们能够了解客户的行为并定制业务策略以针对日益精细的细分市场。 但是，由于很多企业很难将客户数据转换为可操作的策略，因此许多希望未能兑现。 本课程通过为学生提供用于制定业务决策的工具和技术来填补这一空白。 该课程的重点是对数据分析的结果进行解释，以做出现实中更好的业务决策。',6,'open',20),(131,'新产品开发','无论是初创公司还是老牌公司，新产品开发都是至关重要的，不仅可以提高客户满意度，还能扩大竞争优势。尽管大多数公司都承认创新的重要性，但许多公司仍在努力做到这一点。本课程提供了丰富的工具和技术知识，从而决定什么是正确的新机会，并创造新的产品或服务。通过课堂讨论，现实案例分析和小组项目，我们将探索开发新产品的整体方法，并结合定量和定性的观点，定义目标客户，理解和分析客户需求，生成和评估概念，预测需求，设计产品和服务，制定市场进入策略等。',7,'open',20),(132,'奢侈品营销','本课程旨在使学生了解奢侈品的基本原理。奢侈的概念是什么时候兴起的，今天它又有什么特殊含义？历史上所谓的奢侈品，消费者的品味，材质的使用是如何演变的？奢侈品行业如何随着时间而发展，其核心是什么？奢侈品，奢侈品牌，奢侈品市场和奢侈品商业模式之间有何区别？根据普遍的看法，奢侈品牌是过去与未来之间的桥梁。在本课程结束时，学生将获得：a）对各种行业（装饰物品，饰品，珠宝，美容产品，酒店，汽车，时尚）的奢侈品领域的了解，b）观察技巧，使他们能够区分什么构成产品中的奢侈品（与行业无关），c）区分这些产品的细微差别，以及在技术，设计和材料方面具有清晰和精确的判断能力，以及d）识别潜在新奢侈品的关键技能，以及它们与包括新兴市场在内的各种市场的关系。',8,'open',20),(133,'零售策略','\"本课程旨在让学生了解形成零售业的力量。 从人口，经济，竞争和技术发展分析有哪些正在改变市场的力量？ 这些数字如何影响消费者行为？ 它们如何影响零售商商业模式的有效性？ 新玩家和新技术已经完全颠覆了传统零售业， 是什么定义了这些新玩家的成功以及他们的长期前景又如何？ 我们又能从曾经主导市场的零售商的失败中学到什么？\r\n到本课程结束时，学生将 a)了解用于分析零售商定位的框架，b)评估零售概念及其绩效的工具，c)对零售业务和策略的理解，d)介绍股票分析师在对不同公司进行估值/投资时使用的工具。\"',9,'open',20),(134,'语音学（Phonetics）','本课程会介绍使用国际语音字母表的语音转录；语音声学分析；从生理和认知方面分析语音的产生和感知；语言语音系统的分析。',1,'open',37),(135,'音系学 （Phonology）','本课程介绍跨语言现象和音系学中的分析方法，包括音系学类别，特征，交替和相关音系学模型； 以及音节的结构，音调和重读以及形态学上的音系学。',2,'open',37),(136,'形态学（Morphology)','本课程介绍跨语言音系学和形态学现象，以及描述和分析的标准方法。',3,'open',37),(137,'句法学（Syntax)','本课程会针对句子的结构特性以及句子结构与句子含义之间的联系进行研究。',4,'open',37),(138,'语用学（Pragmatics）','本课程会讨论语言使用与人类行为之间的关系。 强调对话逻辑，言语行为理论，礼貌，社会角色，对自身和语言的心理感知，语言使用的变化等等。',5,'open',37),(139,'语义学（Semantics）','本课程介绍关于语言意义的研究。 它侧重于应用从集合论和逻辑（包括lambda演算）中提取的形式化工具来对单词和句子的含义进行明确说明。',6,'open',37),(140,'语篇（Discourse）','本课程探讨语篇如何由年龄，性别，种族，族裔和地区/政治背景等社会文化力量构成。 它以音频，视频和文本形式研究了各种交互上下文，从博客到政治辩论到休闲聊天，涵盖了语用，对话和语篇分析以及社会语言学的主题和方法。',7,'open',37),(141,'社会语言学','本课程研究社会语言学的原理和方法。 涉及的主题包括语言语用学，变异理论，社会和区域方言学以及口语风格。',8,'open',37),(142,'语言学定量分析','本课程探索语言学和认知科学中定量分析的研究方法。 学生将学习如何使用R编程环境进行统计分析和数据可视化。',9,'open',37),(143,'文学形式','本课程将探讨随着时间变化而变化的多种文学形式。内容着眼于伟大的文学类型，例如史诗，悲剧和抒情诗，以及历史变迁时的文学风格等，主要作品包括：贝奥武夫（史诗），李尔王（悲剧），伊丽莎白?毕晓普的诗歌（抒情诗）等。该课程将创意写作与批判性写作相结合：作业将采用创意以及说明和分析形式。',1,'open',39),(144,'英语语言历史','从其晦涩的起源，悠久的历史以及当今的全球影响力来看，英语语言对使用它的人来说意味着很多事情。 为什么发音与拼写不一致？ 古英语怎么了？ 莎士比亚当年听起来像什么？  那么英语作为世界语言的未来呢？ ',2,'open',39),(145,'古英语介绍','本课程是对古英语的介绍，古老英语是从五世纪初到1100年左右的中世纪早期英格兰居民所说的语言。尽管现代英语可以识别许多其语言特征，但必须将古英语作为一门外语来学习。',3,'open',39),(146,'英语文学-莎士比亚','莎士比亚的十四行诗是论点的一种形式，其中大多数与爱情有关。 我们将在本学期中全部阅读它们，然后谈论我们发现特别有趣的内容。 我们将了解角色，情节以及诗人的风格和思维方式。',4,'open',39),(147,'英语文学-14到17世纪','这门课程介绍了十四世纪末至十七世纪末的英国文学史。 Geoffrey Chaucer的《坎特伯雷故事集》，Edmund Spenser的《仙境女王》和约翰?米尔顿的《失乐园》将是我们的主要研究对象，但我们还将着眼于16世纪和17世纪后期的短诗。 ',5,'open',39),(148,'英语文学-17到19世纪','当我们阅读在动荡的时期中制作的作品时， 在一个全球贸易不断扩展的世界（茶之类商品的进口突然在英国变得司空见惯），政治革命（英语，美国，法语）以及对男人或女人的观念不断变化的情况下，越来越多的文学内容成为争论的焦点。 ',6,'open',39),(149,'英语文学-19到21世纪','本课程将研究从19世纪末到21世纪初的英国，美国和全球英语文学。 本课程涉及许多类型的运动，将探讨20世纪和21世纪作家使用文学形式来代表，质疑现代性的不同方式。 我们将特别注意文学研究中涉及种族，性别和性，殖民主义，大众传媒和经济等问题。',7,'open',39),(150,'食品科学和技术介绍','本课程探索科学技术在食品中的应用，阐明了工程学，生物技术，生物化学，营养，毒理学和微生物学在向世界提供安全和营养食品方面的作用。 概述了食品科学作为一门学科和职业选择。 ',1,'open',43),(151,'食品物理化学性质','本课程对食品的物理，化学和营养特性以及食品科学和技术原理和实践进行了全面介绍。 主题包括食物商品成分的化学功能，影响食品质量的化学，物理和生物学现象，加工和保鲜技术，微生物学和发酵，食品安全，法规以及其他问题。',2,'open',43),(152,'食品分析','本课程介绍用于食品分析和其他生物学分析的基本分析技术。 强调分析化学的基本原理，基本的实验室技术和现代仪器方法。 讨论了重量，体积和分光光度法，气相色谱法，高效液相色谱法，红外光谱和原子吸收光谱法。',3,'open',43),(153,'烹饪科学','本课程通过讲座、烹饪演示、品尝和动手烹饪实验，探索食品和烹饪的科学。 揭示烹饪介质的科学原理， 将讨论成分，其来源，配方中的功能以及影响其相互作用的机制。 将介绍如何用来将不同成分的混合物转变成美味可口食物的烹饪技术和传统。 ',4,'open',43),(154,'食物化学','课程内容涵盖食品中的化学成分。 讨论水，蛋白质，脂质，碳水化合物以及其他食品成分和添加剂的化学和物理性质，以及它们在食品中的相互作用和功能。此外，课程还会描述了在加工和储存过程中食品发生的化学反应和变化，以及它们对这些食品的质量和营养特性的影响。',5,'open',43),(155,'葡萄酒酿造学','本课程讨论葡萄栽培和酿酒学的原则和实践， 检查影响葡萄产量和品质的环境因素。 涵盖了酿酒的各个方面，从收获原料到装瓶，从采摘到发酵完成。',6,'open',43),(156,'啤酒酿造学','本课程以啤酒和酿造科学为起点，探讨发酵生物学，食品化学，食品加工等主题。 学生将学习到区分不同啤酒风格的主要化学特征，并了解生产过程中的原材料的选择如何导致这些结果。',7,'open',43),(157,'食品微生物学','微生物在各种食品，农业和环境过程中起着核心作用。 本课程对微生物在工业/生物技术过程中的作用及其在食品安全和生产中的重要性进行了全面的研究。 ',8,'open',43),(158,'食品安全保障','本课程侧重研究当前使用的食品安全方法，以控制生物，化学和物理危害对事物的影响并确保食品安全。 主题包括生产规范和卫生标准操作程序，危害分析关键控制点（HACCP），食品安全管理系统（SQF）以及当前技术在减少食源性疾病中的应用。',9,'open',43),(159,'人力资源管理介绍','人力资源管理战略作用的基础研究。目标是应用人类行为知识，劳动关系和现行法律法规对工作环境的影响。主题包括就业法律法规，全球经济中的多样性，全面薪酬管理，以及培训和发展促进组织成功。',1,'open',23),(160,'组织沟通','组织内沟通结构的研究。目标应用理论和实例来提高沟通和谈判的管理效率。通过案例、练习和项目分析组织沟通的问题和技巧。',2,'open',23),(161,'劳动关系','当代劳动关系实践的调查。其目的是研究和分析劳动关系问题，并支持劳动关系流程。讨论包括各国组织劳动的历史，第三方角色，组织运动，集体谈判过程。',3,'open',23),(162,'组织文化与变革','对性质的考察，定义，理论，以及组织文化的各个方面。目标是运用组织文化的知识来制定一个管理计划。分析包括行为模式及其与组织文化的关系，特别是组织业务对员工行为和文化的影响。主题包括国籍的角色，组织文化中的性别和种族；应对组织挑战的影响；理论与实践；以及个人的相对角色，群体和文化背景下的组织。',4,'open',23),(163,'员工培训和发展','企业员工培训与人力资源开发研究。主题包括培训项目的开发、管理和评估；员工发展；职业发展；以及组织变革。员工发展中的问题(包括对员工能力的评估，学习和成长的机会，以及经理在员工发展中的作用）。',5,'open',23),(164,'管理与组织理论','管理的四大职能??规划、组织，领导，和控制??强调应用管理概念和理论来实现组织目标。其目的是制定战略和目标，以提高绩效和可持续性。主题包括道德规范，社会责任，全球化、变革和创新。',6,'open',23),(165,'全球人力资源管理','全球人力资源管理综合研究。目标是展示跨文化能力；确定全球化劳动力的趋势；并分析政策、实践人员配备、培训、薪酬和评估。',7,'open',23),(166,'营养、健康和社会','本专业入门课程讨论有关营养，运动和其他生活习惯在预防疾病，保持良好健康和优化运动表现中所起的作用。 重点在于从生物学机制了解良好的营养和规律运动会如何影响心理和身体健康的。',1,'open',42),(167,'人体生物化学','本课程探讨在人类健康和疾病的生物化学原理。 从碳水化合物，脂质和蛋白质在支持人体主要器官的结构和生理功能中的作用的角度出发，进一步了解酶催化，酶调节，激素作用和生物能学的概念，涉及真核DNA结构，功能和基因表达的基本概念，以及它们在调节新陈代谢中的重要性。',2,'open',42),(168,'营养代谢','本课程探讨人类营养的生化，生理，分子和基因组方面的课题。 涵盖食物来源，消化，新陈代谢和营养成分（即碳水化合物，蛋白质，脂质，维生素和矿物质），包括与营养有关的代谢性和慢性疾病。',3,'open',42),(169,'人体解剖学和生理学','本课程详细介绍人体的结构和功能以及用于维持体内平衡的机制，介绍人体解剖学和生理学。 重点放在与营养科学和医学有关的方面。 内容包括解剖学，细胞，组织，外皮，呼吸道，骨骼，肌肉，消化系统，神经系统，心血管系统，泌尿系统和生殖系统。 ',4,'open',42),(170,'营养学研究方法','本课程介绍实验室中营养研究的原理和分析技术，主题包括体液中营养，代谢物和酶的分析方法； 评估个人食物摄入量和营养状况的方法； 以及评估食物成分的方法。',5,'open',42),(171,'食品物理化学和生物学','本课程对食品的物理，化学和营养特性以及食品科学和技术原理进行全面介绍。 主题包括商品成分的化学功能，影响食品质量的化学，物理和生物学现象；加工和保鲜技术，微生物学和发酵，食品安全，法规等。',7,'open',42),(172,' 疾病和营养学','本课程是对营养学，生物化学，生理学，遗传学，病理学和药理学原理相结合，以了解相关疾病的风险，预防和管理方法。 课程为同学提供了讨论有关营养和健康领域最新热门话题的研究机会。',8,'open',42),(173,'公共卫生与营养学','公共卫生营养学是营养学的职业道路之一，致力于在社区和国家层面上改善人群的饮食习惯和营养状况。 该课程通过描述用于评估人群的营养问题，制定与营养有关的政策以及提供健康，营养和食品援助计划的方法，帮助学生准备从事公共营养工作。',9,'open',42),(174,'城市发展史','每个城市都在历史上发生了巨大的变化。 该课程研究影响发达城市地区增长的因素。 关注空间和社区的特征和概念，理解城市变化对社会，经济，政治和环境带来的影响。 为学生提供了思考城市未来的机会，并思考规划者，公民，管理机构和其他力量在城市的变化中如何起到一定作用。',1,'open',21),(175,'土地使用和环境规划','在这个偏实践性的课程里，学生会向社区提供支持，并有机会与社区合作解决关键的规划问题。 主题可能包括土地使用和自然保护计划的开发，社区的再开发计划，公共空间的设计和分析，以及提供帮助社区在环境和经济上更具可持续性的策略。',2,'open',21),(176,'地理信息系统介绍','地理信息系统（GIS）彻底改变了人们管理，分析和呈现空间信息的方式。 本课程侧重于社会科学中的GIS。 这些概念可以应用于许多其他学科，例如政府，经济学，自然资源和社会学。 其中涉及的一些问题包括空间分析的基础知识； GIS技术和应用概述； 设计一个GIS项目； 收集和分析数据； 并创建相关图像。',3,'open',21),(177,'城市经济学','本课程不仅会介绍经济学家是如何通过经济学的概念和方法来研究城市，地区及其之间的关系，并且从更广义的角度研究家庭和企业如何在空间方面做出决策，其中包括城市的增长和衰退，土地和住房市场，交通问题，贫困问题以及城市公共服务的分配等决定因素。',4,'open',21),(178,'资源管理和环境法','本课程将法律概念和流程的应用引入自然资源和相关区域的管理。 探索普通法，成文法，行政法规和司法决定在管理这些资源中的作用。 特别关注野生动植物，湿地和公共土地上的关键资源的管理。',5,'open',21),(179,'城市设计工作坊','本课程会探讨城市与多种力量（包括物质，技术，文化，社会，经济和环境）的相互作用如何塑造其建筑形式，功能和结构，从而创造出不断发展的公共生活区域。课程从概念、理论、原则和过程的学习来制定有创造性又可以落地的解决方案，从而解决城市规划中的问题。',6,'open',21),(180,'营养、健康和社会','本专业入门课程讨论有关营养，运动和其他生活习惯在预防疾病，保持良好健康和优化运动表现中所起的作用。 重点在于从生物学机制了解良好的营养和规律运动会如何影响心理和身体健康的。',1,'close',42),(181,'人体生物化学','本课程探讨在人类健康和疾病的生物化学原理。 从碳水化合物，脂质和蛋白质在支持人体主要器官的结构和生理功能中的作用的角度出发，进一步了解酶催化，酶调节，激素作用和生物能学的概念，涉及真核DNA结构，功能和基因表达的基本概念，以及它们在调节新陈代谢中的重要性。',2,'close',42),(182,'营养代谢','本课程探讨人类营养的生化，生理，分子和基因组方面的课题。 涵盖食物来源，消化，新陈代谢和营养成分（即碳水化合物，蛋白质，脂质，维生素和矿物质），包括与营养有关的代谢性和慢性疾病。',3,'close',42),(183,'人体解剖学和生理学','本课程详细介绍人体的结构和功能以及用于维持体内平衡的机制，介绍人体解剖学和生理学。 重点放在与营养科学和医学有关的方面。 内容包括解剖学，细胞，组织，外皮，呼吸道，骨骼，肌肉，消化系统，神经系统，心血管系统，泌尿系统和生殖系统。 ',4,'close',42),(184,'营养学研究方法','本课程介绍实验室中营养研究的原理和分析技术，主题包括体液中营养，代谢物和酶的分析方法； 评估个人食物摄入量和营养状况的方法； 以及评估食物成分的方法。',5,'close',42),(185,'食品物理化学和生物学','本课程对食品的物理，化学和营养特性以及食品科学和技术原理进行全面介绍。 主题包括商品成分的化学功能，影响食品质量的化学，物理和生物学现象；加工和保鲜技术，微生物学和发酵，食品安全，法规等。',7,'close',42),(186,' 疾病和营养学','本课程是对营养学，生物化学，生理学，遗传学，病理学和药理学原理相结合，以了解相关疾病的风险，预防和管理方法。 课程为同学提供了讨论有关营养和健康领域最新热门话题的研究机会。',8,'close',42),(187,'公共卫生与营养学','公共卫生营养学是营养学的职业道路之一，致力于在社区和国家层面上改善人群的饮食习惯和营养状况。 该课程通过描述用于评估人群的营养问题，制定与营养有关的政策以及提供健康，营养和食品援助计划的方法，帮助学生准备从事公共营养工作。',9,'close',42),(188,'艺术和文化理论介绍','本课程旨在让艺术管理专业的学生对艺术史及相关文化背景有一个初步的了解。它以近代和当代为导向，探索艺术史上反映了大众知识，政治和文化的趋势和变化。我们将特别关注在现代主义背景下出现的运动，实践和方法，以及它们如何影响整个时代的艺术和媒体文化。',1,'open',53),(189,'艺术筹款','钱是艺术品生产中的关键要素。表演，展览和节庆的制作都需要有财务基础。因此，艺术管理的一项关键技能就是寻求并确保资金周转，为艺术筹集资金主要分为两大类，即收入（来自门票销售）和筹款活动。本课程涵盖了收入的原则，例如固定成本，可变成本和沉没成本以及定价；以及筹款，涵盖赠款，赞助和慈善事业。',2,'open',53),(190,'视觉文化','视觉文化包括绘画，雕塑，摄影，电视，电影，卡通和漫画，虚拟现实和游戏和互联网等视觉形式。 这些形式已通过各种方法进行了研究：诠释学，形式学，女权主义，符号学和人类学等。本课程要求学生分析当代和历史时期的视觉图像，并应用各种视觉技术和方法，以增强对视觉文化理论的理解，并发展出更丰富的内容。',3,'open',53),(191,'艺术管理原则','本课程的重点将放在艺术领域的项目管理上，学生将获得与文化和艺术活动和项目管理相关的知识，以管理活动策划所需的所有步骤。通过案例研究，学生会讨论以来自不同文化，环境，国家和思想流派在该领域的多样性，包括艺术管理领域的职业道德，多样性，可及性和包容性问题。',4,'open',53),(192,'活动管理','本课程提供活动管理过程的基本知识，重点关注文化和艺术类活动，学生将了解不同类型活动的特殊性，例如音乐会，节日，展览，戏剧表演等。',5,'open',53),(193,'观众理论与实践','本课程重点关注艺术活动中的观众，主题包括想象听众，营销，品牌和公共关系，以及评估研究，包括访谈，焦点小组和理解定量数据。',6,'open',53),(194,'艺术文化政策','本课程涵盖了适用于艺术的“文化政策”中的关键问题，包括有关“文化”含义的辩论，各个国家对术语的理解之间的差异以及有关文化价值观念的辩论。 课程还会比较英国，美国和欧洲的文化政策方法，提供不同的文化政策模型。',7,'open',53),(195,'计算机的介绍','使用个人计算机作为现在和未来解决问题的有效工具。有效使用电子表格来处理、操作和可视化数字和文本信息。介绍互联网、万维网、HTML和XML。网络搜索引擎功能组件的基础算法及其对数据访问的影响。使用维基来发布、重塑和组织数据的协作。',1,'open',30),(196,'计算机编程简介','通过媒体计算介绍计算机编程的基础知识。学生将学习编写交互式图形程序。基本语言概念，例如变量，条件，循环，函数和数组。编程概念，例如编码风格，模块化设计，测试和调试。媒体概念，例如2D图形绘图，输入，动画和图像处理。',2,'open',30),(197,'计算机科学概论','本课程通过在编程的功能样式中应用基本编程模式来介绍计算机科学的基础知识，包括功能定义和应用，通过替换进行跟踪，设计、测试和文档，递归数据定义，列表和树，功能和数据抽象。',3,'open',30),(198,'C语言编程','本课程介绍的概念包括UNIX环境，C开发周期，数据表示，运算符，程序结构，递归，宏，C预处理器，指针和地址，动态内存分配，结构，联合，typedef，位域，指针/结构应用程序，UNIX文件抽象，文件 访问，低级I / O，并发等。',4,'open',30),(199,'算法学','研究在计算机上解决实际问题所需的步骤，包括问题说明，算法范式的选择，分析和实现。主题包括穷举搜索和动态编程方法等。\r\n',5,'open',30),(200,'计算机安全和隐私','计算各个方面的安全性和隐私问题。具体主题包括：比较安全性和隐私，程序安全性，编写安全程序，针对程序威胁的控件，操作系统安全性，形式安全模型，网络安全性，Internet应用程序安全性和隐私性，增强隐私的技术，数据库安全性和隐私性，推理，数据挖掘，安全策略，物理安全，安全经济学以及法律和道德问题。',6,'open',30),(201,'计算机架构','本课程包含的概念有数字逻辑：算术逻辑单元； 数据表示形式：大端和小端整数； 一，二补数算法； ； 冯?诺依曼的体系结构和瓶颈； 指令集； RISC和CISC设计； 指令流水线和档位； 重新排列代码； 内存和地址空间； 物理和虚拟内存；总线架构； 轮询和中断； DMA； 设备编程； 汇编语等概念。',7,'open',30),(202,'商业和金融计算方法','商业和金融数值方法简介。浮点算术，插值。投资组合优化和或有债权估值的方法。非线性方程的解。蒙特卡罗方法，格点方法，对冲策略的模拟。',8,'open',30),(203,'有机化学','本课程会研究基础有机化学的各个方面，包括命名，化学和物理性质，主要的有机化合物类别的反应和合成。 该研究包括理论方面，反应机理，多步合成以及多环和杂环化合物的化学性质。 ',1,'open',28),(204,'化学结构和反应性','本课程会介绍芳族化学，羰基化合物，碳水化合物，胺，羧酸，氨基酸，肽，蛋白质和核酸化学，以及紫外光谱和质谱。',2,'open',28),(205,'无机化学','本课程会探索金属和非金属化学包括物理化学原理的应用。内容包括使用真空管线，研究电化学，高压和其他合成技术来制备无机化合物，以及无机化合物的动力学和机理研究。',3,'open',28),(206,'物理化学','本课程会研究粒子之间的动力，势能和总能量以及它们之间的力； 量子理论的原理，包括单电子和多电子原子，及其在化学键合，分子间相互作用和元素光谱学中的应用。',4,'open',28),(207,'生物物理化学','本课程会研究分子结构，分子间作用力和相互作用，生物分子光谱学，高分辨率结构测定。热力学和动力学概念适用于理解生物分子（蛋白质，DNA和RNA）的化学和结构。 分子分布，反应动力学，酶动力学。 生物能学，能量转导和运动蛋白。 电化学势等。',5,'open',28),(208,'材料化学','本课程会讨论如何将基本化学原理应用于材料发现，设计和表征中。 涵盖的主题将包括无机固体，纳米级材料，聚合物和生物材料，并特别关注原子级相互作用决定物质整体性质的方式。',6,'open',28),(209,'杂环化学','本课程是有机化学的进阶课，重点探索芳族杂环的反应性和合成。 涵盖了吲哚，吡啶，呋喃，吡咯和喹啉的经典和现代方法，以及复杂的多杂原子环系统，包括对药物和生物有机化学的应用。',7,'open',28),(210,'光谱学','本课程概述了光谱学的实验和理论方法，课程主题包括实验方法，辐射和物质相互作用的描述，并从定性和定量方面进行包括将线性和非线性光谱学应用于分子结构的研究。',8,'open',28),(211,'使用R的统计学基础','本课程的目的是确保学生准备好使用RAS统计工具并理解基本的统计概念。涵盖的内容包括:R入门(命令，算术运算符，逻辑运算符、函数）数据结构和类型编写脚本描述性统计数据统计图在R中处理和操作数据集。',1,'open',26),(212,'数字市场分析','课程描述:互联网的出现彻底改变了市场营销。一些传统的营销策略现在已经完全过时了，其他公司在市场营销的策略上已经发生了巨大的的变化。新的数字营销策略不断涌现，这是基于前所未有的大量关于产品的信息，公司和消费者行为的数据做出的决策。互联网正在侵蚀核心商业活动，如新产品设计、广告，营销和销售，创造口碑，新的启动资金，和客户服务。这门课的目标是讨论基于互联网的社交媒体和广告技术所带来的电子商务新商业模式,并分析这些技术和商业模式对行业的影响，公司，还有人。我们将从数据和指标中获得真知灼见，为我们的讨论提供指导，帮助我们进行衡量。要了解企业如何成功利用这些技术，因此，我们将超越技术本身，研究一些关键问题。',2,'open',26),(213,'商业分析入门课程','本课程的主要目的是培养学习和使用软件技术的技能，以支持面向业务的问题解决和决策。具体来说，你将发展能力和数据库软件，并学会通过有效使用协作技术和网络向他人分发信息。案例问题将涵盖会计、金融、市场营销、统计和运营管理。来自多个商学院院系的教授将讨论和数据库软件，并学会通过有效使用协作技术和网络向他人分发信息。案例问题将涵盖会计、财政，市场营销、统计和运营管理。来自商学院多个院系的教授将展示他们的学科使用电子表格解决问题的能力。和数据库软件，并学会通过有效使用协作技术和网络向他人分发信息。案例问题将涵盖会计、财政，市场营销、统计和运营管理。来自商学院多个院系的教授将展示他们的学科使用电子表格解决问题的能力。',3,'open',26),(214,'财务会计原理','本课程探讨会计在向决策者提供企业财务信息方面的作用。课程重点放在从使用者的角度理解财务会计。课程涵盖财务状况的报告、负债、权益账户、经营成果和现金流。',4,'open',26),(215,'商法与商业伦理导论','商法与商业伦理本科导论。主题包括商业道德，契约(其性质和要求，形成、解释、履行和违约以及补救措施）和销售（《统一商法典》、《国际货物销售公约》、所有权转让、担保以及买卖双方的权利和救济）。',5,'open',26),(216,'宏观经济学','宏观经济学又称总体经济学、大经济学。是微观经济学的对称。宏观经济学是现代经济学的一个分支。宏观经济学以整个国民经济为考察对象，研究经济中各有关总量的决定及其变动，以解决失业、通货膨胀、经济波动、国际收支等问题，实现长期稳定的发展。',6,'open',26),(217,'微观经济学','微观经济学又称个体经济学，小经济学，是宏观经济学的对称。微观经济学主要以单个经济单位(单个的生产者、单个的消费者、单个市场的经济活动)作为研究对象，分析单个生产者如何将有限的资源分配在各种商品的生产上以取得最大的利润；单个消费者如何将有限的收入分配在各种商品的消费上以获得最大的满足。同时，微观经济学还分析单个生产者的产量、成本、使用的生产要素数量和利润如何确定；生产要素供应者的收入如何决定；单个商品的效用、供给量、需求量和价格如何确定等等。',6,'open',26),(218,'人力资源管理','人力资源管理战略作用的基础研究。目标是应用人类行为知识，劳动关系和现行法律法规对工作环境的影响。主题包括就业法律法规，全球经济中的多样性，全面薪酬管理，以及培训和发展促进组织成功。',1,'open',52),(219,'基础金融','在本课程中，学生将接触到金融领域的许多不同分支。 学习如何确定哪些项目具有最大的潜在收益，如何管理投资甚至评估股票，了解什么是货币的时间价值，财务比率分析，资本预算分析，资本结构和成本，财务报表，现金流量，股票和债券，和长期融资，并将这些概念和技能应用于业务决策中。',2,'open',52),(220,'宏观经济学','在本课程中，学生会研究国家的经济运作方式，同时了解如何维持一个国家人民的生活水平，以及如何从经济和社会福利的角度做出最佳选择。 认识关于政策作用下包括家庭，消费者，储蓄者，公司所有者，投资者，政府官员和全球贸易伙伴这些决策是如何相互影响和依存的。',3,'open',52),(221,'微观经济学','在本课程中，您将获得从经济角度分析现实商业世界所需的知识和工具。 经济学研究的核心是处理我们为管理稀缺资源而做出的决策。 微观经济学是经济学的一个分支，涉及在个人层面上做出的决策，例如，个人消费者和公司在如何评估资源和成本之后做出选择。',4,'open',52),(222,'统计学','课程将学习统计在商业和工作场所中的应用。 统计是我们收集，分析和解释数据的方式。 在这个信息时代，数据很多。 如何在复杂的数据集中提取有用的知识并获得正确的理解已经成为一个挑战。我们将使用统计工具来分析数据，得出结论并预测未来。 该课程将从数据分布开始，然后进行概率分析，抽样，假设检验，推论统计和回归统计。',5,'open',52),(223,'会计学','本课程将学习什么是财务会计，了解如何以标准格式记录财务信息可以使经理，投资者，贷方，利益相关者和监管者做出适当的决定。 在本课程中，我们将查看损益表，资产负债表，现金流量表和股东权益表。 学生将学习如何制作和分析这些财务报表，确定公司的价值以及将公司与竞争对手进行比较。',6,'open',52),(224,'市场营销','在本课程中，学生将了解营销流程，并了解企业或组织销售其产品和服务而必须做出的一系列营销决策。 学生还将学习如何像销售人员那样思考，认识营销的重点始终是消费者。 学生将思考商品和服务的消费者是谁，消费者的需求点在哪。 营销的本质就是如何与消费者沟，其特征有四点：创建为消费者服务的产品和服务，传达明确的价值主张，以最优价值交付产品，和交换（或交易） 这些产品的价值。',7,'open',52),(225,'商业法','本课程将介绍企业的管理者在开展业务过程中必须遵守的法律和道德标准。 法律和道德几乎总是影响着公司的决策过程，例如：银行不能想收多少利率就收多少，这个利率必须合理。 汽车制造商为了符合减少污染的法规，必须安装特定的硬件并开发新技术。 在本课程结束时，学生将对企业运营的法律和道德环境有清晰的了解。',9,'open',52),(226,'组织行为学','作为一门管理专业课程。课堂内容包含了组织的概念，动机，领导能力，有效管理组织所涉及的群体、个性、组织发展战略和其他行为方面等主题。',10,'open',52),(227,'供应链模型以及分析','本课程将向学生介绍现代供应链中的管理决策问题，并将开发结构化的数学工具来建模和解决这些问题。学生们还将通过解决问题的练习、电子表格和基于电子表格的案例研究来学习如何应用这些工具。',11,'open',52),(228,'新闻学导论','本课程将回顾新闻的历史和社会理论，并向学生介绍当代新闻学。学生将学习新闻的功能和作用，以及对全球沟通交流的影响。本课程也涵盖了新闻业与广告、公共关系和电信的关系，尤其是针对新时代传媒的一些探讨。',1,'open',40),(229,'大众传媒写作','介绍媒体写作的概念与技巧。本课程为印刷、广播和线上媒体的信息收集、组织和写作提供实践指导。',2,'open',40),(230,'新闻报道','旨在培养信息收集、新闻判断、组织和写作技能的课程。学生将学习报道突发新闻和撰写特写。',3,'open',40),(231,'广播电视新闻报道','广播写作与报道原理概论。学生们还将学习拍摄和编辑录像带以及准备电视新闻报道。',4,'open',40),(232,'新闻编辑','本课程主要教授新闻判断、新闻写作、基本报道与编辑、专题写作、法律与伦理等核心技能，以及报道不同社区的新闻。\r\n本课程的重点是基本的新闻报道和写作技能，你会发现在任何新闻事业中都是必要的。掌握这些技能的唯一方法是通过实践，所以这学期你会写很多东西。',5,'open',40),(233,'多模态新闻','你将通过寻找、制作和编辑原创故事来发展你在相关写作题材方面的能力。你还将提高你在新闻研究方面的技能，采访和讲故事。你将把这些能力应用于印刷、广播、网络、移动和新兴技术等多个平台的新闻采集和发布，并有机会根据需要进行专业化分工。',6,'open',40),(234,'调查技巧','本课程旨在培训您培养对新闻和通信行业至关重要的研究/调查技能。因此，它介绍了关键的研究技术和方法的核心学术和专业实践内和整个行业。',7,'open',40),(235,'考古学方法','本课程探索与调查考古遗址和物品有关的方法研究问题，以及考古学家的目的和技术手段，包括：遗址的定位和挖掘；地点和物品的年代测定；文物和技术的分析以及对古人、植物和动物的研究；如何运用这些方法来回答本学科更大的研究问题。',1,'open',19),(236,'人体骨骼的社会研究','骨骼的主要功能是支持和保护人体，除此之外，一个人死亡后它们还扮演了一系列的社会角色。本课程在人类骨骼解剖学入门课程的基础上，增加了人类在死亡后如何对待其他人类的社会动态。它借鉴了人类学、生物学和考古学的研究，通过案例为学生提供与人体有关的社会生活的概述。',2,'open',19),(237,'动物考古学','无论是历史上的还是史前的，动物骨骼往往是考古遗址中最常见的东西。作为生物考古学样本，它们为考古学家提供了对饮食文化、供应、贸易和人类与动物互动社会方面的深入了解。该课程将带领学生了解一系列物种的骨骼解剖学，指导学生识别动物的不同部位，如何判断年龄/性别，以及认识这些指标的意义。',3,'open',19),(238,'食物考古学','本课程从考古学的角度探讨人类历史中关于食物的许多方面。我们将讨论农业的起源如何帮助人类社会的改变，食物如何在社会等级的出现和文明的发展中发挥突出作用，以及各种食物方式如何影响特定的文化。我们还将进行实验研究，以了解一些食物的采购、准备和消费方法如何在考古学上得到恢复。',4,'open',19),(239,'考古学实地调查方法','本课程介绍考古学家的基本制图技能和地理信息系统工具，包括GIS工具、GPS仪器和地球物理技术的介绍。',5,'open',19),(240,'考古植物学','本课程是通过考古学记录研究植物和人类的相互关系。内容包括对考古植物学知识的理解，和学习考古植物学数据，考古植物学遗存研究的主导方法：植物宏观遗存、花粉、植物石和淀粉粒在饮食和环境重建中的鉴定等。',6,'open',19),(241,'考古学中的数字技术','考古学家长期以来一直在调整现有的技术工具，并将其纳入其工具箱。近年来设备的计算能力爆炸性增长导致了考古学中技术仪器的进化，并在学科内引发了一系列新的理论和方法。本课程概述了考古学家在研究的各个阶段所使用的技术工具和方法。',7,'open',19),(242,'设计考古学','本课程通过研究史前手斧、埃及金字塔、古希腊香水罐、中世纪城堡、Wedgewood茶壶、爱迪生电灯泡、电脑鼠标、索尼随身听、超音速飞机和宝马迷你车的设计，将科学、技术、社会和文化联系起来。跨学科视角包括考古学、文化人类学、科学研究、技术史和社会学、认知科学和进化心理学。',8,'open',19),(243,'城市考古学','城市是人类景观中变化最快的部分，正在挑战我们与自然的关系。我们将通过追踪古代近东城邦和古希腊罗马的生活质量谱系，并参考印度河流域和美洲的史前建筑环境和城市，来解读这些主题。这门课对城市设计采取明确的以人为本的观点，强调长期的过程。',9,'open',19),(244,'世界古代史','本课程研究从公元前一千年到公元900年在东半球四个地区出现的 \"世界帝国\" 。内容将研究城市的关键作用、统治者的重要性、不同民族的融合，以及在其崩溃后的国家如何通过将模仿已消失的帝国与制定新的 \"世界宗教 \"相结合，构成新的世界秩序。',1,'open',15),(245,'世界近代史','本课程主题包括早期的全球化和跨文化交流，世界不同地区的多样化文化形态；帝国和国家的增长和互动；资本主义的兴起和 \"西方 \"的经济分化；技术性质的变化，包括军事和信息技术；思想和人员的迁移(包括奴隶贸易)；疾病、气候和环境的变化。',2,'open',15),(246,'世界现代史','本课程将讨论在现代时期，帝国和民族国家是如何在全球范围内演变的？它们是如何塑造全球现代性的？又如何才能写出一部整个世界的历史，既能覆盖必要的领域，又能保留细微和复杂性？在这门课中，我们将使用图画和小说的形式（搭配档案资料和历史论文）来研究从18世纪到21世纪的世界现代史，从帝国和革命时代，到世界大战、冷战和反恐战争。',3,'open',15),(247,'科学史','科学史往往是更大的历史领域中关键争论的核心，包括关于客观性和偏见、相对主义和 \"现在主义 \"问题的辩论。本课程探讨科学史中的关键问题、方法和辩论，并研究科学历史家如何解决这些问题。',4,'open',15),(248,'经济史','本课程介绍了经济史的主要方法，如古典学派、马尔萨斯主义、马克思主义和依赖理论、道德经济批判、制度主义、技术决定论、环境主义和人类世论。利用这些方法，学生将探讨的主题包括：前现代农业秩序；财政-军事国家的出现；金融和商业扩张；多样化的财产制度；工业革命；增长与贫困；市场与网络；劳动与资本；资本主义与帝国主义的兴起；移民；正规经济与非正规经济；发展与不发达；全球化与环境危机。',5,'open',15),(249,'口述历史','学生探索基于口述历史的典范历史作品，并完成自己的采访。主题包括口述历史和叙事理论、采访技巧、笔录准备和数字存档。学生还将学习如何使用定性和定量方法分析访谈，练习使用口述证据撰写历史，并尝试使用数字人文方法传播口述历史。',6,'open',15),(250,'人体解剖学和生理学','本课程详细介绍人体的结构和功能以及用于维持体内平衡的机制，介绍人体解剖学和生理学。  内容包括解剖学，细胞，组织，外皮，呼吸道，骨骼，肌肉，消化系统，神经系统，心血管系统，泌尿系统和生殖系统。 ',1,'open',7),(251,'制药科学中的生物化学','本课程的目标是提高学生对生物医学的理解，包括学习热动力学的基本原理及其在化学过程中的作用；分子生物学，生物化学，免疫学和药物基因组学的相关性，并将关键原理应用于疾病状态和治疗方法。',2,'open',7),(252,'免疫学','本课程介绍免疫学的基本原理，了解免疫系统疾病的原因以及免疫预防和免疫疗法的基础，并提供足够的信息了解基因疗法及其应用的原理，包括基因组学对未来药物开发的影响。',3,'open',7),(253,'病理生理学和药物作用原理','本课程介绍药物的治疗用途和不良反应所必需了解的病理生理学，药效学，毒理学和药物化学的基本原理。 本课程将整合和应用科学课程的概念，包括有机化学，生物化学，解剖学和生理学，以理解疾病过程，毒理学和药物作用的基本原理。 ',4,'open',7),(254,'综合药物治疗','本课程将涉及病理生理学，药物化学，药理学，药代动力学/药物学和药物治疗学的综合方法：液体/电解质药物治疗，肾脏疾病，酸/碱紊乱，临床营养，自主神经系统（ ANS），肺部疾病，血液学，免疫学和风湿病学。 同样在完成学习目标的过程中，将介绍药剂师角色以及回答患者相关问题的方法。',5,'open',7),(255,'药物剂型','本课程首先介绍药物在水和脂质中的溶解度的分子概念，与药物剂型有关的药代动力学原理，赋形剂或制造过程影响生物利用度的机制以及应用于剂型保质期的化学动力学。 然后将药理学原理应用于更复杂的液体剂型：溶液剂，乳剂和混悬剂。 涵盖了制备剂型所需的赋形剂：缓冲剂，防腐剂，乳化剂，助悬剂，湿润剂等，以及在配制和生产环境下制备每种剂型的方法。',6,'open',7),(256,'药代动力学原理','本课程介绍药代动力学和生物药物学的理论和概念。 学生将掌握从浓度-时间数据或尿液排泄-时间数据量化药物吸收，分布和消除的专业知识，以估算主要药代动力学参数。',7,'open',7),(257,'药物基因组学原理','个性化治疗有望在未来几十年中实现药物治疗的改革。 目前，药物基因组学知识已在临床实践中得到了越来越多的应用。 本课程旨在向学生介绍有关药物基因组学和个性化医学的理论和概念的新知识，',8,'open',7),(258,'患者安全与信息学','本课程内容包括了解患者安全数据隐私和安全的情况，流行病学和文化。 案例研究将解决药物错误的披露并报告不良事件。 将解释信息学工具，如电子病历系统，健康信息交换和决策支持，强调使用信息学工具来提高患者安全性。',9,'open',7),(259,'公共卫生药学',' 本课程旨在为药学专业的学生提供有关公共卫生以及与自我健康保护和非处方产品相关的全面概述，让患者在健康方面扮演积极角色并有效促进疾病预防、检测和治疗。',10,'open',7),(260,'希腊哲学','本课程将介绍希腊哲学思想的主要发展，重点是柏拉图，亚里士多德和希腊化流派（伊壁鸠鲁派，斯多葛派和怀疑论派）。主题包括认识论，元逻辑，心理学，伦理学和政治理论。',1,'open',55),(261,'数理逻辑','本课程介绍数理逻辑中使用的概念和技术，重点是命题、模态和谓词逻辑，及其与哲学、数学、计算机科学、语言学和邻近领域的联系。',2,'open',55),(262,'元逻辑','本课程介绍句子和一阶逻辑的语法和语义；模型理论的概念；哥德尔的完备性定理及其结果；L?wenheim-Skolem定理和紧致性定理等。',3,'open',55),(263,'调查的形式方法论','本课程涵盖了命题和基本谓词逻辑、概率和决策论、博弈论和统计学的基础知识，突出哲学问题和应用。具体内容包括命题逻辑和谓词逻辑的语言及其解释、概率公理的合理性论证、纳什均衡和优势推理、统计意义检验的意义等概念。',4,'open',55),(264,'现代哲学','本课程研究早期现代哲学的主要人物在认识论，元逻辑和心灵哲学方面，以及研究笛卡尔，莱布尼兹，休姆和康德的著作。',5,'open',55),(265,'科学哲学导论','本课程向学生介绍科学哲学分析的工具，将涵盖观察、实验和推理中的问题，关于科学的目的、科学变革以及科学与价值观之间的关系等问题。',6,'open',55),(266,'哲学与科学革命','本课程内容包含关于伽利略对哥白尼世界体系的辩护从而引发了17世纪的科学革命，导致了科学与宗教的冲突，并影响了现代哲学的发展。阅读的重点是伽利略和笛卡尔。',7,'open',55),(267,'中世纪哲学概论','本课程是对中世纪道德哲学的简要介绍。 除了道德领域的教义之外，我们还将研究形而上学，宗教哲学和人性哲学 。',8,'open',55),(268,'有机化学','本课程是关于有机化学的概论，内容包括了解有机分子的结构和反应性， 重点讨论取代和消除反应以及羰基的化学反应，芳族化合物的简介等等。',1,'open',47),(269,'热力学','本课程会讨论基本热力学，包括系统状态，状态变量，热力学第一定律，热化学。 热力学第二定律和第三定律：熵和自由能，包括这些热力学函数的分子基础。 特别关注全球能源问题和生物系统有关的热力学。',2,'open',47),(270,'化学工程介绍','本课程通过实例来探索化学工程的各种应用，内容包含学习计算机技能并熟悉工程设计的要素，并将提高质量和节能的基本概念应用于涉及化学和生物应用的解决方案中。 ',3,'open',47),(271,'微分方程','本课程会研究微分方程，包括对物理系统进行建模。 通过分析，图形和数值方法求解一阶ODE。 具有恒定系数的线性ODE。 复数和指数。 非齐次方程：多项式，正弦和指数输入。 振荡，阻尼，共振。 傅立叶级数。 矩阵，特征值，特征向量，对角化等。',4,'open',47),(272,'流体力学','本课程会介绍控制流体流动的机械原理。 液体中的压力； 使用微分和积分平衡保持质量和动量；基本本构方程；静水压力；Navier-Stokes方程的精确解；使用控制量分析解决方案；机械能平衡和伯努利方程；尺寸分析和动态相似性；介绍边界层理论和湍流。',5,'open',47),(273,'传导过程','本课程会研究传热传质原理。 包括稳定和瞬态的传导和扩散；辐射热传递；层流和湍流中热量和质量的对流传输；着重解决具有实际工程意义的传热和传质问题的能力。',6,'open',47),(274,'无机化学','介绍了化学键和分子结构的原理，及其在周期系统中代表性元素的化学反应中的应用。',7,'open',47),(275,'人体解剖和生理学','本课程会对人体的结构和功能进行介绍，包括骨骼，肌肉，神经，呼吸系统，消化系统和生殖泌尿系统等。 实验室包括检查心血管，呼吸系统，神经系统和消化功能以及综合评估数据的分析。',1,'open',38),(276,'运动表现的科学基础','本课程概述了人类运动的科学原理。 涵盖的主题包括与训练，调节和营养有关的运动生理原理； 运动学习和发展的原则； 对人体运动的定性分析； 和神经肌肉适应训练等。',2,'open',38),(277,'运动机能开发和学习','本课程描述并分析从发育到成年过程中，人体运动机能是如何发展的。 内容还将涵盖优化运动机能相关的原理和概念，以及了解运动环境和生物因素之间的相互作用。',3,'open',38),(278,'教练基础','本课程探讨了当一名教练的基础，包括技能，战术和策略以及教练所需的教学和管理知识。 案例研究，体验练习和团队项目是课程学习过程中的重点内容。',4,'open',38),(279,'运动员伤害预防和康复','本课程包含对运动员常见的伤害的预防，评估，治疗和康复的基础概念进行研究，内容将包括实践和实验室学习。',5,'open',38),(280,'运动心理学','该课程将研究社会心理因素如何影响体育活动的参与，以加深对理解为什么某些人开始并保持积极的生活方式而另一些人却不这样做。 学生将获得理论模型的知识并阅读研究成果。',6,'open',38),(281,'运动生理学','本课程研究体育锻炼对人体器官系统功能的影响。 重点放在人类对急性和慢性体育锻炼的代谢，循环和神经肌肉适应上。 ',7,'open',38),(282,'神经科学和运动控制','本课程研究神经系统的结构和功能及其与行为的关系，重点是人类运动行为。 探讨例如感觉，知觉，运动的组织，反射，自发运动以及平衡/姿势等内容。',8,'open',38),(283,'神经肌肉适应训练','研究与制定和实施抵抗力和柔韧性训练计划相关的原理。 重点是检查柔韧性训练相关的神经，肌肉和骨骼适应。 ',9,'open',38),(284,'合同法','合同是另一门课程，你将有一个或两个完整的学期。这一切都是关于交易的艺术。在许多不同的话题中，你会学到什么时候形成了一个有效的合同，以及如果一个合同被违反会发生什么。',1,'open',9),(285,'民事诉讼程序','民事诉讼程序（CivPro）是一般会有一个或甚至两个学期的学习。它讲述了如何在联邦法院提起诉讼的基本知识，联邦法院何时有权审理案件，在何处提起诉讼等。在实践中和参加律师考试时都很有帮助。.就课程内容而言，它有些枯燥，但一些律师表示，这是最重要的课程之一，真正帮助他们成为执业律师。',2,'open',9),(286,'侵权','侵权是一门非常有趣的课！这一般是法学院的第一学期课程。很多人走进法学院都不知道什么是\"侵权\"，但这并不复杂。侵权是一种类似于殴打、攻击、侵入或疏忽的索赔。在法学院侵权是大多数法律学生最喜欢的课程。',3,'open',9),(287,'不动产权','对于绝大多数人来说法学院最重要的课程就是法学院课程的不动产。对于学生来说，这门课（还有合同）往往是最难的课程之一。你会学到所有关于财产的知识财产的所有权，使用他人土地的权利，相反占有、地役权、现在和将来的利益以及许多其他概念。注:有少数法学院（如密歇根大学法学院）不需要这门课，总的来说，大多数法学院都要求这门课。',4,'open',9),(288,'刑法','大部分学生在一年级修读一学期的刑法课程。对许多学生来说，刑事法是一门有趣的课程（尽管你可能必须学习两套法律：普通法和示范刑法典）。刑法告诉你什么是犯罪的代价，并详细涵盖了像谋杀这样的犯罪。',5,'open',9),(289,'法律研究与写作','这是你在法学院的第一年将要学习的课程之一。对于法学院的学生来说，这是一门相对较新的课程。你可能会被要求写一篇论文和一篇简报，学习研究的基本知识，也许还会向一组志愿者评委进行口头辩论。大多数执业律师说，这是他们在法学院最有用的课程。',6,'open',9),(290,'运筹学-随机模型','本课程研究运筹学中的概率模型，内容包括马尔可夫链，泊松过程及其在排队系统中的应用。',1,'open',45),(291,'运筹学-工程优化','本课程主要研究包括使用网络和图形进行建模； 线性，非线性和整数编程； 使用现代建模语言构建模型； 以及其他建模方法的介绍。',2,'open',45),(292,'工程经济学','本课程会介绍工程学中的经济分析方法，包括金钱和时间的关系，等值，价值的经济计量，替代品的选择规则，所得税和设备折旧，通货膨胀和不确定性对工业带来的影响。',3,'open',45),(293,'工程概率学','本课程会研究工程学中的概率，条件概率，密度和分布函数，期望，条件期望，大数定律和中心极限定理等概念',4,'open',45),(294,'制造业流程','本课程会介绍制造业的各种制造工艺； 金属切削，磨削和金属成型操作，机床以及工具和工装。 非传统加工和焊接。 介绍计算机辅助制造系统和计算机辅助图形与设计软件，N / C编程，机器人和柔性制造系统等等。',5,'open',45),(295,'生产系统','本课程会探索集成生产系统的设计和操作控制中的基本概念。 包括有关设施布局和物料搬运，物料流和信息流，资源和产能计划以及车间控制和调度的话题。 ',6,'open',45),(296,'供应链模型','本课程的目的是了解从需求到产品或服务的工作流程，影响流程效率的参数和决策，一些基本模型以及可用于产品设计和运营的一些流程工具。 ',7,'open',45),(297,'统计学应用','本课程会介绍概率分布，点估计，置信区间，假设检验，线性回归和方差分析等内容。',8,'open',45),(298,'约束编程','本课程是对约束编程的介绍，从其建模语言到其计算方法，以及关于它的应用到调度，路由和资源分配方法等。',9,'open',45),(299,'电气与计算机工程导论','本课程旨在为学生提供电气和计算机工程的介绍。其目的是提供各子领域的一些历史背景。',1,'open',46),(300,'计算机工程基础','本课程涵盖了电气和计算机工程师需要了解的基本概念和应用。本课程从电荷、电流、电压的基本概念开始，以及它们在电阻和电阻电路方面的表达方式。随后讨论直流(DC)、一阶和交流(AC)电路的基本概念、器件、定理和应用。除了电子器件和电路外，还讨论了二极管和晶体管等基本电子元件及其主要应用。',2,'open',46),(301,'电子测量技术','通过实验仪器实验。电压、电流、阻抗、频率和波形测量。频率和瞬态响应。电路建模和设计的要素。',3,'open',46),(302,'数据科学中的Python编程','本课程将通过数据科学问题向学生介绍Python编程。学生将学习Python概念以及数据科学的入门主题，并将利用他们的Python知识（和之前的编程经验）来实现数据分析。',4,'open',46),(303,'电子电路分析与设计','二极管、双极型晶体管和FET电路模型，用于电子电路的设计和分析。单级和多级分析与设计；数字电路介绍。计算机辅助设计计算，放大器工作点设计，单级和多级放大器的频率响应。强调高频和低频设计。',5,'open',46),(304,'数字系统设计简介','介绍数字系统设计，重点介绍实用的设计技术和电路放置方法。',6,'open',46),(305,'战略传播写作','学习有效的写作策略，代表各类公司组织在专业社区内推销、规划和交付内容。通过数字平台发布的内容丰富的营销策略传播。',1,'open',33),(306,'新闻报道','指导和练习报道和撰写基本的新闻报道。重视风格，明确、准确、负责地处理新闻。',2,'open',33),(307,'媒体与社会','大众传媒的历史、经济、法律和技术影响。媒体内的专业实践，以及广告、公共关系和国际传播的流动。',3,'open',33),(308,'战略传播原则','广告和公共关系的发展和现状。创意、规划和管理策略。法律和道德问题。',4,'open',33),(309,'公共关系原理','营利和非营利组织的公共关系； 职业发展、道德和法律责任、职业机会；公共关系和管理之间的关系，包括战略规划。',5,'open',33),(310,'传播理论','概念包括大众传媒对社会的功能和影响、说服力、对大众传媒内容的影响、人际/组织沟通。',6,'open',33),(311,'传播研究','大众媒体、广告和公共关系中使用的方法、技术和研究设计；管理部门利用形成性、信息性和评估性研究来支持决策。',7,'open',33),(312,'战略性运动管理','广告和公共关系的高级课程。为企业等不同机构设计和开发战略传播活动的团队项目。',8,'open',33),(313,'初等数学，代数，函数和图形','本课程详细深入地讲述了操纵代数、函数和图形介绍，包括线性、二次函数和有理函数等概念。',1,'open',29),(314,'解析几何和三角学','本课程详细分析解析几何，包括圆锥截面以及指数函数和对数函数等概念。',2,'open',29),(315,'线性代数简介','本课程介绍线性代数的基本概念。包括矩阵、行列式、线性方程组、向量空间、线性变换和特征值等其他概念。',3,'open',29),(316,'现代世界的基本数学技能','每个人在处理、评估和理解我们社会中的数字和图形信息时都需要了解的数学主题。数学在解决财务问题、概率、统计、几何、人口增长中的应用。',4,'open',29),(317,'基本统计','描述性统计，概率论的要素以及统计推断的基本概念。主题包括频率分布，中心趋势和离散度的度量，常见分布（二项式，正态等），估计和假设检验。',5,'open',29),(318,'统计简介','本课程介绍概率、随机变量、二项式和正态分布、中心极限定理、假设检验和简单线性回归的基础等概念。',6,'open',29),(319,'数学的基本概念','本课程的目的是帮助学生学习严格的数学语言。学生将学习如何阅读，理解，设计和交流数学陈述的证明。将强调许多证明技术（对立，矛盾，尤其是归纳法）。讨论的主题包括集合论（集合的无穷大和梯度的Cantor大小概念，集合之间的映射，等价关系，集合的划分），基本逻辑（真值表，否定，量词）和数论（可除性，欧几里得算法） 等。',7,'open',29),(320,'数学写作','本课程将向学生介绍数学写作，包括技术写作和其他方面。所有任务都将使用离线和在线编辑器使用LaTeX完成。在学期末，学生应该能够通过写作清楚地传达数学思想，并为特定的听众量身定做。学生还将学习有关LaTeX离线和在线编辑器，文件共享和版本控制（GitHub）的信息。',8,'open',29),(321,'复杂变量','本课程包含复数、复变量的函数及其导数（Cauchy-Riemann方程）、谐波功能、轮廓积分和柯西积分公式、Liouville定理、最大模量定理和代数基本定理、泰勒和洛朗系列、孤立奇点的分类、论证原理和Rouche定理、通过残差评估不正确的积分等概念。',9,'open',29),(322,'数学建模','本课程学习如何建立，使用和批判数学模型。在建模中，我们将科学问题翻译成数学语言，从而解释正在研究的科学现象。模型可以是简单的也可以是非常复杂的，易于理解或极难分析。课程还会介绍来自不同科学领域的一些经典模型，它们是所有模型的原型。',10,'open',29),(323,'金融数学入门','利率和贴现率理论；年金和偿还资金，以及在抵押和债券问题上的实际应用。',1,'open',10),(324,'金融数学概论','本课程学习利率和贴现率理论包括利率和贴现力的理论连续情况；年金和沉没资金在理论上的应用；抵押和债券；收益率等概念。',2,'open',10),(325,'意外事件','本课程研究未来寿命的一些随机变量，概率和生存函数，死亡率的研究和如何设计生命期望模型。Makeham和Gompertz死亡率定律；人口和保险寿命表的特征；人寿保险支付和年金支付：现值随机变量；预期现值；精算符号。未来损失随机变量的现值以及净案例和毛案例的分布；等价原理；投资组合百分比原则等概念。',3,'open',10),(326,'商业与社会科学分析','本课程通过函数方法将数学应用于社会科学和商业，基本函数的应用，基本函数的微分和积分计算以及微积分的应用。',4,'open',10),(327,'微积分','本课程探索绝对值和不等式；序列及其限制；数列的简介，功能和连续性的限制；中间值定理和方程的近似解；导数、线性逼近和牛顿法则；均值定理和误差范围；平均值定理；泰勒多项式和泰勒定理的大O表示法的应用。',5,'open',10),(328,'企业融资','本课程主题包括金钱的时间价值、资本预算、资本成本、证券发行、资本结构、支出政策和股息、短期融资以及风险管理。在适当的情况下，将从数学和定量角度出发进行研究。\r\n',6,'open',10),(329,'投资概论','本课程研究资本市场概论、股权和固定收益投资分析、衍生证券介绍，包括期货、远期、掉期和期权。',7,'open',10),(330,'金融模型','数学在金融上的应用很多都是通过模型来实现的，通过数学工具，我们可以更准确的模拟出一个投资或资产组合将来或在不同的经济环境中的变化，从而帮助决策层更准确，更快的下决定。金融模型专业的学习包括，Linear Modeling， Stochastic Calculus， Dynamic Control， Monte Carlo simulation 等课程，因此对学生在本科学习中对基础数学的掌握要比较扎实。',1,'open',27),(331,'金融信息分析','信息分析在金融方向的应用主要包括，工业分析，时间序列分析，和基础分析。对于金融数学的学生，学习的内容主要是通过统计和数学的手段进行前两者的分析。因此，这一类的学习/研方向要求学生有扎实的统计学基础，或者工程基础。',2,'open',27),(332,'金融市场','学生们将学习资产负债表的介绍，损益表和现金流量表，以及金融市场概况，货币和银行体系。',3,'open',27),(333,'金融计算','金融计算将继续使用更高级的Python研究在定量金融领域的应用。',4,'open',27),(334,'金融数据科学','这是从原始金融数据中提取有用信息的两门课程中的第一门。重点放在数据勘探和挖掘的工具，由现代金融数据集处理的动机。主题包括数据清理、数据可视化、线性回归、非参数平滑技术和无监督学习。使用Python编程语言讲授方法。',5,'open',27),(335,'固定收益','本课程介绍在固定收入市场交易的最重要的证券，以及用来为它们定价的估值模型。将解释国库券和国库券、债券、可赎回债券,抵押贷款支持证券，和诸如互换等衍生证券和债券期权。本课程将解释基本概念，如收益率与远期利率的关系、期限、凸度、以及收益率曲线动态的因素模型。',6,'open',27),(336,'投资学','投资学为学生提供了量化投资组合管理和理解市场价格决定的基础。主要概念包括风险度量、风险回报权衡、投资组合优化、基准设定、均衡资产定价、市场效率和定价异常。具体的投资组合管理工具包括均值-方差优化、CAPM和APT资产定价、因子模型(e.G.,Fama-French）、动量策略、和绩效评估。本课程将介绍基本的理论和公式，还将回顾有关股票、债券和商品市场的重要制度和经验事实。',7,'open',27),(337,'商业沟通与交流','世界顶级金融机构需要最好的沟通者。优秀的沟通者通过不断的实践和技艺来发展他们的技能。商务沟通侧重于面试，人际关系拓展，非语言沟通，与上下级沟通，以及影响各种商务沟通的文化影响。该课程让学生沉浸在拓展人际渠道和面试中，相互影响，模拟面试，和同行审查。',8,'open',27),(338,'期权','期权课程的目标是开发工具来定价和对冲，并了解对任何基础变量的任何或有债权的风险敞口。所考虑的期权类型包括交易所交易的看涨和看跌期权、OTC奇异期权、利率期权,挥发性衍生物，公司证券，如可赎回债券和认股权证，以及发电厂和矿山等\"实物期权\"。研究的期权定价技术包括二项式期权定价，Black-Scholes，Hull和White，以及被称为风险中性估值的期权定价超级理论等。',9,'open',27),(339,'多期资产定价','本课程涵盖了多期金融模型衍生证券的无套利定价理论。议题清单包括:1。套购和复制。风险中性测度与鞅。4.状态和马尔可夫过程。美式期权与最优停止。反向归纳法。',10,'open',27),(340,'可持续畜牧业','本课程将探索家畜的作用以及它们与人类相互依存的重要性；了解家畜的范围和多样性；主题包括驯化、可持续性、伴侣动物、绵羊、山羊、猪、肉牛、乳牛、营养学、遗传学、放牧、乳制品、家禽、马和役用动物、毒理学和实验动物等。',1,'open',8),(341,'动物营养学','介绍动物营养学，包括家畜和其他物种的消化生理和代谢，动物不同方面的营养需求，饲料和日粮配制原则。实验课包括胃肠道解剖和对实验室或农场动物物种进行的营养实验。',2,'open',8),(342,'动物基因原理','本课程主要研究动物的遗传基础和改良。基础细胞生物学和DNA复制将为理解性状的遗传机制、现代基因组工具的开发和分析方法奠定基础。软件和相关程序将用于研究动物基因和基因组，通过DNA序列或全基因组标记面板研究个体基因型，以及性状和遗传标记之间的统计关联，以了解遗传学的复杂性和基因组研究对动物改良和管理的前景。',3,'open',8),(343,'动物繁殖和发育','本课程针对哺乳动物和禽类生殖进行比较解剖学和生理学研究，重点研究对象是家畜和实验动物；学习内容包括受精到胚胎发育、妊娠、生长到性成熟；强调生理机制和在生育调节中的应用。',4,'open',8),(344,'动物福祉','本课程会讨论动物福祉问题，主要是针对农场动物，但也会探索伴侣动物。',5,'open',8),(345,'鱼类生理学','鱼类生理学是对鱼类的生物学介绍。主题将涵盖生理系统内的细胞和组织功能，这些系统帮助鱼类在广泛的水生栖息地（从山涧到深海喷口）茁壮成长。同时也将对鱼类和高等脊椎动物进行更广泛的比较。课堂讨论将结合水产养殖、渔业和环境背景，包括当今鱼类所面临的一些人为挑战，以及如何缓解这些问题。',6,'open',8),(346,'哺乳动物繁殖比较 ','比较哺乳动物物种之间的繁殖模式和生理学。重点将是哺乳动物之间的多样性所带来的成功繁殖的独特生理机制。将探讨环境对生殖周期的影响和限制。研究范围从单体动物到灵长类、实验室动物、野生物种、季节性繁殖动物和冬眠动物。',7,'open',8),(347,' 肉类','肉和肉制品的生物学和生产制造。本课程的重点是肌肉、骨骼和其他组织的结构和功能，因为这与将动物转化为肉类的过程有关，包括生长和发育、肌肉组成、新鲜和加工肉的特性、微生物学、保存、营养价值、检验和卫生。实验室将包括解剖学、肉-动物屠宰、肉类切割、批发和零售切割识别、检查、分级和烹饪。',8,'open',8),(348,'动物健康和疾病中的免疫学 ','涵盖了免疫学的一些概念，重点是那些对家畜健康和疾病预防的概念。学生学习如何应用他们的免疫学原理知识来理解当前的文献、研究和实践。',9,'open',8),(349,'基本统计和数据分析','无论是民意调查，失业率，男女工资差异，疫苗效力还是消费者网络数据，我们都需要能够将有用和无用的信息分开。我们将学习用于分析和解释来自各种来源的数据的统计方法。本课程的目标是帮助您得出结论并根据数据做出明智的决策。',1,'open',31),(350,'社会科学概论','本课程将涵盖现代统计分析的基础知识，以期在社会科学和科学中应用。主题包括探索性数据分析，概率论的要素，基本统计推断以及统计建模入门。本课程侧重于应用统计工具来解决问题，做出决策以及使用统计思维来理解世界。',2,'open',31),(351,'统计和数据分析','可以将统计数据视为将数据转化为信息的艺术和科学。无论是商业还是科学领域，现实世界中的决策通常都是基于数据及其包含的感知信息。当夏洛克福尔摩斯询问华生医生案情时，他突然说道：“数据，数据，数据！没有粘土我就不能做砖。”?在本课程中，我们将研究统计学家尝试从数据中提取信息的基本方法。这些将包括许多统计推断的标准工具，例如假设检验，置信区间和线性回归，以及探索性和图形数据分析技术。',3,'open',31),(352,'统计建模简介','数据有时来自各种来源，有时来自计划的实验或设计的调查，但也来自缺乏组织的手段。在本课程中，我们将探讨可以从两种数据以及收集数据的设计方面做出的各种模型和预测。我们将专注于模型构建，尤其是多元回归，并讨论其潜力以及回答世界问题的局限性。我们将在理论上强调应用程序，并在整个课程中分析实际数据集。',4,'open',31),(353,'概率学','尽管概率是从对游戏的研究开始的，但它已经发展成为一门学科，在整个数学和科学领域都有大量应用。本课程以游戏示例为动力，将介绍概率的公理和数学方面。其中将讨论随机变量，期望，独立性，大数定律和中心极限定理。还将提出许多有趣而重要的应用，可能包括编码理论，数论和核物理中的一些应用。',5,'open',31),(354,'随机过程简介','随机过程是随时间或空间发展的随机现象的数学模型。本课程介绍用于构建各种实际问题的模型的随机过程的基本概念和技术。马尔可夫链理论将指导我们的讨论，因为我们涵盖了mar，随机游走，泊松过程以及布朗运动等主题。',6,'open',31),(355,'回归与预测','本课程提供统计学建模方面的理论和实践培训，并特别强调简单的线性和多元回归，并使用R开发和诊断模型。该课程从线性代数的角度介绍了多元回归和诊断理论，并着重介绍了该方法在实际数据集中的实际应用。',7,'open',31),(356,'数字系统设计基础','本课程介绍计算机系统和数字设计原理；开关和门设计；布尔代数；数字系统；存储元素；数据路径；内存组织；指令集架构等概念。',1,'open',35),(357,'信号处理导论','离散时间信号处理和线性系统简介。包括采样定理；过滤；频率响应；离散傅立叶变换；强调基于计算机的信号处理。',2,'open',35),(358,'硬件/软件系统编程','学习如何软件设计，包括高级编程语言和操作系统。编程设计项目。',3,'open',35),(359,'计算机工程的数学基础','本课程介绍离散数学的基本概念及其通过算法，数据结构，计算机程序和硬件的有效实现，工程和计算应用。',4,'open',35),(360,'微电子电路','本课程介绍微电子材料，器件和电路的基本概念。',5,'open',35),(361,'电能系统','本课程探讨的概念包括不可再生和可再生/可持续能源转化为电能的过程；成本和环境影响；电能；机电系统的传递和控制。',6,'open',35),(362,'工程系统软件基础','本课程研究使用计算机算法来解决各种应用领域中出现的电气工程问题；有效算法的开发及其通过面向对象代码的实现。',7,'open',35),(363,'电影艺术中的多样性','本课程探讨边缘化群体在媒体中的表现，以及它们如何影响人们的沟通，改变公共话语和政策，以及影响少数群体的生活。',1,'open',48),(364,'电影制作实践','本课程介绍当代的影视制作概念，强调当代媒体的多样性和重要的相关概念。使用笔记本电脑、手机和网络创建项目。',2,'open',48),(365,'电影传播','本课程会着重介绍电影传播中视觉、声音和剪辑的相互关系。',3,'open',48),(366,'导纪录片、虚构故事和新媒体导演','本课程探讨新媒体、纪录片和虚构叙事导演的基本概念。包括与演员合作、纪录片概念、新媒体短片项目的创作。',4,'open',48),(367,'进阶影视制作','本课程介绍视觉和听觉沟通的原则；利用形象、动作、节奏、语言和其他声音进行创意开发和实践，包括小型团队项目。',5,'open',48),(368,'制作和后期制作协助','本课程详细介绍影视媒体的制作过程，各个位置所需要的人力，并会直接进入剧组进行观察式体验。',6,'open',48),(369,'短片影视作品剧本写作','本课程关于短片影视作品剧本的准备，包含剧本的形式、结构、策划等内容。',7,'open',48),(370,'电视剧本分析','本课程深入分析黄金时段剧集电视的写作手法。通过每周的放映和讲座，研究情境喜剧和电视剧的剧本。',8,'open',48),(371,'全球影视媒体','本课程研究全球的电视产业和文化，包括新技术以及全球媒体和节目的社会学分析。',9,'open',48),(372,'护理科学','本课程向学生介绍了应用于护理和保健的生物科学，以及与患者交流的一些技巧。',1,'open',24),(373,'健康社区','在整个课程中，学生将对与健康和福利相关的理论有所学习和了解，包括影响个人，家庭和社区健康的社会，政治和经济因素。',2,'open',24),(374,'护理与决策','本课程以“护理科学”课程为基础，使学生了解应用于健康，疾病的病理生理学和护理中疾病管理的解剖学和生理学。',3,'open',24),(375,'个人和家庭护理概念','本课程向学生介绍个人和家庭护理实践概念。探索了心理健康护理的概念，因为它们与个人以及对家庭的整体影响有关。',4,'open',24),(376,'健康督促','本课程学习护士在婴儿，儿童，青少年和成人中促进健康和预防疾病的作用。强调个人促进健康生活方式的活动，探索了每个特定年龄段的主要疾病因素。',5,'open',24),(377,'身体评估','介绍对成年人进行身体评估并记录结果所需的工具、技能以及实践。',6,'open',24),(378,'环境工程基础','环境工程的基本原理，污染物的来源，水、空气、土壤的物理和化学性质特征，评估可持续性的概念和工具。',1,'open',54),(379,'可持续系统工程','在技术、经济和环境限制下，对水处理、水回用和能源生产过程的工程系统进行整合和优化。',2,'open',54),(380,'环境工程与科学','环境的定量和评价过程，包括质量和能量平衡、质量和热传递、化学动力学、水质模型、水处理、室内外空气质量和风险分析。',3,'open',54),(381,'项目管理和经济学','解决与建筑和工程有关的经济问题；建筑项目管理技术；施工组织、设备和方法的特点。',4,'open',54),(382,'生物学导论','介绍生物能量转化、细胞结构和生理学、基因表达。',5,'open',54),(383,'化学实践导论','介绍现代实验化学的技术。旨在提供基本的实验和分析技能。可包括有机化学、分析化学、物理化学以及材料科学。',6,'open',54),(384,'有机化学','讲述有机化学结构、命名法和反应性的发展。',7,'open',54),(385,'工程物理学','物理学的一般研究，主要是运动、热和波现象的规律。',8,'open',54),(386,'热力学','热力学的特性、热与功、第一定律和第二定律、热力学过程、理想动力循环介绍。',9,'open',54),(387,'数据科学的政治应用','数据科学正在改变我们理解和研究政治、政策和决策的方式。本课程向学生介绍数据科学的基本工具，包括数据的收集、建模和可视化，以及如何应用这些工具来研究政治和政策问题。',1,'open',50),(388,'比较政治学导论','本课程研究西欧、拉丁美洲、非洲和前苏联集团的不同政治发展模式和当代政治。介绍政治学中的比较方法以及政治发展和政治变革的竞争理论。',2,'open',50),(389,'国际关系导论','本课程介绍了国际冲突与合作的原因。主题包括发动战争、危机谈判、国际恐怖主义、核战略、国家间经济关系、经济增长',3,'open',50),(390,'博弈论与政治理论','政治学家越来越多地使用博弈论来分析各种不同环境下的策略。本课程旨在介绍博弈论的基本概念，了解博弈论的潜力和局限，以及这些概念如何应用于政治现象。',4,'open',50),(391,'政治哲学：全球正义','本课程探讨了适用于单个国家边界之外的正义规范的基础。我们探讨政治正义、经济正义和人权的议题，主题包括全球正义怀疑论的案例；全球民主的理念；知识产权等等。',5,'open',50),(392,'国际政治经济','强调政治和经济之间的动态互动，以理解和解释国际政治经济的历史和当代问题，包括国际货币、贸易、投资、金融和环境关系。考虑国际政治经济中新出现的挑战和结构。',6,'open',50),(393,'战争与和平研究','战争是人类参与的最具破坏性的社会行为。为什么会发生战争？对这个问题的探讨，集中在各种学术解释上。在进行理论讨论的同时，还对历史案例进行了研究。',7,'open',50),(394,'国际组织','概述了关于国际组织的创建和职能的主要理论观点，对选定的组织进行了比较性案例研究，并审查了国际组织目前和今后在选定问题领域的作用。',8,'open',50),(395,'环境地质','学习基本的地球科学概念，用于评估全球人口和发展的增长对地球自然资源产生的影响。学习检验大自然变化的过程中如何影响人类的活动。主题包括用水和污染，土壤污染和侵蚀，放射性和固体废物处置，滑坡，溪流洪水，海岸侵蚀，能源和矿产资源利用的环境后果，酸雨，全球气候变化以及环境对人类健康的影响。',1,'open',4),(396,'土壤学','通过研究土壤结构特征和其内部结构可以推断出地球和其他地球行星形成大致过程。主题包括太阳系中的地球，土质材料和岩石形成过程，地壳变形和整体构造，地球内部，以及地球行星的地质特征，组成和演化。',2,'open',4),(397,'21世纪的能源','今天，我们面临着用新能源驱动现代文明经济的挑战。本课程着眼于当前的能源，以评估其长期可持续性。本课程评估对全球环境的影响以及每种资源的有限性，例如核能、地热能、太阳能、风能、水能、潮汐能和其他能源，并评估10、20、50和100年时间范围内的未来资源。',3,'open',4),(398,'自然灾害','介绍地球科学中使用的概念，技术和科学方法。地震和火山喷发造成的自然灾害是学习的重点。在板块构造理论的背景下研究上述现象，确定它们的成因，破坏潜力以及预测和控制其发生的可能性。在预测方法的处理中引入了基本概率方法。同时还要考虑社会对预测的反应。',4,'open',4),(399,'能源，矿产资源和环境','本课程学习地球获得的燃料和矿物的起源、分布和对现代文明的重要性；全球矿产资源的分布状况以及如何寻找这些资源；在提取和供应化石燃料、金属矿石、水和非金属商品的产生的问题；研究与矿产资源开发有关的环境问题，以及如何利用法律和其他措施最大程度地减少对环境的破坏。',5,'open',4),(400,'矿物学','学习主题包括基础晶体学，晶体化学以及重要的成岩和矿石矿物的鉴定。包括了光学晶体学的基础知识：折射率，各向同性，单轴和双轴矿物，光学指标理论和干涉图。',6,'open',4),(401,'机械，流体和热力学','物体的运动和液体和气体的行为是如何由物理定律决定的？学生将会学习描述物体的运动（运动学）和理解物体为什么会运动（动力学）。强调牛顿三大运动定律如何应用于固体、液体和气体，以描述各种现象，如旋转的体操运动员、血液流动和声波。理解多粒子系统需要将宏观属性（如温度和压力）与微观动态（粒子碰撞）联系起来。热力学定律提供了对现实世界现象的理解，如能量转换和热机的性能极限。使用代数和三角学的工具分析日常的例子。',1,'open',44),(402,'电学, 磁学, 和光学','静电荷和动电荷是如何产生电场和磁场的，它们有什么应用？光与电磁波的关系如何？学生学会如何表达和分析电场和磁场，了解电路、电机和发电机。用光的波的性质来解释干涉、衍射和偏振现象。几何光学被用来理解透镜和镜子如何形成图像。结合这些性质和现象，我们将一起来理解光学系统的工作原理和局限性，如眼睛、矫正视力、照相机、望远镜和显微镜。',2,'open',44),(403,'现代物理学','20世纪初以来的发现如何影响我们对21世纪物理学的理解？本课程介绍了现代物理学的基础。爱因斯坦的狭义相对论和量子力学。将物理学语言与代数和三角学的工具相结合，学生将深入了解宇宙在最小和最大尺度上是如何运作的。主题可能包括原子、分子和激光物理学；半导体；基本粒子和基本力；核物理学（裂变、聚变和放射性）；天体物理学和宇宙学（宇宙的内容和演变）。强调现代物理学在日常生活中的应用，我们对宇宙的理解所取得的进展，以及积极研究的开放性问题。',3,'open',44),(404,'电，磁和波','本课程涵盖了电和磁的基础，适用于具有较强的高中数学和物理学背景，正在考虑主修物理学或工程物理学，或对物理学的严格处理感兴趣的学生。电学、磁学和波，并对光学有一定的描述。静电学和高斯定律。电势、电场、导体、图像电荷。电流、直流电路。移动电荷、磁场、安培定律。电磁铁、变压器、感应、交流电路、谐振。移动电荷的相对论观点。位移电流，麦克斯韦方程。电磁波、电介质。衍射、干扰、折射、反射、偏振。',5,'open',44);
