INSERT INTO `program_info` VALUES (1,'简单的说，会计是对财务信息的记录，分析和交流。',1,'brief',1,'open'),(2,'它首先强调的是对企业在日常经营过程中产生的各类财务信息的客观记录，然后再借助专业的财务分析工具来对上述的财务信息进行整理和计算以便得出本期企业的经营成果，最后将财务数据进行解释来支持企业高管的经营决策，制定未来的经营计划。',2,'brief',1,'open'),(3,'可以说它是社会学科的组成部分，也是一门重要的管理学科。会计学的研究对象是资金的运动。',3,'brief',1,'open'),(4,'如果你擅长沟通，注重细节，对数字比较敏感，善于发现数字的趋势和规律，认为自己是一个可以将复杂的数据转化为易懂的信息传递给他人，那么会计专业方向可能会适合你。',1,'suitable',1,'open'),(5,'为成为CPA（注册会计师）学习五年的课程',1,'ready',1,'open'),(6,'学习如何报税',2,'ready',1,'open'),(7,'学习税务法',3,'ready',1,'open'),(8,'衡量一家公司的营收和利润情况',4,'ready',1,'open'),(9,'创建并分析数据表',5,'ready',1,'open'),(10,'学习使用GAAP（一般公认会计原则）',6,'ready',1,'open'),(11,'Test Paragraph',3,'brief',1,'close'),(18,'test 1',1,'brief',3,'close'),(19,'金融学是一个非常综合的专业，它涉及到的知识包括财务计划，投资决策和分析等各个方面。学习金融专业的你将要研究不同行业里不同公司过去的表现来预测他们将来的发展情况，并做出合理的投资、运营和管理建议。这个专业的核心课程包括会计、经济学、数学、统计学、心理学和投资管理等等，并且非常注重现实与学术的结合。\r\n',1,'brief',3,'open'),(20,'金融涵盖的面其实很广，如果你期望有较高的平均薪酬与福利，出入高大上的写字楼，有一个“体面”的工作，接触到错综复杂充满不断变化的动态市场环境，那么金融专业是适合你的。但是与此同时你也要忍受较长时间工作生活无法平衡的状态，较强的市场周期（就是经常开玩笑地说：三年不开张，开张吃三年），优秀人才聚集，竞争压力大，而另外往往可能会受到一些道德和利益的两难选择。',1,'suitable',3,'open'),(21,'生物学研究的对象包括动物、植物和其他生物体，其范围非常广泛，可以从分子一直研究到生态系统，因此也会产生多个分支，包括生物化学、生物科技、生物医学工程、微生物学、环境生物学、细胞生物学等等。而综合生物学作为基础专业，集合了物理科学、社会科学和工程等多种学科，他们相互补充，从而揭示了生物学的复杂性，为未来更加细分的生物领域探索做好准备。',1,'brief',2,'open'),(22,'生物学适合好奇心强的学生学习，想知道大自然的规律并热爱分析事物之间的关联性。学习生物需要大量的阅读，也需要较强的逻辑思维和理科功底。如果你对大自然的动植物、人体构造、生态环境、基因细胞感兴趣，那么生物学会较适合你。',1,'suitable',2,'open'),(23,'在学完基础课之后选择一个细分方向，例如海洋生物、生物工程、生物化学、植物学、动物医学等。',1,'ready',2,'open'),(24,'需要有比较扎实的数学和化学功底。',2,'ready',2,'open'),(25,'如果想走技术发展道路可能需要继续深造，申请相关硕士甚至博士。',3,'ready',2,'open'),(26,'你需要比较喜欢数字和分析现实世界中错综复杂的情况。',2,'ready',3,'open'),(27,'你要有非常强烈的好奇心和解决问题的能力，一般来说金融专业的毕业生所从事的工作涉及到公司战略的长远决策。',2,'ready',3,'open'),(28,'在分析并制定决策的过程中，需要你有非常强的数学和计算机背景去分析和处理现实中的数据。',3,'ready',3,'open'),(29,'你的逻辑思维能力需要比较强。能够在繁杂的数据和信息中，做出正确的判断和决定。',4,'ready',3,'open'),(30,'你还要有良好的沟通技能去展示你的观点和结论。',5,'ready',3,'open'),(31,'土木工程是一门学习如何运用科学计算来设计大型建造项目的学科，比如如何建造大楼、桥梁、道路、铁路、隧道、地铁等等。相比于建筑学，土木工程专业首先涉及的建设范围更广，其次它会从更加纯粹的理科角度，学习理论力学、结构力学、材料力学等需要严谨计算的课程，来确认建造项目的可行性和安全性。此外土木工程师也需要考虑建造过程中的环境因素以及如何更有效地完成建设任务。',1,'brief',5,'open'),(32,'土木工程专业的学生的特点是他们擅长物理学，思维通常非常严谨，并且可以有效地分析大量信息并制定合适的解决方案，同时也需要有一定的动手能力和空间想象力，例如绘图和建模等。',1,'suitable',5,'open'),(33,'选择一个更加细分的方向，例如水利工程、交通工程和岩土工程等',1,'ready',5,'open'),(34,'学习很多物理相关课程，尤其是力学方面',5,'ready',5,'open'),(35,'有些课程需要去施工现场进行学习',3,'ready',5,'open'),(36,'做大量精度要求较高的计算任务',4,'ready',5,'open'),(37,'简单来说，生物医学工程（Biomedical Engineering）就是用工程学的手段来解决健康和医学方面的问题。人们常常会把身体比喻成一台机器，有不同的部件，当一些部件出现损坏时，生物医学工程师就会来想办法解决这些问题。生物医学工程有很多细分方向和领域，例如医疗器械类、医学影像类、生物材料和组织工程类、生物信息学类、生物力学类等等；你未来可能会研究身体里发射出的某一种化学信号是否预示着癌症的发生，或者发明一种新型材料的人造手帮助截肢患者，或者替医生发明一种更高级的手术机器人以拯救更多生命。',1,'brief',6,'open'),(38,'生物医学工程是一门高度综合的交叉学科，因此学习的科目非常广，除了工程学的基础学科比如数学物理和编程，还有大量生物医学相关的课程，需要学生有很强的学习能力，创造力、解决问题的能力和耐心。如果你对生物医学感兴趣，并且有着不错的动手能力，那么生物医学工程会适合你。\r\n',1,'suitable',6,'open'),(39,'通常要花比其他同学更长的时间毕业',1,'ready',6,'open'),(40,'做大量的小组项目',2,'ready',6,'open'),(41,'学习大量数学和科学类课程',3,'ready',6,'open'),(42,'花很长时间在实验室',4,'ready',6,'open'),(43,'很多本专业同学会选择读博',6,'ready',6,'open'),(44,'机械工程是工程专业中最广泛和最通用的专业之一，这也反映在了其目前广阔的研究方向中。今天，机械工程专业的学生参与了广泛的项目，包括设计坚韧的水凝胶，利用纳米结构表面来实现清洁水和微电子的热管理，开发高效和稳健的设计方法，构建用于陆地和水下勘探的机器人，开发无人驾驶汽车，发光伏电池，开发热能和电能储存系统，利用声学探索木星卫星的海洋，通过生物仿生学研究游鱼在水下的传感，发明新型医疗设备，探索纳米结构和宏观结构的3D打印，开发涂层以制造不粘表面。这是一个能改变世界的专业。',1,'brief',32,'open'),(45,'学机械专业的话首先要做好吃苦受累的准备。同时这个专业中的女生比例会偏少。\r\n你需要问自己：你是否对事物的工作原理感到好奇？你是否喜欢把东西拆开，看看里面的东西是如何组合在一起的？\r\n你喜欢解决复杂的问题吗？\r\n你喜欢改进事物，让它们更有效地工作吗？\r\n你是否觉得自己有点创意，有点发明家的感觉？\r\n你喜欢数学和科学，尤其是物理学吗？',1,'suitable',32,'open'),(46,'较好的数学，编程，物理这些理科的功底',1,'ready',32,'open'),(47,'较强的逻辑思维能力',2,'ready',32,'open'),(48,'良好的空间感知能力',3,'ready',32,'open'),(49,'喜欢机械，喜欢制造，不怕把自己手弄脏',4,'ready',32,'open'),(50,'喜欢拼乐高：P',5,'ready',32,'open'),(51,'人类学（anthropology）一词，源于希腊文，意思是研究人的学科。当代人类学具有自然科学、人文学与社会科学的源头，它的研究主题有两个方向：一是人类的生物性和文化性，二是追溯人类今日特质的源头与演变。因此，人类学的细分方向会有很多，例如社会人类学、医学人类学、文化人类学、考古人类学、发展人类学等等。“文化”是人类学重点研究的内容，人类学家始终把寻求地球上诸多文化与族群活动的普遍性作为其使命，其学科标志是田野工作和民族志，田野工作强调直接加入当地人的日常生活，和他们同吃同住并学习当地语言，通过对当地生活的实际体验获得经验性的调查资料。民族志是人类学研究撰写成内容，研究成果还包括民族志电影以及以民族志为素材的专业论文、论著和应用性的结论与实践等。',1,'brief',13,'open'),(52,'人类学专业的学生具有多种个人特征，包括：富有好奇心，善于观察，理想主义，冒险精神，热情等等，并且擅长从观察中分析问题后探索新的想法。如果你希望用平等的眼光看待每一种文化，了解为什么不同地方的人有着不一样的行为习惯，那你可以从人类学专业学习中找到自己想要的。\r\n',1,'suitable',13,'open'),(53,' 阅读大量相关书籍并对不同人类学家的理论进行分析',1,'ready',13,'open'),(54,'对不同文化的生活方式保持开放思想',2,'ready',13,'open'),(55,'去陌生的环境下做田野调查',3,'ready',13,'open'),(56,'整理大量的研究素材并创作内容',4,'ready',13,'open'),(57,'社会学着重于对人类社会制度和社会关系的系统研究。 社会学的分支学科非常多，如经济社会学、城市社会学、教育社会学、人口社会学、社会心理学、消费社会学等等。社会学的研究范围广泛，包括了由微观层级的社会行动(agency)或人际互动，至宏观层级的社会系统或结构，社会学的本体有社会中的个人、社会结构、社会变迁、社会问题、和社会控制，因此社会学通常跟经济学、政治科学、人类学、心理学等学科并列于社会科学领域之下。',1,'brief',14,'open'),(58,'社会学适合那些平时和人沟通中擅长观察他人行为，并常常能从中总结出一些规律的同学，因为社会学研究的就是人类群体之间发生的那些事儿，常常涉及到种族、性别、政治经济、环境、教育等等。因此如果你对这些话题有好奇心，你可以在这门学科里学到很多实用的方法。\r\n',1,'suitable',14,'open'),(59,'大量阅读相关书籍',1,'ready',14,'open'),(60,'针对一个群体或现象从多方面进行深度研究',2,'ready',14,'open'),(61,'毕业论文很重要',3,'ready',14,'open'),(62,'有一定的数据分析能力，会用到统计学',4,'ready',14,'open'),(63,'酒店和旅游管理的英文Hospitality and Tourism Management 通常指的是更广义的和泛接待服务和旅游行业的管理。而单纯针对酒店行业的管理知识只是学习的一部分。\r\n由于行业的全面性，本专业的课程常常涉及到多个领域，比如财务会计、市场营销、人力资源、法律、地理、宏观经济等等。目标是为酒店、餐饮、会展中心、度假村、俱乐部等泛旅行产业提供专业的综合型管理人才。',1,'brief',18,'open'),(64,'这是一个涉及面极其宽广的专业，所以需要学生保持强烈的好奇心去学习各科知识并拥有强大的融会贯通能力把各科知识串联在一起。沟通是学习这个专业非常重要的技能，因为这毕竟是个与各种各样的人打交道的行业。大学学习中会有大量以小组为单位的项目需要和同学们一起完成。同时你也需要有一定的耐心和忍耐力，并且乐于助人，最好能从帮助他人的过程中获取一定成就感。',1,'suitable',18,'open'),(65,'学习一门新的语言，在美国和瑞士不少顶尖酒店和旅游管理专业都要求除了英语和母语以外第三语言的学习。',1,'ready',18,'open'),(66,'利用假期进入行业内的公司实习，很多开设酒店和旅游管理专业的院校实习都是其中一门必修课程，必须做完才能毕业。',2,'ready',18,'open'),(67,'学习一定的统计和会计知识，这对于任何商业环境都必不可少。',3,'ready',18,'open'),(68,'临床医学侧重医学中实践活动的部分，是直接面对疾病、病人，对病人直接实施治疗的科学。临床医学根据病人的临床表现，从整体出发结合研究疾病的病因、发病机理和病理过程，进而确定诊断，通过预防和治疗以最大程度上减弱疾病、减轻病人痛苦、恢复病人健康。和基础医学相比，临床医学更重视诊治病人，发现疾病，为医学发展提供丰富的研究材料。\r\n',1,'brief',11,'open'),(69,'医学院的留学类似于法学院，欧美大多数高等院校都不设置本科医学专业，只有本科学过相关专业的才能申请医学院硕士，北美大多数医学院也不招收在外国毕业的本科生。以美国为例，要申请医学院必须在AMCAS认证的大学读相关的本科，毕业后要考难度较高的医学院入学考试MCAT，然后再提交申请，由AMCAS统一受理并核实文件后转送到各个医学院。注意的是只有部分医学院招收外国学生，建议申请前查清。',2,'brief',11,'open'),(70,'学医是个漫长的过程，十年左右是很正常的时间，医学院的申请竞也争非常激烈，因此你必须要有强烈的自我驱动力并保持信心，以及谨慎的态度和负责任的精神。',1,'suitable',11,'open'),(71,'MCAT（北美），UKCAT/BMAT（英国）等目标国家的考试',1,'ready',11,'open'),(72,'非常复杂的申请流程',2,'ready',11,'open'),(73,'为面试做好充分的准备',3,'ready',11,'open'),(74,'主动去联系卫生组织或机构的相关实习机会',4,'ready',11,'open'),(75,'提前研究好如何满足目标医学院的申请要求，例如选课要选相关课程',5,'ready',11,'open'),(76,'建筑学是一门横跨工程科技与人文艺术的学科。对学生的综合素质要求较高。它研究的对象不仅是建筑物本身，更主要的是研究建筑物如何满足人们的需求，研究建筑物从无到有的产生过程，以及其中相对应的策划设计和实施等等。建筑学课程除了学习理论和周边知识以外，大部分时间都是在设计工作室内完成规定的相关作品。\r\n',1,'brief',25,'open'),(77,'建筑学既是一门科学，也是一门艺术，因此要学好它，既要有缜密的逻辑思维，也要有一定的发散性思维，同时你需要足够勤奋和耐心，并学会思考。\r\n',1,'suitable',25,'open'),(78,'思考建筑是如何影响人类和社会的',1,'ready',25,'open'),(79,'学习不同的建筑风格和其历史',2,'ready',25,'open'),(80,'学习如何保护和修复老建筑',3,'ready',25,'open'),(81,'上物理和微积分课程',4,'ready',25,'open'),(82,'画出自己设计的建筑结构',5,'ready',25,'open'),(83,'研究和写相关论文',6,'ready',25,'open'),(84,'经济学是研究人类社会在各个发展阶段上的各种经济活动和各种相应的经济关系及其运行、发展的规律的学科。经济学核心思想是物质稀缺性和有效利用资源，可分为两大主要分支，微观经济学和宏观经济学。简单点来说就是在研究如何在有限的资源（人力，时间，金钱，能源等等）条件下去创造最高效的利用率，为国家和地球的发展做出贡献。\r\n',1,'brief',34,'open'),(85,'经济学的学习是需要你把理论和现实相结合的学科。经济学所研究的东西将会影响你生活的方方面面，大到的你教育，买房，工作，结婚，小到今天路边卖的猪肉价格和在山区里卖不掉的桔子。在学习经济学的过程就是在探寻这个社会运行背后规则和原理的过程。为什么美国人人均收入这么高而非洲人民却连基本的温饱都解决不了？为什么会有经济危机发生？为什么会有通货膨胀导致你的钱越来越不值钱？如果你家的门口修了一条地铁会对你小区的房价产生什么影响？为什么我们一定要上大学？',1,'suitable',34,'open'),(86,'所以如果你不是一个好奇心很强的人，那你就不适合学习经济学。除此之外，经济学的研究都是需要通过数学和大量的现实数据实现的。这就需要你在大学阶段掌握很好的数据处理分析能力。在学习经济学的过程中，你会发现很多的事情都是管中窥豹，很多的经济学的现象都会通过一些简单的政策，或者是人类的行为，进行不断的传导和扩大效应。所以对于你来说需要有很强的逻辑思维能力，去一环一环的追根溯源找到经济学中核心的问题所在。',2,'suitable',34,'open'),(87,'对现实世界充满强烈的好奇心',1,'ready',34,'open'),(88,'比较扎实的数学基础',2,'ready',34,'open'),(89,'较好的逻辑思维能力\r\n',3,'ready',34,'open'),(90,'心理学是研究人的心理现象及其规律的科学。心理学一词来源于希腊文,意思是关于灵魂的科学。它是以研究人的心理活动的规律为任务的。\r\n\r\n心理学将会研究以下一些问题的答案：\r\n我们是如何感知物理世界的？\r\n我们对物理世界的看法是否与现实一致？\r\n我们真的能理解别人的思想吗？\r\n记忆是如何形成的，我们又是如何遗忘的？\r\n我们推理和思考的规则是什么？\r\n我们的行为有多少是受意识的影响，我们如何研究自己的意识？\r\n日常生活中的各种情绪以及抑郁症、精神分裂症等疾病中所表现出来的情绪有什么作用？\r\n这类疾病的病因是什么，如何治疗？\r\n小孩是如何学会一种语言的？\r\n为了回答这些问题，心理学家会通过观察人类进化的因素、行为基础、文化和社会输入，以及个人所处的日常环境来进行解答。',1,'brief',12,'open'),(91,'心理学专业的学生通常都对身边不同的人很感兴趣，他们对人类的行为模式和思维方式有着天然的好奇心和求知欲。学习心理学的的学生很多兴趣广泛，因为心理学研究确实是一项跨学科的工作。其次心理学作为一门科学需要有较好的数学统计基础和逻辑思维能力。另外，心理学的分支很多，可以根据自身兴趣进一步决定未来方向。',1,'suitable',12,'open'),(92,'有很多课需要在实验室度过，通过案例学习心理学研究方法',1,'ready',12,'open'),(93,'有些课程会需要去例如特殊教育学校和监狱等地与人进行沟通',2,'ready',12,'open'),(94,'学习专业的统计方法并运用到实验中',3,'ready',12,'open'),(95,'有些课程需要通过解剖学了解大脑的运作',4,'ready',12,'open'),(96,'艺术设计是一门强调多种学科交叉的专业，其下面有非常多的细分领域，例如交互设计、工业设计、娱乐设计、室内设计、服装设计、珠宝设计、平面设计、环境设计、园林景观设计等等。每一门都会有不同的专业课，例如交互设计会需要一定的计算机知识，工业设计需要学习材料化学和使用建模软件，室内设计需要有一定建筑学基础等。本科阶段有一些学校会提供基础设计专业，到大三大四再修细分专业方向的课程。\r\n',1,'brief',22,'open'),(97,'学习设计远不止画画这么简单，你不仅需要有基本的艺术审美和空间想象力，也需要阅读大量的理论知识并学习技术工具的使用方法。最重要的还是需要有创造力并落实到个人作品中。\r\n',1,'suitable',22,'open'),(98,'申请前就要准备好拿得出手的相关作品集作为一部分申请材料',1,'ready',22,'open'),(99,'尽早选择好具体的细分方向，从而有更多时间更加深入地准备个人作品',2,'ready',22,'open'),(100,'学习相关的艺术史，阅读大量理论',3,'ready',22,'open'),(101,'上学期间会长时间呆在工作室里琢磨个人作品',4,'ready',22,'open'),(102,'植物学是一门研究植物形态解剖、生长发育、生理生态、系统进化、分类以及与人类的关系的综合性科学。除了解决植物生物学中的基本问题外，植物学家提供的研究可用于为日益增长的人口生产食物，纤维和药物，以及增进我们对植物和生态系统多样性的了解。植物学也有很多分支，比如植物生态保护学、植物病理学、分子和细胞植物学等等。',1,'brief',51,'open'),(103,'植物学适合那些对户外大自然感兴趣的学生，因为很多研究会在室外进行，包括探索它们是如何生长发育和进化的，他们在环境中与其他生物体之间发生着怎样的互动。同时，你需要有不错的记忆力因为会有很多专业词汇，还需要有一定的生物和化学基础。',1,'suitable',51,'open'),(104,'生物和化学课占的比例较高',1,'ready',51,'open'),(105,'和教授一起解决现实中的问题，比如如何预防外来植物的入侵',2,'ready',51,'open'),(106,'有较多的时间需要在实验室做相关研究',3,'ready',51,'open'),(107,'如果走研究方向需要准备申请研究生或博士',4,'ready',51,'open'),(108,'教育学课程的目标是培养有资格在教育和发展领域与不同年龄段的人一起工作的专家。通过对理论学科和应用学科的学习，你将具备教育学的的知识、技能和能力。这个学科一方面强调更广泛的理论教育学和人文科学基础，另一方面则强调教育学如何在现实中进行应用。教育是在不断变化的社会、政治和文化背景下进行的。你将探索不同背景下的教育，以及政府政策对教育实践的影响。你将了解学校和课堂是如何运作的，以及核心课程科目是如何学习和教学的。教育学一般都会有实习项目，使你获得课堂或其他教育环境的第一手实践经验，而多样化的选修模块将使你专注于最令你感兴趣的主题 - 从科学，数学和语言教育到行为管理等等。可以说这是世界上最古老的一个职业和专业了。\r\n',1,'brief',16,'open'),(109,'教育学也是一个非常大的分支，它专业涉及的范围非常广。宏观上是教育学(education)，学习教育的历史、发展、理论研究，将来从事教育研究或者学校管理工作。在研究生阶段主要专业有：教育研究、教育管理、教育领导力、教育学与社会研究等。微观上，教育学细化为教学(teaching)，学习教学过程中的教学方法，或者不同学科的教学技巧。主要专业有：护理学，幼儿、小学、中学、高等教育，英语教学、音乐教学、数学教学、心理教学、英语作为外语的教学等等。',2,'brief',16,'open'),(110,'上学的时候你有没有想过为什么有的老师会让你喜欢，有的却让你讨厌？你是否愿意传授知识，帮助不同年龄段的人群学习成长？当你向朋友解释了一道难解的数学题，他的脸上亮起了理解的光芒时，你是否感到自豪？如果你觉得这是一个很有成就感的事情，那么教育学可能是一个适合你的专业。',1,'suitable',16,'open'),(111,'较强的理解能力和同理心',1,'ready',16,'open'),(112,'非常有耐心',2,'ready',16,'open'),(113,'良好的沟通技巧',3,'ready',16,'open'),(114,'未来希望从事教育行业或者做一名老师',4,'ready',16,'open'),(115,'期待较稳定的工作',5,'ready',16,'open'),(116,'希望有一份受社会尊敬和有成就感的工作',6,'ready',16,'open'),(117,'简单来说，市场营销是把一个产品或服务从生产者手中传递到消费者手中的过程，是企业或其他组织以满足消费者需要为中心进行的一系列活动，市场营销学是系统地研究市场营销活动规律性的一门科学。包含研究消费者行为、市场研究原理、需求分析、定价理论、市场宣传方法、策略规划、广告手段、销售运营和管理、客户关系、零售等等一系列课题。\r\n',1,'brief',20,'open'),(118,'市场营销学非常适合喜欢团队合作并且爱用具有创造性的方式解决问题的人。当今的市场营销人才不仅需要懂得传统的营销渠道、销售管理、广告和市场研究方法论，更需要有对消费者消费动机敏锐的嗅觉，这个过程需要学习和了解市场环境中买方和卖方的行为，然后再加以分析。越来越多的市场营销专业融入了数据分析的课程，所以不要认为这是一个纯粹的文科专业。\r\n',1,'suitable',20,'open'),(119,'学习一定的心理学，研究消费者的行为和习惯',1,'ready',20,'open'),(120,'学习数据分析和统计学相关课程',2,'ready',20,'open'),(121,'假设你有一个新的产品需要销售，如何收集和分析竞争对手信息',3,'ready',20,'open'),(122,' 了解商品是如何被定价的',4,'ready',20,'open'),(123,'学习过去优秀和失败的广告营销案例',5,'ready',20,'open'),(124,' 具备优秀的书面和口头表达能力',6,'ready',20,'open'),(125,'语言学（Linguistics)是研究语言的科学，不是学语言，因此千万不要和英语和其他语言文学专业混淆。你有没有想过人是怎么理解语言的？人们从小到大的语言理解能力发生了怎样的变化？你知道当今的机器翻译甚至一些计算机语言都是基于语言学大师乔姆斯基研究的句法结构吗？语言学的重点是发现人类语言的内在规律，从研究方面来看主要分为两大类：理论语言学和应用语言学。理论语言学主要研究语言结构，包括发音、组词、组句和含义；应用语言学主要研究语言的使用现象，在社会上的应用等，包括社会语言学、心理语言学、神经语言学。\r\n',1,'brief',37,'open'),(126,'语言学适合那些对“语言是如何工作”这个问题充满好奇心的人，如果你喜欢去探究一个词语的出处，根据一个人说话的方式猜测他从哪里来的，还喜欢玩一些文字游戏，那语言学会比较适合你。',1,'suitable',37,'open'),(127,'除了中文和英文最好再学一到多门语言，这会对学习语言学很有帮助',1,'ready',37,'open'),(128,'如果选择应用方向，进阶学习会要求一定的统计学甚至R语言编程',2,'ready',37,'open'),(129,'阅读大量不是很好啃的文献',3,'ready',37,'open'),(130,'英语专业的目的是向学生介绍英语写作的历史，熟悉各种历史时期下以及不同地理和文化区域中的英语写作方式，从而提高对文学、文化方法以及相关理论的分析能力。与国内英语专业不同的是，在英语为母语的国家就读英语专业重点以文学写作为主，其中细分项目包括针对不同时段英语文学的研究、创意写作、比较文学、翻译等等。\r\n',1,'brief',39,'open'),(131,'出国读英语文学相关专业的同学英语底子需要非常好，毕竟身边同学都是母语作者，因此很多本科在国内读英语文学相关专业的学生如果确实对文学感兴趣，不妨可以考虑根据自己兴趣，选择出国读创意写作或翻译等细分领域。',1,'suitable',39,'open'),(132,'阅读大量欧美文学中的经典书籍\r\n',1,'ready',39,'open'),(133,'大量写作，平均每周要写上千词的内容\r\n',2,'ready',39,'open'),(134,'中国学生相对较少，需要和母语作者竞争',3,'ready',39,'open'),(135,'食品科学专业是一门交叉学科，以生物科学和食品化学为基础，结合一些工程技术原理，探究食物的处理、制备、运输、保存等问题。食品科学本科课程的前两年会帮助学生在数学，化学以及物理和生物科学打下扎实的基础，必修课程包括基础和有机化学，生物学，微生物学，微积分，物理学，食品科学基础课程和营养学。 后两年课程强调了这些基础科学技术在食品和食品配料的制造，感官评估，存储，分配和安全方面的应用。\r\n',1,'brief',43,'open'),(136,'食品科学适合理科思维较强的学生，尤其是生物和化学比较好的，同时对吃吃吃也很热爱，还对解决现实中的问题充满热情。\r\n',1,'suitable',43,'open'),(137,'如果希望进入行业的研发岗位，需要继续读研甚至读博\r\n',1,'ready',43,'open'),(138,'很多时间在实验室中度过',2,'ready',43,'open'),(139,'在假期时间完成相关行业的实习',3,'ready',43,'open'),(140,'人力资源简单来说就是培养未来从事企业人员管理人才的一门专业。人力资源管理专业是管理学、经济学、心理学、教育学、社会学等多学科相互渗透一门综合性管理类专业。欧美院校的商学院中人力资源通常只有硕士项目，学生来源通常是本科学习心理学、经济学和金融管理类的学生。人力资源管理是对人力资源进行合理的培训、 组织和调配，使人力、物力保持最佳比例，同时对人的思想、心理和行为进行引导、协调，充分发挥人的主观能动性，使人尽其才，事得其人，人事相宜，以实现组织目标。尤其是在当今的企业下，人力是每一个公司最大的资产和生产力来源，人力资源管理专业在当下的社会发展中就显得尤为重要。',1,'brief',23,'open'),(141,'对于绩效管理和薪酬福利方面，需要考虑很多细节来制定周密的方案，这方面女生会更有优势一些，当然不排除心思细腻虑事周全的男生们。这个专业需要你比较易于与人接近，营造轻松的氛围，善于问问题和考察别人，同时你需要有很强的逻辑性去面对不同的人，洞察每一个人的能力品质等是否与公司企业的文化和战略相符合。人力资源的工作相对来说会稳定一些，适合不喜欢冒险的人。最好性格坚韧，另一个是对人有较强的感知度并且喜欢与人交流。',1,'suitable',23,'open'),(142,'心思细腻，善于问问题',1,'ready',23,'open'),(143,'性格平易近人，擅长一对一沟通，对人有足够的洞察力',2,'ready',23,'open'),(144,'时刻保持对社会的更新迭代的认知，因为会和不同年龄段不同背景的人打交道',3,'ready',23,'open'),(145,'营养学是一门结合了生物、化学以及社会科学的综合学科，探索食物和人类健康的关系，从而回答这些问题：不同饮食习惯对不同地区的人群有着怎样的影响？低卡的饮食方式真的健康吗？为啥缺乏维生素B的人会感到暴躁？营养物质影响新陈代谢的生物学机制是什么？如何鼓励人们采取更健康的饮食方式？本科毕业后大多数学生会继续进入研究生院或者医学院学习。微观的营养学会以学习化学、生物、数学的知识为主；宏观的营养学通常会隶属于农学院，课程更多偏食品科学、农业、经济和环境科学。\r\n',1,'brief',42,'open'),(146,'你需要对吃和健康这两件事保持热情。由于营养学学对生物和化学要求较高，你需要比较擅长这两门基础课，其次如果你要去欧美国家读营养学，需要抛开自身成长环境中对营养的认知，因为饮食习惯有着很大不同。',1,'suitable',42,'open'),(147,'有很多课程需要在实验室完成',1,'ready',42,'open'),(148,'学习大量的生物、化学、医学知识',2,'ready',42,'open'),(149,'在欧美国家读营养学需要准备好考取每个国家的营养师证\r\n',3,'ready',42,'open'),(150,'如果希望做相关研究需要考虑读研或者申请医学院',4,'ready',42,'open'),(151,'城市规划的目的，不仅仅在于安排好城市形体，例如城市中的建筑、街道、公园、公用事业及其它的各种要求，更重要的在于实现社会与经济目标。城市规划专业是一个要求相对比较综合的学科，国内会将其归类于建筑类专业，而欧美很多学校会将其归类在艺术类，在课程设置上也会有一定差异。由于城市是一个很具社会特征的对象，除了工程类的知识外，还需要具备许多社会学知识，甚至包括一些文学、美学知识。\r\n',1,'brief',21,'open'),(152,'城市规划专业对学生的综合素质有一定要求，不仅要有一定的审美和设计绘图能力，同时对历史地理等人文社会学科也要有很好的了解，另外，课程中会有大量需要做项目和作品展示的环节，需要锻炼一定的口才。\r\n',1,'suitable',21,'open'),(153,'和同学一起做团队项目并汇报作品',1,'ready',21,'open'),(154,'用设计工具建造模型',2,'ready',21,'open'),(155,' 学习地图和统计学',3,'ready',21,'open'),(156,'学习相关的土地法和地产法',4,'ready',21,'open'),(157,'用软件模拟和分析社区',5,'ready',21,'open'),(158,'撰写研究报告和论文',6,'ready',21,'open'),(159,'艺术管理综合来说就是对艺术文化产业进行分析和实践应用，用管理学知识为公众带来出色的表演，画展，影视剧，歌曲等等。你会学习如何支持和推广艺术家和艺术活动，筹集资金，管理财务等等。艺术管理专业在欧美很多只开设研究生课程，本科是艺术相关背景出身的同学相对会更有竞争力一些。艺术管理通常会被细分为视觉艺术管理表演艺术管理两大类，其中视觉艺术管理面向的是艺术展览、画廊、拍卖行、博物馆等机构，而表演艺术管理面向的是音乐节、剧院、影视类等机构。\r\n',1,'brief',53,'open'),(160,'艺术管理其实本质上更偏向商科，因此你不仅需要对艺术行业充满热情，更需要有良好的沟通谈判能力和理性思维。你的主要职责是把艺术作品带给更多人群，所以你会经常和赞助方、志愿者、艺术家等多方打交道。\r\n',1,'suitable',53,'open'),(161,'学习如何写计划书，从而申请项目资金\r\n',1,'ready',53,'open'),(162,'学习创建市场营销方案\r\n',2,'ready',53,'open'),(163,'学习规划财务表来控制预算\r\n',3,'ready',53,'open'),(164,'积累艺术领域的行业知识\r\n',4,'ready',53,'open'),(165,'利用假期实习并参与到一场艺术活动的策划中',5,'ready',53,'open'),(166,'计算机科学涵盖了各种各样与计算机和信息处理相关的系统研究。从创建计算机游戏到通过编程技术创造自己的app，再到建立下一个阿里巴巴或者腾讯，使用计算机科学学位可以做很多令人惊奇的事情。这是一个令人兴奋且不断发展的领域，这个领域的潜力几乎是在无限增长。它的分支领域也很多，包括计算机图形学、计算机安全、计算机理论与算法等等。\r\n',1,'brief',30,'open'),(167,'你需要具备不错的数学能力，同时也要有一定的抽象思维；不仅要会从人的角度思考，也要会从机器的角度想办法解决问题，这需要你具备创造力、想象力和逻辑能力。\r\n',1,'suitable',30,'open'),(168,'热爱学习计算机语言（编程）',1,'ready',30,'open'),(169,'具有创造力，逻辑性',2,'ready',30,'open'),(170,'喜欢能够解决具有挑战性的问题',3,'ready',30,'open'),(171,'喜欢创建可提高生产率的工具',4,'ready',30,'open'),(172,'经常要花很长时间debug',5,'ready',30,'open'),(173,'地质学是对地球的研究，地质学的研究包括构成地球的固体、液体和气体。学习内容包括历史地质学、岩石和土壤化学、矿物在工业中的应用等主题。地质学也包括了对居住在我们星球上的生物的部分研究。如今，许多地质学家也正努力了解地球过去的地貌和气候以及它们是如何随着时间变化的，这些信息对探索人类未来环境非常有价值。\r\n',1,'brief',4,'open'),(174,'动物科学（Animal Science）专业的学生都清楚地知道食物是从哪里来的。他们学习如何确保牛、鸡、猪和其他食用动物的供应尽可能地健康和高效，寻找哪些品种的奶牛能生产出最好的牛奶，以及想出新的方法来预防疯牛病。\r\n他们还会学习食品动物的营养、繁殖、行为和管理，涵盖的研究范围包括乳品科学、家禽科学、畜牧业生产和水产养殖等。\r\n',1,'brief',8,'open'),(175,'法学是一门以法律现象为研究对象的学科，涉及的范围非常广泛，我们日常生活中的各个方面都要用到法律知识，例如签合同要懂合同法，与工作单位有纠纷要懂劳动法。此外，还有探究犯罪问题的刑法、打官司用到的诉讼法、研究国家之间关系的国际法等。法学专业的学生还需要了解为什么要制定法律，以及学习如何用法律来解决问题。',1,'brief',9,'open'),(176,'明年保险公司将支付多少赔偿金？如何保证长辈的养老金的可以有稳定的收益？明年二月股市表现如何？拥有精算学学位，你将获得答案。精算学在17世纪末期成为一门正式的数学学科。 精算学是运用现代数学、统计学、金融学及法学等的各种科学的方法，对各种经济活动中未来的风险进行分析，评估和管理，是现代保险、金融、投资实现稳健经营的基础。精算主要用于保险业，以确保保险公司现在和未来几十年的财务稳定。\r\n',1,'brief',10,'open'),(177,'化学是通过数学、理论和实验去学习和研究物质，从分子的角度探索它们的性质、组成、结构、以及变化规律。化学作为基础自然科学有很多的衍生专业，比如化学工程、生物化学、材料工程，也是很多其他专业的基础，例如生物工程、药学、食品科学、营养学等等。\r\n',1,'brief',28,'open'),(178,'化学专业的学生通常有很强的好奇心，对身边物质的构成和各种化学反应充满兴趣，同时也具备逻辑分析能力和自我驱动力，以及较强的实验室动手能力。\r\n',1,'suitable',28,'open'),(179,'花大量的时间在实验室研究反应，记录数据，书写报告',1,'ready',28,'open'),(180,' 尽早选择好一条细分赛道，例如生物化学、化学工程、药学等等，为职业路线提前做好规划',2,'ready',28,'open'),(181,'如果想从事技术和研究类的工作，需要继续读研甚至读博',3,'ready',28,'open'),(182,'稍安勿躁，敬请期待',1,'brief',15,'close'),(183,'稍安勿躁，敬请期待',1,'brief',17,'open'),(184,'由于医疗和生物科技的进步，人类的寿命比以往任何时候都要长，寿命的延长意味着老龄人口的增加，患病人数也相对会增加。自2016年以来，注册护士的需求持续每年增长15％。护理专业能为你在护理管理，护理研究和临床护理方面的职业道路做好准备。学习该专业的你将会具备评估临床各类病症能力，与患者沟通和在各种医疗健康领域工作所需的技能。获得护理学位的毕业生将准备成为一名注册护士，在医疗健康领域提供全面的服务。\r\n',1,'brief',24,'open'),(185,'你需要有很强的逻辑思维，希望在混乱的世界中找到一定的规律，同时也要具备一定的空间想象力，更重要的是你需要用严谨的数学语言去解释一些抽象的概念。如果是这样，那么学习数学专业可能会适合你。\r\n',1,'suitable',29,'open'),(186,'商业分析（Business Analytics）是一门以商业知识为基础，数理编程为手段，从数据分析出发，以优化决策从而创造价值的新兴专业，实现大数据的商业应用。商业分析师要在现在不断变化的商业环境中找出不同企业存在的各类问题，并提出解决方案。商业分析从业人员的工作不仅包括商业分析师，还包括商业系统分析师，系统分析师，需求工程师，流程分析师，产品经理，产品所有者，企业分析师，商业架构师，管理顾问，商业智能分析师，数据科学家以及更多。许多其他工作，例如管理，项目管理，产品管理，软件开发，质量保证和交互设计，都非常依赖于商业分析技能来取得成功。\r\n',1,'brief',26,'open'),(187,'这个专业需要非常复合背景的人才，你不能只钻研书本，你需要把所学的统计学，计量学，管理学，经济学，金融学，会计学，现代商业理论等等知识融会贯通，并要能和现实世界的情况有很好的结合。你需要对这个世界，经济运行，商业运营有很强烈的好奇心，并善于发现和解决问题。你要在理性和感性之间有很好的平衡。商业的本质是人，而人是复杂的非理性动物。\r\n',1,'suitable',26,'open'),(188,'有比较好的社交能力和社会洞察力',1,'ready',26,'open'),(189,'能够熟练的找到你想找到的数据和资料，并且整理转化这些资料成为有效的信息帮你和客户做出一些商业决策',2,'ready',26,'open'),(190,'学会编程并能够处理大量繁杂的数据',3,'ready',26,'open'),(191,'能够理解数据背后的商业逻辑',4,'ready',26,'open'),(192,'工商管理专业属于管理学学科门类下面的核心专业。从知识结构来看，工商管理专业它是一门跨人文社科，以及工程科学等学科知识思维的综合性交叉学科。这个专业的知识范围较广，主要课程包括经济学、管理学、企业管理、财务管理、人力资源管理、会计学、统计学、计算机等。工商管理专业主要是培养具备商业、经济、管理、财务等方面专业知识，未来能够适应社会经济管理发展需求，能够在企业以及事业单位，或者政府公共管理部门从事商业管理，公共管理等方面的人才。\r\n',1,'brief',52,'open'),(193,'工商管理涵盖了很多学科，可以有很多细分子专业，适合那些需要更多时间探索自己在商业领域到底想学什么的学生。作为典型的商科专业，工商管理希望培养的是具有领导力的学生，未来可以进入企业或组织的管理层。课程通常会设置许多小组项目，锻炼学生的团队合作能力，以及面对新的挑战时随机应变的能力。',1,'suitable',52,'open'),(194,' 训练自己的演讲和表达能力，提高写作水平',1,'ready',52,'open'),(195,'学习Excel，SPSS等数据和表单处理工具',2,'ready',52,'open'),(196,'利用每个假期时间尽量获得更多的实习经历',3,'ready',52,'open'),(197,'加入学校相关社团锻炼自己的组织和执行力',4,'ready',52,'open'),(198,'新闻传播学是结合了新闻和传播两大类知识体系的专业。可以单独细分为新闻学和传播学，以及一些新型专业例如网络和新媒体、数字出版、广播电视学等。\r\n新闻学专业主要学习新闻评论、新闻事业史、公共关系学、报纸编辑、新闻采访与写作、新闻事业管理、新闻名篇选读、新闻学概论、广告学概论等课程。大众传播学主要研究媒介与社会的互动，即社会对媒介的作用和媒介对社会的影响，尤其把重点放在对“人”，即受众的研究上。媒介效果的调查研究即对媒介对受众的态度行为的影响，是大众传播学研究的最主要部分。\r\n',1,'brief',40,'open'),(199,'学习新闻传播学从实践的角度来说是一个需要大量和他人打交道的一个专业，所以相对更适合性格外向的人群。另外，你需要关注世界上的新鲜事并且保持好奇，优秀的表达能力和清晰的逻辑思维也至关重要，最后需要你有很强的时间观念，因为这个行业的内容有很强的时效性。\r\n',1,'suitable',40,'open'),(200,'保持关注时事新闻的习惯',1,'brief',40,'close'),(201,'保持关注时事新闻的习惯',1,'ready',40,'open'),(202,'有比较好的写作能力（中英文）',2,'ready',40,'open'),(203,'学习在最短时间内对一个话题做具有一定深度的研究',3,'ready',40,'open'),(204,'学习如何找到采访对象',4,'ready',40,'open'),(205,'在短时间内大量的写作和编辑',5,'ready',40,'open'),(206,'在媒体机构实习',6,'ready',40,'open'),(207,'历史是由无数不同的碎片组成的拼图，从建筑的砖块到人和动物的骨头，从盘子和碗到衣服盔甲，考古学家的任务就是找到这些碎片，并将它们拼凑成一幅过去的图画。作为考古学专业的学生，你将学习如何挖掘出历史文物，把过去和现在社会联系到一起，并研究他们在当代社会中的作用。考古学的主要学习内容包括田野调查、发掘、分析所收集的资料，重建过去人们的物质文化与环境资料，包括器物、建筑、生物遗留与文化等。\r\n',1,'brief',19,'open'),(208,'首先你要对历史文化和收藏有浓厚的兴趣，甘于为此在远离城市的地方潜心研究，并经历一定的风吹日晒。你需要有足够强烈的好奇心，十分的耐心和对细节的追求，并具备创意思维，根据挖掘的线索解决历史的谜团。\r\n',1,'suitable',19,'open'),(209,'长时间在户外田野场地发掘遗迹',1,'ready',19,'open'),(210,'独立测量、绘图、摄影、操作相关仪器\r\n',2,'ready',19,'open'),(211,'在实验室分析发掘到的材料\r\n',3,'ready',19,'open'),(212,'学习大量历史知识去了解田野场地的背景知识\r\n',4,'ready',19,'open'),(213,'家庭成员的理解和支持',5,'ready',19,'open'),(214,'稍安勿躁，敬请期待',1,'brief',55,'close'),(215,'历史学是研究包括人类社会一切问题在内的科学。它不是信条、教义、文学。历史学的目的就是尽可能地逼近真实情况。通过分析先人留下的文献古籍，从而研究不同时期不同地区人们的生活和文化，探索人类的发展轨迹，为当今和未来的社会生活提供借鉴。历史学的细分方向非常多，大体可以用三种方法划分：按时间（例如文艺复兴时期、近现代）；按地区（例如东亚史、欧洲史）；按主题（例如法律史、艺术史）。\r\n',1,'brief',15,'open'),(216,'历史学专业对学生的阅读和写作能力有非常高的要求，因为大部分课程的内容都需要读读读和写写写。你需要有很强的逻辑分析能力，把碎片化的历史片段组织成更完整的内容。当然，你更需要对不同地区的历史文化有强烈的好奇心，并喜欢关注细节。\r\n',1,'suitable',15,'open'),(217,'通过不断阅读产生自己的观点和想法\r\n',1,'ready',15,'open'),(218,'在课堂中就一个话题参与和同学的套路\r\n',2,'ready',15,'open'),(219,'每周阅读上百页的内容\r\n',3,'ready',15,'open'),(220,'尽早选择一个具体的研究方向',4,'ready',15,'open'),(221,'药学是生物、化学和医学的交叉学科，主要研究药品从研发到上市流通的整个过程，其中包括了药剂学、药理学、药物化学、药物分析等方面的技能和知识。和医学相比，药学不会学习临床部分的课程；和生物医药工程相比，药学不需要修工程基础课。\r\n北美的药学院本科专业申请通常分两部分，一部分叫Pharm D（药学博士），只要读2年Pre-Pharmacy后并通过PCAT考试便可以进入4年的Pharm D学习，也就是从本科到博士一共只要6年，毕业后通过相关考试可以拿到药剂师执照，目的是像医生那样提供专业的医疗健康服务 ；第二种是普通的Bachelor of Science in Pharmaceutical Science（制药科学学士），更偏向药物研发和上市流程的学习，毕业后大部分会通过继续学习细分领域做相关研究工作。欧洲的药学专业也会有一些特殊项目，建议申请前要多做研究。\r\n',1,'brief',7,'open'),(222,'药学和医学类似，是一个需要漫长的时间和良好的耐心以及足够的自我驱动力才能完成的学科，其次你需要对生物和化学这两门学科有足够的热情，因为绝大部分课程都是以它们为基础。\r\n',1,'suitable',7,'open'),(223,'选择好研究方向后继续读研读博\r\n',1,'ready',7,'open'),(224,'长时间在实验室里工作\r\n',2,'ready',7,'open'),(225,'有大量需要记忆的内容\r\n',3,'ready',7,'open'),(226,'如果想做药剂师需要考当地对应的执照考试\r\n',4,'ready',7,'open'),(227,'在药企和政府机构做相关实习',5,'ready',7,'open'),(228,'哲学Philosophy一次源于希腊语philosophia，意为“热爱智慧”。哲学可以追溯到孔子和柏拉图的时代，也可以在当今计算机的AI思维中得以体现。哲学专业训练学生如何批判性思考关于存在、知识和价值等基本问题，介绍过去思想家的观点、各种推理和逻辑判断的方法，并运用这些方法来清晰地论证和表达自己的观点，从而利用哲学更好地理解其他领域。本科学习哲学的大多数学生会通过继续学习在其他领域有所建设，例如法律、社会学和经济学。\r\n',1,'brief',55,'open'),(229,'哲学是一门需要极强的逻辑思维和想象力的专业，你在学习过程中得有耐心、组织力和对细节的追求，从而建立自己的观点。除此之外，你需要能言善辩，并进行大量的阅读和写作。\r\n',1,'suitable',55,'open'),(230,'在课堂里参与和同学针对某一话题的讨论和辩论\r\n',1,'ready',55,'open'),(231,'掌握逻辑思维技巧并运用到日常思考中\r\n',2,'ready',55,'open'),(232,'对复杂和抽象的话题进行逻辑清晰的写作\r\n',3,'ready',55,'open'),(233,'大量阅读较难理解的书籍\r\n',4,'ready',55,'open'),(234,'可能需要学习一门外语',5,'ready',55,'open'),(235,'化学工程主要研究如何将原材料转化为有用的产品，其中涉及到关于分子的研究，设计和操作。\r\n\r\n化学工程师在多个领域工作，包括生物技术，清洁能源，石油和化学工业，消费品，林业产品制造以及环境工程。 他们的角色通常包括设计新流程，改进现有流程，降低制造成本和开发新产品。\r\n\r\n化学工程师的创新体现在医学产品，电子设备和高性能材料上。 从创新药物到更高效的光伏电池，为当今最紧迫的社会问题提供了先进的解决方案。\r\n',1,'brief',47,'open'),(236,'化学工程相比于化学，是把一个化学研究的反应进行工业上的实现，因此除了化学，还需要掌握更加高阶的物理和数学知识。总体来说，学习化工需要有有谨慎的态度，同时也要保持好奇心，并拥有解决问题的信心。\r\n',1,'suitable',47,'open'),(237,'选择一个更加细分的领域，例如环境、生物分子、材料等',1,'ready',47,'open'),(238,'团队合作能力，因为要和其他同学一起完成团队项目',2,'ready',47,'open'),(239,'其他专业选修课较少',3,'ready',47,'open'),(240,'很多课需要在实验室做一定研究',4,'ready',47,'open'),(241,'运动医学是一门新兴专业，结合了传统的生物医学课程和运动科学课程，学生可以了解到人体系统在运动状态下的健康与疾病，如何通过运动来预防和治疗一些疾病，如何优化运动员的身体素质和成绩，如何评估、管理、预防和治疗运动带来的损伤，以及其他研究技能。在欧美有些运动医学专业是隶属于医学院矫正外科下的子专业，申请难度会较大；也有些运动医学专业是隶属于健康科学院下面的，申请难度会相对低一些；还有一些院校只开放运动医学硕士课程，需要本科有相关背景才能申请，所以申请前要提前做好研究工作。\r\n',1,'brief',38,'open'),(242,'运动医学适合对生物医学感兴趣的，同时也对体育健身行业有热情的学生，因为毕业后可以进入自己喜欢的球队为运动员提供支持和治疗。较强的逻辑思维能力，数据分析能力，乐于助人的精神，以及与患者沟通能力是学习运动医学重要条件。\r\n',1,'suitable',38,'open'),(243,'如果进入医学院的运动医学科，除了医学院基础课程，还需要3-5年时间准备相关证书',1,'ready',38,'open'),(244,'如果进入非医学院的运动医学专业本科，通常仍需要继续读研或博才能拿到相关证书',2,'ready',38,'open'),(245,'除了医学类课程，还会学习心理学和营养学相关课程',3,'ready',38,'open'),(246,'留学生想要进入海外的法学院通常还有其他要求，比如北美法学院入学考试LSAT，英国法学院入学考试LNAT等。欧洲和澳洲的法学基本都有本科学位，但在北美，法学和医学一样基本不招本科生。北美法学院会招收各种背景和专业的学生，一般想读法律的同学们可以在本科阶段就读STEM类专业，例如数学和化学，这些专业在法学院的录取率往往极高，当然社科类专业也是不错的选择。几乎任何学科的知识在法律职业中都是有帮助的，因为法律职业中需要不同领域的专家，如果你精通生态学，法学院会认为你是个出色的环境律师；如果你是化学专家，你可能会成为制药公司的杰出律师等。',2,'brief',9,'open'),(247,'法律这个专业是先苦后甜的专业，需要学习到只是和难度都是在个专业中最难的，学法学的人要研读最厚的书，参加可能世界上要求最高的职业考试，同时在未来的工作当中恪守自己的道德底线。',1,'suitable',9,'open'),(248,'在工作和学习中阅读大量书籍并能结合内容整理自己的观点。',1,'ready',9,'open'),(249,'看大量的案例分析，并结合学习的知识表述立场',2,'ready',9,'open'),(250,'面对海量的项目能够不出错，需要你思维缜密，记忆力强，注重细节',3,'ready',9,'open'),(251,'追究正义，不屈不挠',4,'ready',9,'open'),(252,'工业工程的核心是效率科学，对工作人员、设备、材料、能源和信息构成的系统进行设计、优化和改进。工业工程需要运用数学、物理、社会科学、工程科学、计算机等知识原理对工程项目进行剖析，设计方案，并对其进行流程上的不断优化。相比于其他工程学科在一个领域进行深究，工业工程更像工科和商科的结合专业，需要掌握的知识范围更加宽广。\r\n',1,'brief',45,'open'),(253,'如果你不希望在单科工程领域做太深入的研究，喜欢工科的认真严谨也喜欢商科的现实与创造力，并且热爱研究如何更高效地做一件事，然后表达出来，那么工业工程可能会适合你。\r\n',1,'suitable',45,'open'),(254,'学习一门交叉学科，既要学习数学物理，也要学习会计和管理',1,'ready',45,'open'),(255,'研究如何帮助各行各业提高效率，比如怎么安排快递员路径能让快递最快到达所有人手中',2,'ready',45,'open'),(256,'挑选一个细分领域进行深度研究， 例如经济和金融系统、运筹学、供应链工程、数据分析等',3,'ready',45,'open'),(257,'计算机工程是电子工程和计算机科学的结合，作为一名计算机工程师，你将在人类有史以来发展最迅速的技术领域中工作。你将运用纳米电子学、计算机和新的光子晶体来创造拯救生命的生物医学仪器，以及能够搜索灾难现场或远程探索其他星球的新型机器人系统。你将制造能够收集太阳、风和海洋能量的设备和系统，并将其导入支持现代文明的能源网。\r\n计算机工程课程为你准备了广泛的工程研究和职业选择，包括商业、生物医学工程、计算机硬件、航空航天工业、计算机软件、纳米电子芯片、机器人等等。\r\n',1,'brief',46,'open'),(258,'计算机工程课程侧重于软件和硬件的开发和设计，以及两者的整合，例如计算机芯片、微处理器和传感器等，因此学习计算机工程会更强调物理知识的学习，尤其是电路相关的许多课程是计算机科学专业里基本看不到的。\r\n',1,'suitable',46,'open'),(259,'扎实的物理，数学功底',1,'ready',46,'open'),(260,'需要一定的想象力和创造力',2,'ready',46,'open'),(261,'动手制作些东西并把自己的想法变成现实',3,'ready',46,'open'),(262,'-做一个完整的毕业设计作品',4,'ready',46,'open'),(263,'公共关系专业的学生会学习如何创造和宣传个人/企业/组织的形象。\r\n每一个公司，甚至是许多有权势的个人，都需要一个公共关系团队，公共关系与广告和营销不同，它是通过培养公众的兴趣和通过免费的渠道传播信息来获得或创造他们的受众。公共关系经和专家已经成为商业组织和公众之间的基础。通过创造信息丰富和精心构建的公众形象，新闻发布，产品和服务信息，以及对公众咨询的战略回应，公共关系工作者在影响大众的认知方面处于独特的地位。\r\n',1,'brief',33,'open'),(264,'公共关系的职责包括撰写新闻稿，与媒体合作，安排采访，撰写演讲稿，做发言人，以及管理组织的多种形式的沟通，包括危机管理和内部沟通。因此需要非常外向的性格，良好的文笔和口才，以及优秀的时间管理能力。\r\n',1,'suitable',33,'open'),(265,'学习演讲稿和新闻稿的写作',1,'ready',33,'open'),(266,'掌握PS，PR等多媒体制作软件',2,'ready',33,'open'),(267,'策划媒体活动',3,'ready',33,'open'),(268,'对事物有一些感性的察觉和理解',4,'ready',33,'open'),(269,'善于与人沟通',5,'ready',33,'open'),(270,'航空公司的时间表，住房贷款利率，政治民意调查，论文成绩，最低工资的计算，一栋摩天大楼的蓝图，大到人们探索太空登录火星需要带多少燃料，小到你去菜市场买菜，双十一在淘宝如何合理使用各类优惠叠加券。尽管这些事情每一个似乎都是完全无关的，但它们都是基于数字的。数学的魅力就在于是我们人类描述万物的基本语言。从要做一件事情的上学年限，到一个人想要挣的钱，到平均拥有的孩子数，到拥有的汽车数量，我们的生活在很大程度上可以衡量，根据数学原理进行计划和组织。\r\n',1,'brief',29,'open'),(271,'在应用形式和理论形式上，数学都是科学探究的最古老形式之一。这对于逻辑，计划和防止社会混乱至关重要。随着技术的进步和突破新的障碍，这种经典的思想，实验和探索主题不断得到更新。因此，计算机科学，经济学和工程学都取决于数学家的才能。\r\n',2,'brief',29,'open'),(272,'不断挑战自己大脑的极限去解决问题',1,'ready',29,'open'),(273,'专业课程会越来越抽象和复杂',2,'ready',29,'open'),(274,'如果热爱纯数学并希望走研究方向，需要继续读细分领域的硕士甚至博士',3,'ready',29,'open'),(275,'如果只是觉得学习数学为了锻炼自己思维方式，那你最好准备双主修或者辅修另一个专业\r\n',4,'ready',29,'open'),(276,'你需要非常好的数学功底和数据处理的技术技能，包括如何使用Excel以及VBA或Python等编程语言，你还需要学会在每天学习和工作中不断思考和解决问题。因此除了要有良好的数学基础之外，也需要具备经济和人文方面的素养。\r\n',1,'suitable',10,'open'),(277,'大量的微积分等数学和统计相关课程',1,'ready',10,'open'),(278,'掌握一些编程语言',2,'ready',10,'open'),(279,'需要对现实世界有一定的观察',3,'ready',10,'open'),(280,'准备精算师的相关考试',4,'ready',10,'open'),(281,'金融工程是一门综合了金融学、数学和计算机科学的交叉学科，课程通常由大学的商学院、数学系和工程学院联合授课。课程通常包括股票市场分析、投资组合分析、期货和期权、资产定价、资本预算、固定收益分析、利率模型、金融风险管理等内容。由于金融投资工具的复杂，一些基金管理公司越来越感到传统的投资方式难以保持基金的持续赚钱能力，他们需要设计出更加高级的投资组合来获得盈利。因此，他们大量需要那些既通晓金融市场又有数学应用能力的复合型人才，而这样的人才在市场上极为稀缺。金融工程就是为了培养这样的人才而诞生的。\r\n',1,'brief',27,'open'),(282,'金融工程是一个对背景要求非常综合的专业。一个好的金融工程人员必须要能够利用编程去测试自己新的交易想法和模型，你要能够处理大量的数据，建立起自己的策略平台。你要懂得和理解各类衍生品交易的规则以及市场背后博弈的逻辑。一个好的金融工程师一定是能够在学术和实际市场中找到很好的结合。\r\n',1,'suitable',27,'open'),(283,'培养自己的抗压能力，能够适应高强度工作',1,'ready',27,'open'),(284,'学习大量数学相关课程，比如微积分，线性代数，统计等',2,'ready',27,'open'),(285,'对于金融市场各类交易工具的深刻理解',3,'ready',27,'open'),(286,'从现在开始就培养好扎实的编程能力',4,'ready',27,'open'),(287,'不是所有喜欢动物的同学都适合学动物科学，动物科学主要研究的是人类掌控的动物比如宠物和牲畜水产，如果对野生动物感兴趣的应该去了解生物学的分支之一动物学（Zoology）。学习动物科学首先得认识到这是一门需要解剖动物以及去农场实地研究的专业，因此你需要对此有基本的心理承受力，另外动物科学作为一门理科有很多数学化学和生物课程也是必修的。\r\n',1,'suitable',8,'open'),(288,'有很多实验课是要在农场和牧场中度过的\r\n',1,'ready',8,'open'),(289,'在实验室解剖相关动物进行研究\r\n',2,'ready',8,'open'),(290,'未来相对远离都市的生活方式\r\n',3,'ready',8,'open'),(291,'本科阶段学习比较泛，如果想深挖一个方向需要准备好读研读博',4,'ready',8,'open'),(292,'统计学是一门处理数据的收集，组织，分析，显示和解释的学科。统计学专业是具有较强数学技能的学生的良好选择，其兴趣范围从生物学，社会科学和物理科学的研究到法律，医学，政府决策，金融，会计，工程和精算工作的应用。统计学强调的是数据产生的背景，根据背景寻找合适的抽象方法和推断方法。统计学大体分为四个研究方向：数理统计、金融统计、应用统计和生物统计。许多统计学专业的学生都拥有第二专业，以便把统计学知识应用到其他专业。\r\n',1,'brief',31,'open'),(293,'你需要有扎实的数学基本功，以及对数字敏锐的嗅觉，其次你需要有很强的逻辑分析能力与清晰的表达能力，把抽象的数据转化成易懂的文字，当然你也需要有足够的耐心和细心去处理大量的数据。\r\n',1,'suitable',31,'open'),(294,'设计研究，收集和分析数据，并提供有关结果的报告',1,'ready',31,'open'),(295,'学习代数和计算机，学习描述和分析数据所需的技能',2,'ready',31,'open'),(296,'学习很多数学课程，包括微积分等',3,'ready',31,'open'),(297,'培养你的口语和写作技能，以便与团队中其他人更好地沟通',4,'ready',31,'open'),(298,'电子与电气工程往往会分开讨论，因为电子工程（Electronic Engineering，简称EEE）通俗意义来说研究的是弱电，探索如何用电传输信息，和计算机工程有很多相似之处；而电气工程（Electrical Engineering，简称EE）通俗意义上来说研究的是强电，探索如何用电传输能量，例如国家电网如何铺设。它们在工程类专业中是最大的领域，影响着其他工程行业的发展，涉及巨大的研发经费和市场利润，从灯泡和手机芯片到电动汽车和飞机电路再到如何为城市和国家设计发电系统。本专业会设计到非常多而广泛的基础学科知识比如：数学、物理、计算机等等。',1,'brief',35,'open'),(299,'首先你需要对身边各种电子和科技产品充满好奇，并希望了解他们是怎么工作的，当然你也得有足够的想象力和动手能力把点子变成现实，同时有着不错的数学和物理基础并愿意进行团队合作。\r\n',1,'suitable',35,'open'),(300,'主动学习，因为电子和电气工程是一个不断进步不断创新的行业',1,'ready',35,'open'),(301,'很好的数学和物理功底\r\n',2,'ready',35,'open'),(302,'希望通过自己的设计和发明帮助他人\r\n',3,'ready',35,'open'),(303,'和不同人沟通从而完成团队项目',4,'ready',35,'open'),(304,'影视作品里每一个场景，都是经过精心的构思，从演员站的位置到沙沙的树叶声，从灯光照射角度到背景音乐，所有的细节都是为了更好地诠释剧本中的文字。如果你主修影视制作专业，你会了解人、想法和技术是如何共同创造出我们身边的影视作品的。你将学习如何制作电影和电视节目，探索影视场景中每个人的角色，此外，你还会学习其他艺术相关的知识。\r\n',1,'brief',48,'open'),(305,'你需要有一定的创造力，观察力和较高的视觉审美标准，以及对各种影视作品有自己的独特见解。其次你需要有足够的耐心以及和他人共同合作的意识，当然你也需要有非常强的时间观念并学会在压力下完成任务，因为对影视行业来说，时间就是金钱。\r\n',2,'suitable',48,'open'),(306,'一次又一次地拍摄和编辑自己的影视作品从而达到完美\r\n',1,'ready',48,'open'),(307,'自己花钱买设备和道具等等\r\n',2,'ready',48,'open'),(308,'在其他人的项目里需要听从指挥\r\n',3,'ready',48,'open'),(309,'花大量时间管理演员、设备、工作人员、场地等杂事',4,'ready',48,'open'),(310,'接受老师和同学的批评\r\n',5,'ready',48,'open'),(311,'护理专业的学生需要在理论与实践之间进行交叉学习。护理是对身体，情感和心理素质要求很高的职业道路。一名护理学毕业生与患者及其家人，医生，护士同伴和工作场所中的其他卫生专业人员一起工作，因此沟通和人际交往能力非常必要的。\r\n',2,'suitable',24,'open'),(312,'清晰和理性的判断能力',1,'ready',24,'open'),(313,'有同情心，关爱他人',2,'ready',24,'open'),(314,'能够准确地进行口头和书面交流，尤其是和病人',3,'ready',24,'open'),(315,'为来自不同社会文化地区和阶层的个人和家庭提供护理',4,'ready',24,'open'),(316,'适应不同的情况和人群，在医院的情况总是会复杂多变的',5,'ready',24,'open'),(317,'在压力中保持学习，在失败中学习教训和经验',6,'ready',24,'open'),(318,'自己能够保持情绪稳定',7,'ready',24,'open'),(319,'环境工程的实践可以追溯到文明之初。自从人们开始在半永久性居住区生活以来，他们就不得不面对提供清洁水和处理固体废物和污水的挑战。随着城市的发展，大规模农业和制造业的出现，人们也不得不担心空气质量和土壤污染问题。环境工程学主要研究运用工程技术和相关学科的原理，保护并合理利用自然资源，防治环境污染，以改善环境质量的学科。 环境工程的主要内容包括大气污染防治工程、水污染防治工程、固体废物的处理和利用，以及噪声控制等。\r\n',1,'brief',54,'open'),(320,'上很多生物、化学、地理、物理等基础课',1,'ready',54,'open'),(321,'掌握良好的沟通能力和社交技能，从而更好地完成团队项目',2,'ready',54,'open'),(322,'不怕辛苦和户外的活动（例如工地）',3,'ready',54,'open'),(323,'喜欢调查和研究事物，保持好奇，理性而又充满逻辑\r\n',4,'ready',54,'open'),(324,'如何维护世界和平？如何解决全球性的资源问题？全球变暖该在政策上如何面对？我们应该彻底开放国际合作吗？政治科学要求学生从理论和实践上研究政府，探讨与政治理论、国际关系、比较政治等相关的主题。毕业后可以使继续学法律、国际关系、社会学、经济学等专业。政治科学专业的学生还可以在学习期间获得在联合国、律师事务所、非政府组织等机构实习的机会。\r\n',1,'brief',50,'open'),(325,'你需要对国内和国际政治的话题有一定的敏感度，平时喜欢对新闻中的各类事件有所思考。学习政治科学科学需要有很强的的辩证思维和表达能力，课堂中会有大量需要辩论的话题等待着你的参与。\r\n',1,'suitable',50,'open'),(326,'和同学老师就一个热点话题进行辩论',1,'ready',50,'open'),(327,'阅读大量相关书籍以及大量写作',2,'ready',50,'open'),(328,'关注时事，并对其展开个人思考',2,'ready',50,'open'),(329,'尽早定好论文方向，从而能够收集更多观点',4,'ready',50,'open'),(330,'地质学学习的内容很多，有古生物学，地层学，环境学等。你必须能够有很好的写作能力，同时能够使用高级化学，物理，数学，统计学等方面的知识。你还需要能够使用复杂的设备以及喜欢户外活动。\r\n',1,'suitable',4,'open'),(331,'学习地质学相关的科学课程比如化学、生物和物理',1,'ready',4,'open'),(332,'去各个重要的地质研究景点进行现场学习',2,'ready',4,'open'),(333,'采集的样本需要在实验室做长时间的研究',3,'ready',4,'open'),(334,'如果简单来说的话，物理学是一门试图理解自然法则以及能量与物质之间关系的科学。但是，我们将物理学理解成为一种思考的方式可能会比将其想成一个专业或者职业要更合适。物理学领域训练学生在可能遇到的任何情况下都采取逻辑，解决问题的方法。物理系学生探索可应用于许多不同专业领域和研究主题的科学概念和方法。\r\n\r\n',1,'brief',44,'open'),(335,'物理学涉及从亚原子粒子到黑洞以及宇宙整体结构的所有事物。物理学家使用数学公式来试图解释他们的理论并做出预测。但是物理学也关心事物如何在更实际的水平上工作。物理定律适用于工程，通信，生物学和电子学等领域。激光和半导体等技术的发展源于物理学的开创性工作。没有物理学的突破，电脑，手机和相机将不复存在。',2,'brief',44,'open'),(336,'物理学实际上是对世界如何运转的研究，并且可以被认为是所有科学中最基础的。物理学的目的是发展总结自然规律的理论，并导致人们理解事物为何如此运转。物理学的基础知识可以应用于大多数其他科学，因此，许多人将物理学作为其他研究或专业领域的跳板。',3,'brief',44,'open'),(337,'打算在大学学习物理的任何人都应该考虑在高中阶段进行大量代数课程的课程，并在可能的情况下进行微积分和三角学课程。当然还有自然科学课。\r\n\r\n\r\n',1,'suitable',44,'open'),(338,'非常好的数学功底',1,'ready',44,'close'),(339,'非常好的数学功底',1,'ready',44,'open'),(340,'很强的逻辑思维',2,'ready',44,'open'),(341,'喜欢思考，好奇万物运行规律',3,'ready',44,'open');
