INSERT INTO `program_testimonials` VALUES (1,'LISA','“我一个已经成为CPA （注册会计师）的朋友告诉我，在学校上的课有时候挺无聊的，但一旦工作后进入商业环境，会很激动，并觉得学到的知识都很值得！”','华盛顿大学','会计和国际商务专业','大四',1,'open'),(2,'Full Name','Feedback goes here','School Name','Program','Grade one',1,'close'),(3,'client1','feedback 1','school 1','program 1','grade 2',3,'close'),(4,'Joyce','金融专业下面细分的子专业非常多，你要在本科阶段就要有一个你未来想发展的方向和行业的规划。这个专业因为比较注重实践，所以在本科和研究生阶段一定要积极的去做相关的实习和考证，比如说CFA，FRM，CPA这类的证书。然后暑假时间，去在券商，银行会计事务所这类的大机构去实习，积累自己的经验。这个专业毕业后可以去的工作和机构非常多，所以你一定要有自己细化的强项和行业理解。好的工作会卡背景，有工作实习经验和没有的在应聘是差距会很大。需要实时的积累自己的人脉和不断学习金融市场的发展和产品。','剑桥大学','金融学','硕士',3,'open'),(5,'Howard ','很多人说生物专业很坑毕业找不到工作，主要是因为本科生物学的还是太泛了，如果真想要在生物领域做技术或者研究相关工作至少也得是研究生，多数甚至都是博士，所以一定要尽早选好细分领域，比如我目前主攻的生物统计方向。','加州大学洛杉矶分校','生物统计','博士在读',2,'open'),(6,'高同学','我觉得土木工程最有意思的是需要在”科学的确定性“和”自然环境的不确定性“中找到一种平衡。很多人说土木工程就是搬砖，未来工作环境很差，但其实土木工程是设计如何高效并有秩序地搬砖，很少有真的搬砖的，因为大部分我身边的同学都会选择去设计院、造价咨询公司、四大事务所五大行等等，并不会长期呆在工地里。','伊利诺伊大学香槟分校','土木工程','本科毕业',5,'open'),(7,'Dan','当年因为亲人患病，立志学习生物医学工程，就是希望可以在未来帮助到病人，这一直是我学习的动力，尽管课程非常繁重，但总觉得比那些学机械和电子工程的多懂了医学，比那些单纯学医的多懂了技术方面的知识还是很有成就感的。毕业出路的话我知道很多学长学姐并没有进入医院或者医疗器械公司，因为学习的知识也满足很多互联网公司的需求。','约翰霍普金斯大学','生物医学工程','研究生',6,'open'),(8,'Erik','机械工程应该算是涵盖范围最广的工科专业了。通过几年下来的学习和实践，你可能会在汽车厂商做硬件设计，或是在生产流水线上做质量管控，或是在机器人创业公司做智能化，甚至或是在四大提供运营咨询服务。而在就业面广的同时，这也意味着你需要找到适合自己的选择。所以我建议同学们可以在大一大二甚至高中尽早的多花时间去了解和细化你的发展方向，以便在高年级能术业有专攻。','康奈尔大学','机械工程','本科毕业',32,'open'),(9,'Sandra','之前很多人觉得人类学家是很冷门的专业，因为毕业了都只能在学校当老师或者去穷乡僻壤做调查，其实现代商业对人类学有着越来越多的需求，很多基于人类学理论的商业分析公司正在帮助越来越多的中国公司打通不同文化背景的用户群，从而增强产品力。 之前在上海一家市场研究公司做人类学研究员，客户都是可口可乐、苹果、达能、雅诗兰黛等跨国企业，做研究经常能和许多非常有趣的人打交道。','伦敦大学亚非学院SOAS','人类学','研究生',13,'open'),(10,'Kathy','社会学听起来是个很学术的专业，很多家长的印象也是毕业了去学校或者政府机构，其实很多咨询公司甚至越来越多的互联网公司也需要社会学专业的毕业生，因为在市场研究领域社会学的方法论其实非常实用。','伦敦政经LSE','社会学','研究生毕业',14,'open'),(11,'Henry','很多人都问我康奈尔酒店管理毕业了去酒店做个大堂经理不是很亏，事实上我们专业的同学毕业了只有三分之一进入酒店、餐饮和活动策划相关行业，有三分之一进入了地产咨询行业，还有三分之一进入了金融、科技和其他行业，所以没那么局限啦！','康奈尔大学','酒店管理','本科毕业',18,'open'),(12,'Tammy','我是高中去英国读A-Level的，说实话无论哪个英国的医学院要求都比较高，对于国际学生而言更困难，前期一定要做好研究工作，比如对UKCAT或者BMAT分数要求、PS和Reference的重视程度。个人觉得最难的是面试环节，毕竟非母语还是有压力的，所以一定要多准备下。','伦敦大学学院UCL','医学院','本科',11,'open'),(13,'Dana','我越学越发现建筑学是一门集合了艺术、科学、哲学、音乐、历史、心理学和文学的超级综合学科。','弗吉尼亚大学','建筑学','本科',25,'open'),(14,'Shawn','有些大学经济学专业是放在人文社科学院下的，但也有很多经济学专业是放在商学院下面的，因为经济学和商学之间是有非常多相通的课程的，所以我建议如果你选修经济学专业的话，尽量的去多学一学商科相关的专业选修。而且一定要注意经济学和商科金融这些专业的区别，经济学更偏理论而商科金融更加注重实际操作和金钱这方面的因素。除此之外，我强烈推荐学习行为经济学和心理学，这两门课会对你的未来发展有很大的帮助。学习完经济学之后，你会觉得打开了世界新的大门，看这个世界的角度也不一样了。','多伦多大学','经济学','本科',34,'open'),(15,'Grace','国外的心理学很多有文、理科之分，取决于不同的学校和不同的专业。文科心理学更偏重社会心理、商业心理、教育心理等，毕业后学生多从事商业、教育类工作；理科方面则更偏重于生命科学系，比如临床心理学，更多的是学习大脑结构，毕业后学生会从事初级医药类工作，或进入医学院攻读研究生或博士学位，成为医生、药剂师，心理咨询师等。心理学的不同分支很多，也不是电视剧里常常演的毕业后就会“读心术”或天天跟人聊天进行心理辅导。选学校时需要更多得了解该专业的课程设置，再看看是否和你的兴趣一致。本科期间的心理学课程非常广泛，通常建议学生在主修心理的同时再进行一门副修，可以选择商业、经济、法律、等其他专业，具体副修也取决于各个大学不同的课程设置。','滑铁卢大学','心理学','本科',12,'open'),(16,'Michelle','很多人觉得学艺术是一个烧钱且回报率通常很低的事情。对于交互设计来说并不一定，在美国交互设计不仅和计算机工程一样属于STEM类专业，毕业后找工作并不算难而且起薪一般都还不错。最重要的是我觉得国内越来越多的后浪们开始不仅追求产品的实用，对设计审美上也有了自己的追求，所以我还是比较推荐我们专业的。','加州艺术学院CCA','交互设计','硕士',22,'open'),(17,'Jeffery','读植物学前期要记忆的东西挺多的，什么植物俗名细胞结构，以及纲门科属种等，还有好多乱七八糟的拉丁文，本科毕业其实很大一部分同学都会继续读细分领域的硕士，比如环境工程和农业工程等，也有一部分毕业了去一些知名的农业科技公司比如大家熟知新奇士、都乐等，国内的话我听说很多植物学专业的学生会去林业局农业局等国家单位，还有学术能力比较强的会去中科院植物研究所。最后想分享一个同行的话，说学植物学其实是学会和世界相处的方式，在他们生物特征和遗传信息里蕴藏着和世界相处的道理，而这些不在实验室，也不在植物园，它就在你身边随处可见的地方。','普渡大学','植物科学','本科',51,'open'),(18,'Bonnie','做教育工作者是一件很有成就感的事情，而且也很好找工作，并且工资也不低。很多人认为学教育就是做老师，但教育市场太大了，除了老师还有很多其他职位需要被开发，比如教育产品研发，教材撰写，国内这块需求量现在越来越大，我认为是个朝阳产业。',' 伦敦大学学院UCL','教育学','硕士',16,'open'),(19,'Alison','来LSE读Marketing之前以为更多的是学营销知识看广告案例写写东西，结果居然有好几门编程课，作为文科生开始很懵逼，但后来发现还是挺实用的，最近看了尼尔森这种行业大公司招聘岗位发现确实多数都需要数据分析能力。\r\n','伦敦政经','市场营销学 ','硕士',20,'open'),(20,'Lance','第一句还是要重复一下重点：语言学不是学语言。尤其是应用语言学，越往后学越会发现更像个理科（毕竟我也是拿了个Master of Science哈哈），需要很强的逻辑思维甚至是建模能力，因此很考验人的综合素质。很多人说语言学毕业不好找工作，但我身边硕士毕业后很多进入了阿里巴巴做语言学专家，做语料库分析，帮助优化机器翻译等工作。\r\n','爱丁堡大学','语言学','硕士',37,'open'),(21,'Cathrine','在英语国家学习难免会有文化差异，一定要带着包容的态度去了解他们的文化，这样他们也会更愿意了解你的文化。当然大量的阅读和写作肯定是少不了的，这点一定要做好心理准备。很多人觉得语言类专业都很水，毕业找不到工作，我觉得任何专业学得好的自然都有出路，我同学中有做同声传译的日赚8000，还有很多去机构做老师，还有做教材研发的，赚的都不少。\r\n','巴斯大学','创意写作','硕士',39,'open'),(22,'Max','某乎上有不少劝退食品科学专业的学生的，主要原因还是薪资问题上，确实如果想像金融专业那样寻求暴富那食品科学专业真的不适合你，我当年选择这个专业还是源于一个吃货对食物的热爱，并且认为可以用理科思维去探索一个感性的领域还是很有趣的。其实毕业后整体而言找工作不难，国内起薪会不是很高，而且增长较慢，因为这毕竟是个比较饱和的行业，当然我们专业学的不错的大多都能进ADM，邦吉，嘉吉，路易达孚这四大粮商，或者亿滋、联合利华、玛氏这类大厂。还有一些有渠道的朋友在学习三只松鼠的模式自己做食品类创业也很有意思。','康奈尔大学','食品科学','硕士',43,'open'),(23,'Jack','人力资源专业由于是非常综合性的管理类专业，所以其实对于我来说有很大的挑战，就是如何把各类的知识学习并加以利用。在进入人力资源这个工作之后，我觉得最大的挑战就是要针对不同的公司和社会的发展，去不断的更新自己招人的方法。比如说最近我的外企老板就有说到关于海归招人的担忧，因为中国的发展实在太快，所有在招聘海归的时候会觉得他们不接地气而且性价比不如国内的学生。但是海归也有着非常明显的优势比如良好的沟通能力和软实力。针对企业的发展和需求，结合中国社会的发展，人力这个岗位是要不断接受挑战的。除了招聘面试之外，公司内部的人员也要有很多的管理和考核需要去做，我觉得学习人力资源是蛮有意思的，因为我们最该研究的就是我们人自己嘛哈哈。','纽约大学','人力资源管理','硕士',23,'open'),(24,'Penny','作为一路读营养学读到phd的老学长，想告诉各位同学营养学还是一个非常有市场需求的专业，因为随着慢性病的增加以及大众对健康饮食意识的提高，专业的营养师还是很吃香的。毕业后的路大体分三种，一种是临床，在医院做营养医师，通常需要再考医学院；第二种美国这边叫社区营养，因为这里大多数中小学都会配备营养师，包括运动队的营养师，还有很多餐饮机构也需要有资质的营养咨询师；第三种就是读研读博做细分领域的研究。我是属于第三种，研究分子和基因层面的课题，比如膳食纤维对肠道菌群和人体免疫系统的影响等。\r\n','波士顿大学','营养学','博士在读',42,'open'),(25,'Vanessa','城市规划专业最有意思的莫过于有机会去各个地方探索它们未来会变成什么样子。上学的时候最有意思的课也是跟着老师去学校以外的城市进行实地考察，边玩儿边研究规划前辈们的奇思妙想。','曼彻斯特大学 ','城市规划','硕士',21,'open'),(26,'Stephanie','首先学艺术管理一定要在大城市，当年因为喜欢英国所以来了伦敦，觉得真的太正确了，因为大多数核心艺术资源都会集中在伦敦啦纽约啦这些大城市，各种展也非常多。我觉得艺术管理这个专业跟多数商科一样是需要以实践为主的学科，因为学校学再多也不如真的参与到一次完整的策展计划来的更直接，当然学校学的关于财务和市场分析的课也确实可以帮我在实践中更好地进入策展中的角色。最重要的当然是能有机会和自己的爱豆近距离接触的机会啦，第一次见Coldplay主场Chris的时候可把我激动坏了哈哈哈！\r\n','伦敦国王学院 ','艺术管理 ','硕士',53,'open'),(27,'Avery','很多人一听到我学CS（计算机科学）专业第一反应就是我是个写代码，简称码农。这样理解这个专业还是蛮狭隘的。其实CS专业有很多不同领域细分的研究方向比如系统、信息安全，软件工程，机器学习，最近大热的人工智能等等。但是这个专业的确对脑力有很大的要求。\r\n','滑铁卢大学','计算机科学','本科',30,'open'),(28,'Yvonne','网上很多黑化学专业的说找不到工作blabla怎么惨，事实上你选择化学这么一个纯理科作为本科专业之前就应该认识到，如果真要在这个领域有所建设，那读个研是最起码的事儿，而且学好了化学的底子，研究生去搞化工、材料、生化、医药都很好申请。我们化学本科毕业的学长学姐不读研直接去工作的只有不到10%，大多数靠化学的背景都申请到了不错的研究生项目。\r\n','帝国理工学院','化学','本科',28,'open'),(29,'Vivian','大家一定太注意区分Business Analysis和Business Analytics这两个专业。前者是一个纯商课的专业。一般开设在MBA下面，主要的学习内容是分析整个公司的运营流程等业务方面。属于案例分析为主，并且用简单的数据分析作为辅助。这样的专业一般会服务于咨询公司，或者是在企业的战略咨询部门。\r\n而Business Analytics则是一门新兴学科，它更加偏重对于编程的要求，主要的核心学习是偏向数据挖掘和数据分析和现在比较流行的大数据很相关。一般服务的公司包括很多大型互联网公司，如百度，腾讯，阿里，美团这样的公司。\r\n不管怎么说，如果在你的学习中，你的编程水平如果比较高的话，对你未来的就业都会有很大的帮助。','哥伦比亚大学','商业分析','硕士',26,'open'),(30,'Anna','其实本科学习工商管理（BBA)更像是一个探索自己的过程，课程基本涵盖了商科的各个科目，学到大三发现自己对市场营销学更感兴趣，于是后面课程就选择了市场营销方向。大家经常以为工商管理就是MBA，MBA作为研究生项目通常是面对有三年以上工作经验的人的，更多的不是学习理论知识，而是分析现实商业案例和社交。','多伦多大学','工商管理','本科',52,'open'),(31,'Sammy','学习新闻传播对写作要求非常高，尤其用非母语写作的话对语言要求就会很高。其次无论是对于申请或者是毕业后找工作来说，工作和项目经历会非常重要，尤其是需要有独立进行新闻采集、编辑、写作等各方面的锻炼。我在纽约时报实习的时候压力还是很大的，因为需要提前安排好很多事情，在极其有限的时间内完成稿件。此外对于当今国内新闻环境而言，比较推荐大家去做些财经商业类的，为什么不推荐其他，道理大家都懂。','塔夫茨大学 ','新闻传媒','本科',40,'open'),(32,'Sandy','考古学是在如今国内社会争议很大的专业，大部分声音都是说它如何如何坑，选了就是踩雷，理由无非就是不赚钱。可我觉得比钱宝贵的东西太多了。能在田野场地里穿越古今，用科学方法重现历史的快乐对我来说是无价的。当然，还是得提醒下学弟学妹们，这个专业在脑力、体力、意志力上都需要付出相当代价，因为考古的价值很难短时间得到体现，我身边同专业的同学很多都会继续读研究生甚至相关博士，当然也有转专业到人类学、社会学甚至经济学这样的社会科学的。至于走进社会的那些同学，有的在博物馆和展览馆做相关策展，有的成立了自己的媒体频道做文博知识网红，还有的去了苏富比佳士得这种拍卖公司。总之大家能做自己喜欢的事都挺开心的。\r\n','牛津大学','考古学','硕士',19,'open'),(33,'Rick','和中学学历史完全不同的是，大学学历史几乎没有任何要背诵和记忆的地方，更多的都是需要你去大量阅读后做出自己的分析，是一门严谨的逻辑科学，这也是为什么美国这边很多本科学历史的研究生会去申请法学院。历史学里没有真像，更多的是探寻无限接近真像的过程。因此学历史是一件非常锻炼人思维能力的事，毕竟它包括了太多的其他学科，比如生物学、经济学、社会学、人类学、心理学、哲学等等。\r\n','耶鲁大学','历史','本科',15,'open'),(34,'Abby ','作为读了六年的Pharm D狗，想告诉大家Pharm D和制药科学虽然学的内容有很多重叠，但未来做的事情差别还是很大的，所以各位学弟学妹们一定要慎重选择方向。制药科学更多会深耕在研究领域，而我们Pharm D毕业了是和人打交道为主，除了病理和药物的硬知识以外，更需要和病人沟通，甚至和医疗行业不同的人针对质量方案进行合作交流，以及了解相关保险和法律知识，所以一定要丰富自己的工作实习经验。当然学习期间背背背是少不了的，这点也要做好心理准备。\r\n','密歇根大学安娜堡分校 ','药剂学','博士',7,'open'),(35,'Phil','学哲学是个内省的过程，和商学以及社会科学不一样，学习阶段不会花太多时间在社交上，而是大量阅读、思考和写作。其实对比上大学前那会儿纤细敏感觉得与身边环境格格不入的我，学习哲学的确锻炼了批判性思维，也培养了我更加全面看待问题的能力。所以哲学生很多毕业后都会去考法学院，或者去学政治科学和社会学人类学之类的，要么本科就干脆修双专业。大家学哲学的目的我认为不是为了一个结果，而是从阅读和思考的过程中产生满足与快乐。\r\n','威廉玛丽学院 ','哲学','本科',55,'open'),(36,'Shirley','作为化工系女生当年刚进学校紧张兮兮以为班上都是男生，结果发现比隔壁机械工程的女生数量多多了，后来听说有很多学姐都去了日化公司比如联合利华和宝洁，以及化妆品公司比如雅诗兰黛和欧莱雅做产品开发，就明白了为什么。不过其实学化工还是比较苦逼的，原本以为化学好就行，结果大三大四的课基本都是热力学、流体力学之类的物理课，因为毕竟是工科，实现规模生产离不开物理和数学知识，所以不喜欢理科的姐妹们还是要慎重点儿。','加州大学伯克利分校','化学工程','本科',47,'open'),(37,'James','运动医学其实有很多类似专业比如运动康复和物理治疗等，门槛会低一些，时间也会短一些，但毕竟不是医生，所以在治疗方面会有局限。对于国内环境来说，市场还在被教育，因为传统医学对骨骼肌肉部分不太重视，跌打扭伤以为涂红花油贴狗皮膏药就行了，其实要分析的因素非常多，越来越多的人也在发现运动医学的重要性，尤其是到了老年化比较严重的阶段，需求量也在上升。所以如果能啃下来运动医学专业，前景还是不错的。\r\n','南加州大学','运动医学','MD',38,'open'),(38,'Kevin','从法律专业毕业后的工作前景其实是非常广泛的。只要大家知道你有过学习法律的背景一般来说都是会高看你一眼的。法学的课程和很多学科都有联系：历史（法制史）、哲学（法理学）、政治学（宪法和行政法）、经济学（商法、经济法）、社会学（法社会学）等等。如果你对很多社会现象都有好奇心，那么法学会给你提供一个比较好的测量社会的维度。','杜伦大学','法学','LLM',9,'open'),(39,'Ethan','开始对工业工程感兴趣是源于一本关于供应链管理的书，介绍了各种案例，工厂如何通过整体逻辑去优化供应链从而给企业带来更大价值，然后一实习发现实际操作和学习相差的还挺大的，因为每个企业都不一样，所以无法照搬书上学到的去做，但万变不离其宗，当自己能根据企业情况设计出一套真正提高效率想系统的时候，成就感还是贼大的。','佐治亚理工大学','工业工程','本科',45,'open'),(40,'Aaron','大家一定要注意计算机科学和计算机工程这两个专业的区别。简单来讲，计算机科学专业主要学习和研究软件开发领域，更偏重于理论研究以及编程。\r\n而我所学的计算机工程专业则更聚焦在计算机硬件领域，更具应用性。但是我们也是需要学习编程的，硬件的驱动和控制还是需要有很扎实的编程基础。所以我们计算机工程的人是又要软又要硬。所以可以探索的方向就会很多。','普渡大学','电气与计算机工程','本科',46,'open'),(41,'Karen','尤其是对于我们留学生来说，公共关系这个专业最大的挑战可能就是写作和演讲了。我的建议是，如果你对改变很多企业形象很有兴趣，或者你也追星看自己的爱豆如何树立自己的人设应对丑闻危机等等，那么这个专业比较适合你。它会教会你如何成为一个很好的沟通者（communicator）。公关的课程有很多实际的案列，所以我特别喜欢这种比较接近现实的知识应用。','纽约大学','公共关系与企业沟通','硕士 ',33,'open'),(42,'Joy','本科数学系的课程都比较难。而你学的很多课程是没办法直接转换成生产力的，或者你必须想好一个未来利用数学进入的别的专业和职业，比如数学可以和工程很好的结合，或者研究生去读金融工程。很多数学系的老师们可能会比较学术而很少有在工业界工作的经历，所以你要明白数学是非常有用的，但是你要知道怎么用。\r\n','伦敦大学学院UCL','数学','本科',29,'open'),(43,'Lindsey','学习精算学是需要考十门精算学考试才能成为认证的精算师（当然你学校学习的精算课程可以免除几门考试）。这是一个漫长和艰难的道路。因为精算是非常专的学位，在保险业之外，大多数人都不知道这是什么。你也可以在本科阶段就读数学，统计学，工程学或物理学，打下很好的数学基础。然后在研究生阶段申请精算也是可以的。如果你本科阶段读了经济之类的专业但是有微积分和线性代数的课程并且成绩不错，也是可以申研选精算的。我们学校有很多精算的小伙伴都是大二从数学系之类的专业转到精算的。','不列颠哥伦比亚大学UBC','精算','本科',10,'open'),(44,'Jim','这个专业一般是研究生阶段开设。你可以在本科阶段学习数学，统计，数量分析，计算机这些专业来积累自己的数学和编程的知识和能力。在我的工作经历中，我发现金融工程的就业竞争还是非常激烈的，各类机构招人的数量不是很多。国内这一块还是在起步和发展阶段。这个和我们国内的金融体系也有很关系的。','哥伦比亚大学','金融工程 MFE','硕士',27,'open'),(45,'Emilia','其实只要对解剖不会产生生理不适，动物科学是非常有趣的学科，我们当时大一就开始解剖各种鱼虾，再到大二去学校附近牧场看奶牛怎么繁殖和产奶，再到大三给兔子插管做手术，你真的会感叹生命的神奇。本科打好基础研究生选择兽医和动物营养学什么的也会比较容易，毕竟美国这边本科也学不了兽医，现在宠物行业国内刚兴起，毕业回国就业基本很容易。\r\n','加州大学戴维斯分校','动物科学','本科',8,'open'),(46,'Jack','学习统计学是一个很酷的事情，因为从某种角度来说你真的可以掌握“预测”未来的神奇技能。比如如果有足够的数据，我可以通过一个人的睡觉时间，生活习惯，家族病史等等方面的数据，利用统计学的很多方法去探知你得心脏病的概率有多少。我觉得是这一个应用性特别广的专业。','加州大学洛杉矶分校','生物统计学','博士在读',31,'open'),(47,'Jonny','电子工程相比计算机是个更加综合的专业，大学四年什么数学物理计算机课都会涉及到，虽然每个领域不会研究太深，但我觉得做工程师更加需要这样的综合素质。还有电子行业发展太快了，尤其有的硬件大一还是先进产物，大四就被淘汰了，所以确实得不断学习。','滑铁卢大学','电子和电气工程','本科',35,'open'),(48,'Rudy','很有幸能到全世界影视行业最集中的地方读影视制作，小时候看小说总会脑补如果让我把它变成电影，我会怎么拍，如今确实实现了曾经的梦想。虽说热情足够，现实却是学习压力非常大，因为电影制作不同环节需要不同技能，所以会遇到自己不擅长的领域但也要死磕那种。但无论怎么辛苦，看到自己作品最终上荧幕的时候总觉得一切都是值得的。\r\n','南加州大学','影视制作BFA','本科',48,'open'),(49,'Stacy','在国外医务人员都非常受到普通民众的尊重。病人入院后，医生大部分时间都不在病人身边。所有病人病情的紧急程度必须由注册护士立刻进行判断并决定是否进行任何医疗干预并且告知病人的主治医生。因此RN（注册护士）必须具备独立的判断能力，能在不同临床情况下做出安全正确的决定。同时RN也必须具备非常好的的英语沟通能力，才能和医生，病人和其他医疗人员无困难的沟通，达到护理病人的目的。这也是我学习中最大的挑战之一。\r\n','爱丁堡大学','护理学','本科',24,'open'),(50,'Dimitri','整体来说环境行业在美国的市场还不如现在中国繁荣，因为美国已经过去高污染那个阶段了，现在只要在之前的技术成果上吃老本就好了。而中国越来越重视环境保护了，青山绿水就是金山银山已经年年都在说了。至于未来发展方向，可以去做环境咨询，企业EHS（健康环境安全部门），环保投资领域，或者继续研读博士。\r\n','伊利诺伊大学香槟分校','环境工程','硕士',54,'open'),(51,'Steven','我特别喜欢有一个人说过：学政治学不代表你要去从政但是你能够更懂这个世界。\r\n选择这个专业的时候真的还没怎么考虑过未来的就业，可能自己有些理想主义吧。在学校的时候会经常和不同国家的人坐在一起讨论着全球的重大议题比如难民问题，极端组织问题，全球化问题等等，尤其是现在民粹主义的问题，会有一种脱离现实但又深入世界的交错感。感觉自己看到了更大的世界，更全面的世界。这个专业是一个逼着你不断去思考的专业，而你发现原来世界从来没有简单的对错，这也算是成长吧。\r\n','哥伦比亚大学','政治科学','本科',50,'open'),(52,'Harry','地质学这个专业以前非常的火，主要原因得益于石油行业的蓬勃发展。但是这个行业也是波动的非常剧烈。除此之外，你的出路可以是从事学术研究，教授地质学，或者进入博物馆这这样的地方。\r\n薪水可能不会像你想要的那样高。但是在博物馆或环境自然中心工作是很愉快的事情。','德克萨斯大学奥斯丁分校','地质科学','本科',4,'open'),(53,'Hans','纯物理是比较抽象的东西，周围的同学也都是极其聪明的人，需要有一定的理想主义精神才能学，毕竟不像金融和计算机这种专业，物理专业毕业的同学通常会很自然地进入研究生和博士继续对自己的领域进行深究。数学对于物理来说是极其重要的，同时需要保持好奇心和刨根问底的精神，教授和同学都会很友好地回答我的问题。','加州大学洛杉矶分校','物理学','本科',44,'open');
