INSERT INTO `tutors` VALUES (8,NULL,'Erik','研究生','Erik学长本科毕业于康奈尔大学机械工程专业，研究生获得滑铁卢大学全奖并主攻机械工程机器人方向，曾在金矿公司研究怎么挖金矿，养了三只兔子。','Erik.png','open'),(9,NULL,'Joyce','研究生','Joyce学姐本科毕业于伦敦大学学院（UCL）数学专业，研究生毕业于剑桥大学经济金融学。目前在上海一家外企咨询公司就职。跳舞达人，爱吃茄子。','Joyce.png','open'),(10,'','Cathy','研究生','Cathy学姐本科和研究生都毕业于伦敦政治经济学院（LSE）社会学专业，专注性别气质研究，喜欢洞察生活中细节且有趣的小事，并联想它与更广阔的社会结构的对接。目前从事品牌咨询和市场文化研究，帮助品牌找到有意义的定位与市场共情。另外参与心理咨询辅助工作，做心理热线接听员。','Cathy.png','open'),(11,'','Sunny','研究生','Sunny 学姐本科毕业于墨尔本大学商学院，荣获奖学金派送至智利参与小松康明斯集团咨询项目，在校期间于纽约大学Stern商学院交换学习。研究生毕业于纽约大学整合市场营销专业，完成所有Stern商学院品牌管理与奢侈品市场营销MBA课程。曾任LVMH管培生，在美国VOGUE、Hermes、Burberry等多个品牌市场部工作。现任上海纽约大学研究生与研修办公室Senior Associate，Make Up For Ever Academy学院特邀讲师，禧芮高定婚纱店主理人。\r\n','Sunny.png','open'),(12,NULL,'Ming','研究生','Ming学姐是广东外语外贸大学翻译专业学士，蒙特雷国际研究院翻译本地化管理硕士，现就职谷歌，担任语言经理。梦想能够解放固化的中国教育现状。有着一百个梦想，一个个慢慢地去实现。','Ming.png','open'),(13,NULL,'小雨','研究生','小雨学姐是伦敦大学学院（UCL）材料与视觉文化（人类学院）的硕士，专注于青年文化与性别研究，曾在国内领先市场咨询公司实习，服务于可口可乐、腾讯等国内外知名品牌。','Xiaoyu.png','open'),(14,NULL,'Violet','研究生','Violet学姐是人大经济学硕士和伦敦政治经济学院（LSE）管理学硕士，LSE全部科目Distinction，目前就职于国内Top互联网公司。不算是个成功的人，但是个走了很多弯路可以分享失败经验的咸鱼。','Violet.png','open'),(15,NULL,'Maggie','研究生','Maggie学姐本科毕业于伦敦大学学院（UCL）生物医学专业，现于墨尔本大学攻读教育系研究生，专精学生健康方向。目前忙于组织各种关注留学生心理健康的活动。热爱黑猫警长，毕竟万事都有教育意义。','Maggie.png','open'),(16,'','盛学长','本科','本科毕业于精品文理学院Centre College计算机和数学双专业。间隔年分别在北京和杭州顶级互联网公司实习后回到美国，在硅谷一家初创公司做了两年技术主管，负责公司billing系统的维护和开发。目前就职于亚马逊aws，进行aurora db的性能优化工作。平时喜欢摄影，摇滚和狗。','sy1.png','open'),(17,'','水水','本科','水水学姐本科毕业于南京大学英语文学专业，研究生毕业于伦敦大学亚非学院（SOAS）社会人类学专业，专注于观察人与社会的联结和多元文化碰撞，从人类学的角度思考商业问题。曾在多家知名乙方公司给500强企业提供商业定性分析。','Screen Shot 2021-01-03 at 7.05.32 PM.png','open'),(18,'','高学长','研究生','高学长本科毕业于普渡大学土木工程专业，细分领域为结构设计，研究生毕业于德克萨斯大学奥斯汀分校的土木工程专业，细分领域为工程管理。现就职于中国金茂集团，负责地产投资拿地相关工作。平时喜欢看球和撸猫。','GGGG.png','open'),(19,'','李学长','本科','李学长本科毕业于罗切斯特大学音频音乐工程专业，现在在北京做音乐、影视的录音、混音及母带工作。希望能帮助到想在国内外大学选择音乐专业，以及想从事音乐行业的同学。','lishui1.png','open'),(20,'','Gloria','本科','Gloria学姐本科保送至南大英语系，硕士被院系推荐至蒙特雷高翻院读翻译与本地化管理，目前在国内头部本地化公司做项目管理，喜欢画画表演也喜欢编程，never settle。','gloria chen1.png','open'),(21,'','陈学姐','博士','陈学姐本科毕业于伦敦大学学院物理专业，研究生在帝国理工学院时更细化地选择了物理学中的光学领域，在剑桥博士期间的研究是关于量子探测器的光学分析、模拟与实验。从博士期间开始进行科普创作，毕业后开始专职从事科学传播工作。','CCCC.png','open'),(22,'','王学姐','本科','王学姐本科毕业于芝加哥艺术学院的油画系和版画系，是纯艺术的学士学位。平时其他的领域也有涉足，比如摄影、设计和雕塑。兴趣广泛，射箭爬山野营染头发打游戏都会，朋克养生。她的作品主要以画和画处在的各种表面映射客观和主观的碰撞，希望可以和观者对于人与事之间的关系产生共鸣。','王庭艺1.png','open'),(23,'','朱学长','研究生','朱学长本科就读于西交利物浦大学会计学专业，硕士毕业于英国卡斯商学院投资管理专业。毕业后在美国道富银行（杭州）从事另类投资财务报告工作，在商科经管类留学生回国定位，500强企业投递技巧，能够提供自己的见解，拨开迷雾。','ZZZZ.png','open'),(24,'','Sophia','本科','Sophia学姐本科毕业于多伦多大学商业管理的市场营销专业，目前于国内从事娱乐营销行业。专注于影视剧、综艺、电影、艺人的全案营销，案例包括2018的《这就是街舞》、2019《鹤唳华亭》、2020《三十而已》等多个知名影视全案营销。','Sophia1 .png','open'),(25,'','易学姐','研究生','易学姐本科毕业于上海交通大学医学院食品卫生与营养专业，硕士毕业于伦敦大学流行病学专业，获得一等荣誉学位（Graduate with Distinction），专注研究饮食模式的社会经济学影响因素，曾在三甲医院，疾控，战略管理咨询有过工作经历。','YiXinxuan.png','open'),(26,'','潘学长','博士','潘学长留英9年，在英国布里斯托大学读完了本科后，获得一等荣誉及电子通信专业的最佳毕业设计奖，申请直博，读了本校无线通信工程。博士毕业后，回到中国进入贝尔实验室（中国）就职三年，期间在职读了工商管理硕士，去日本早稻田大学商学院交换了半年。回国后进入大数据领域创业公司，后进入人工智能领域，并支撑上海市政府主办第一届世界人工智能大会。现进入普华永道创新中心工作，对新行业应用领域与创业感兴趣。','PPPP.png','open'),(27,'','王学长','研究生','王学长本科毕业于南京师范大学对外汉语专业，研究生毕业于美国佛罗里达大学教育学专业。目前在语言辅导和留学咨询方面都有个人项目进行中。','WWWW.png','open'),(28,'','Mandy','研究生','Mandy学姐本科就读于西蒙菲莎大学并获得传播学荣誉学士，研究生毕业于南加州大学安娜堡传播学院。在时尚消费品、地产、食品等行业均有过市场传播经验。最近喜欢研究可持续时尚品牌，探索企业社责任对品牌与产品的影响。单一产地咖啡豆爱好者。','mandy1.png','open'),(29,'','Elina学姐','本科','Elina学姐本科毕业于纽约帕森斯设计学院，专攻女装设计。在校期间曾实习于Zac Posen，Marchesa，Lanyu等知名品牌。回国后在圣迪奥时装有限公司担任过设计师助理，也做过作品集老师。','gyj1.png','open'),(30,'','赵学姐','研究生','赵学姐本科毕业于南京大学城市规划专业，研究生毕业于墨尔本大学同专业，毕业后曾在上海复旦规划建筑设计研究院就职。熟悉中澳规划体系及规划法，擅长战略规划、城市总体规划、城市设计、旅游规划、产业规划、城市研究等方向。近年参与国家科技部十三五重点研发计划项目-长三角城市群生态安全保障关键技术研究与集成示范，参与湖南省张家界七星山旅游度假区系列项目、美国弗吉尼亚和畅兰斯登健康小镇系列项目等。','yatong1.png','open'),(31,'','Vanessa','研究生','Vanessa学姐本科就读于利物浦大学环境与规划专业，研究生就读于曼彻斯特大学城市与规划专业。现就职于中国建筑研究中心做乡村振兴以及文旅小镇规划工作。曾于五大行之一的第一太平洋戴维斯负责商业项目的前期调研；曾就职于GOA大象设计从事设计规划师，参与项目的规划设计工作。项目经历包括阜城阜丰公园商业综合体，北京国瑞瑞福园社区商业项目，北京中海瀛海商业综合体等。 ','vanessa1.png','open'),(32,'','胡学姐','研究生','胡学姐本科毕业于暨南大学生物医学工程专业，毕业后曾在多家器械公司、制药公司、CDC实习。 之后在美国Drexel University 生物医学工程专业完成硕士，在校期间着重于药品/器械上市/规划以及监管方面的学习，也对流行病和医疗管理方面有所涉及。目前就职于ACMA（唯一一家针对医学事务的认证机构），为亚州地区负责人。','HHHH.png','open'),(33,'','Grace','研究生','Grace学姐本科就读于滑铁卢大学心理和传媒双专业，副修商科并进入科技公司市场营销部门以及多个心理研究室进行带薪实习项目；后前往多伦多大学学习人力资源及劳动关系，主攻谈判方向。研究生毕业后于大学内担任学科学业顾问，为学生提供日常课程规划并为学生未来就业方向提供指导。','grace1.png','open'),(34,'','董学长','研究生','董学长本科毕业于浙江大学自动化控制专业，目前在加州大学圣地亚哥分校（UCSD）攻读电子与计算机工程硕士，细分领域为机器人控制以及智能系统，主要的研究方向是运动规划和强化学习。','DDDD.png','open'),(35,'','刘学姐','研究生','刘学姐在国内初中毕业后获得新加坡政府全额奖学金，在新加坡完成四年初高中的学习生活。于新加坡参加A-Level考试并赴英国开始本科学习。本科就读于英国纽卡斯尔大学会计与金融专业，研究生毕业于英国剑桥大学金融与经济专业。','LiuYimeng.png','open'),(36,'','黄学姐','研究生','黄学姐本科毕业于中国人民大学英语文学专业，研究生就读于伦敦艺术大学下的伦敦时尚学院，专业为时尚策略营销。曾在全球各大知名品牌做过运营、策划和品牌营销类工作。','HuangYifan.png','open'),(37,'','Josie','研究生','Josie学姐硕士毕业于墨尔本大学金融学专业，目前在普华永道创智中心，专注于行业研究及创新咨询项目，喜欢探索新鲜事物，养了两只猫猫。','lty1.png','open'),(38,'','邵学姐','本科','邵学姐本科毕业于美国普渡大学酒店及旅游管理专业。毕业后回国在北京瑰丽酒店工作一年左右时间，随后转行到英国知名上市猎头公司从事猎头顾问工作，负责中高管岗位的招聘，领域涉及酒店及旅游、快速消费品、金融、消费互联网等。帮很多在职业选择迷茫的人提供职业机会和发展建议，也在工作里交到很多各行各业的朋友。','Shaonan1.png','open'),(39,'','Ivy','本科','Ivy学姐本科毕业于西交利物浦大学传播学专业，研究生即将前往格拉斯哥大学攻读全球市场与本地创意方向。本科期间旅居多个欧洲国家，曾在罗马尼亚的孤儿院支教，也曾在希腊的小城实习。上台演过音乐剧，也出过自己的单曲。Ivy喜欢把路上的见闻和获取的信息都串联在一起，形成自己的知识网络并去连接新的知识，结交新的朋友。','Ivy.jpeg','open');
